    AGJQW.g_Format = function(dtExpression, sFormat, sCulture) {
        if (AGJQW.g_IsNV(sCulture)) {sCulture = "en-US";}

        var oCulture = AGJQW_Cultures[sCulture];
        var sBuff;
        var lBuff;

	    if (sFormat == "%d") {sFormat = "d";}
	    if (sFormat == "%f") {sFormat = "f";}
	    if (sFormat == "%F") {sFormat = "F";}
	    if (sFormat == "%g") {sFormat = "g";}
	    if (sFormat == "%h") {sFormat = "h";}
	    if (sFormat == "%H") {sFormat = "H";}
	    if (sFormat == "%K") {sFormat = "K";}
	    if (sFormat == "%m") {sFormat = "m";}
	    if (sFormat == "%M") {sFormat = "M";}
	    if (sFormat == "%s") {sFormat = "s";}
	    if (sFormat == "%t") {sFormat = "t";}
	    if (sFormat == "%y") {sFormat = "y";}
	    if (sFormat == "%z") {sFormat = "z";}

        sFormat = sFormat.replaceAll("\\d", "{~°|1}");
        sFormat = sFormat.replaceAll("\\f", "{~°|2}");
        sFormat = sFormat.replaceAll("\\F", "{~°|3}");
        sFormat = sFormat.replaceAll("\\g", "{~°|4}");
        sFormat = sFormat.replaceAll("\\h", "{~°|5}");
        sFormat = sFormat.replaceAll("\\H", "{~°|6}");
        sFormat = sFormat.replaceAll("\\K", "{~°|7}");
	    sFormat = sFormat.replaceAll("\\m", "{~°|8}");
        sFormat = sFormat.replaceAll("\\M", "{~°|9}");
        sFormat = sFormat.replaceAll("\\s", "{~°|10}");
        sFormat = sFormat.replaceAll("\\t", "{~°|11}");
        sFormat = sFormat.replaceAll("\\y", "{~°|12}");
        sFormat = sFormat.replaceAll("\\z", "{~°|13}");
        sFormat = sFormat.replaceAll("\\w", "{~°|14}");
        sFormat = sFormat.replaceAll("\\Q", "{~°|15}");

        //d

        if (sFormat.indexOf("dddd") != -1)
	    {
            lBuff = dtExpression.getDay() + 1;
		    sFormat = sFormat.replaceAll("dddd", "{~°|3" + lBuff + "}");
	    }

        if (sFormat.indexOf("ddd") != -1)
	    {
            lBuff = dtExpression.getDay() + 1;
		    sFormat = sFormat.replaceAll("ddd", "{~°|4" + lBuff + "}");
	    }

        if (sFormat.indexOf("dd") != -1)
	    {
		    sBuff = dtExpression.getDate().toString();
		    if (sBuff.length == 1)
		    {
			    sBuff = "0" + sBuff;
		    }
		    sFormat = sFormat.replaceAll("dd", sBuff);
	    }

        if (sFormat.indexOf("d") != -1)
	    {
		    sBuff = dtExpression.getDate().toString();
		    sFormat = sFormat.replaceAll("d", sBuff);
	    }
        
        //f

        if (sFormat.indexOf("fff") != -1)
	    {
		    sBuff = dtExpression.getMilliseconds().toString();
		    while (sBuff.length < 3)
		    {
			    sBuff = "0" + sBuff;
		    }
		    sFormat = sFormat.replaceAll("fff", sBuff);
	    }

        if (sFormat.indexOf("ff") != -1)
	    {
            lBuff = Math.floor(dtExpression.getMilliseconds() / 10);
		    sBuff = lBuff.toString();
		    if (sBuff.length < 2)
		    {
			    sBuff = "0" + sBuff;
		    }
		    sFormat = sFormat.replaceAll("ff", sBuff);
	    }

        if (sFormat.indexOf("f") != -1)
	    {
            lBuff = Math.floor(dtExpression.getMilliseconds() / 100);
		    sBuff = lBuff.toString();
		    sFormat = sFormat.replaceAll("f", sBuff);
	    }

        //F

        if (sFormat.indexOf("FFF") != -1)
	    {
		    sBuff = dtExpression.getMilliseconds().toString();
		    while (sBuff.length < 3)
		    {
			    sBuff = "0" + sBuff;
		    }
            if (sBuff == "000") {
                sBuff = "";
            }
		    sFormat = sFormat.replaceAll("FFF", sBuff);
	    }

        if (sFormat.indexOf("FF") != -1)
	    {
            lBuff = Math.floor(dtExpression.getMilliseconds() / 10);
		    sBuff = lBuff.toString();
		    if (sBuff.length < 2)
		    {
			    sBuff = "0" + sBuff;
		    }
            if (sBuff == "00") {
                sBuff = "";
            }
		    sFormat = sFormat.replaceAll("FF", sBuff);
	    }

        if (sFormat.indexOf("F") != -1)
	    {
            lBuff = Math.floor(dtExpression.getMilliseconds() / 100);
		    sBuff = lBuff.toString();
            if (sBuff == "0") {
                sBuff = "";
            }
		    sFormat = sFormat.replaceAll("F", sBuff);
	    }
  
        //g


        //h

        if (sFormat.indexOf("hh") != -1)
	    {
		    lBuff = dtExpression.getHours();
            if (lBuff > 12) {
                lBuff = lBuff - 12;
            }
            sBuff = lBuff.toString();
		    if (sBuff.length < 2)
		    {
			    sBuff = "0" + sBuff;
		    }
		    sFormat = sFormat.replaceAll("hh", sBuff);
	    }

        if (sFormat.indexOf("h") != -1)
	    {
		    lBuff = dtExpression.getHours();
            if (lBuff > 12) {
                lBuff = lBuff - 12;
            }
            sBuff = lBuff.toString();
		    sFormat = sFormat.replaceAll("h", sBuff);
	    }

        //H

        if (sFormat.indexOf("HH") != -1)
	    {
		    sBuff = dtExpression.getHours().toString();
		    if (sBuff.length < 2)
		    {
			    sBuff = "0" + sBuff;
		    }
		    sFormat = sFormat.replaceAll("HH", sBuff);
	    }

        if (sFormat.indexOf("H") != -1)
	    {
		    sBuff = dtExpression.getHours().toString();
		    sFormat = sFormat.replaceAll("H", sBuff);
	    }

        //K

        //m

	    if (sFormat.indexOf("mm") != -1)
	    {
		    sBuff = dtExpression.getMinutes().toString();
		    if (sBuff.length == 1)
		    {
			    sBuff = "0" + sBuff;
		    }
		    sFormat = sFormat.replaceAll("mm", sBuff);
	    }

        if (sFormat.indexOf("m") != -1)
	    {
		    sBuff = dtExpression.getMinutes().toString();
		    sFormat = sFormat.replaceAll("m", sBuff);
	    }

        //M

        if (sFormat.indexOf("MMMM") != -1)
	    {
            lBuff = dtExpression.getMonth() + 1;
		    sFormat = sFormat.replaceAll("MMMM", "{~°|6" + lBuff + "}");
	    }

        if (sFormat.indexOf("MMM") != -1)
	    {
            lBuff = dtExpression.getMonth() + 1;
		    sFormat = sFormat.replaceAll("MMM", "{~°|8" + lBuff + "}");
	    }

        if (sFormat.indexOf("MM") != -1)
	    {
            lBuff = dtExpression.getMonth() + 1;
		    sBuff = lBuff.toString();
		    if (sBuff.length == 1)
		    {
			    sBuff = "0" + sBuff;
		    }
		    sFormat = sFormat.replaceAll("MM", sBuff);
	    }

        if (sFormat.indexOf("M") != -1)
	    {
            lBuff = dtExpression.getMonth() + 1;
		    sBuff = lBuff.toString();
		    sFormat = sFormat.replaceAll("M", sBuff);
	    }

        //s

	    if (sFormat.indexOf("ss") != -1)
	    {
		    sBuff = dtExpression.getSeconds().toString();
		    if (sBuff.length == 1)
		    {
			    sBuff = "0" + sBuff;
		    }
		    sFormat = sFormat.replaceAll("ss", sBuff);
	    }

        if (sFormat.indexOf("s") != -1)
	    {
		    sBuff = dtExpression.getSeconds().toString();
		    sFormat = sFormat.replaceAll("s", sBuff);
	    }

        //t

        if (sFormat.indexOf("tt") != -1)
        {
            lBuff = dtExpression.getHours();
            if (lBuff <= 11) {
                sFormat = sFormat.replaceAll("tt", "{~°|50}");
            } else {
                sFormat = sFormat.replaceAll("tt", "{~°|51}");
            }
        }

        if (sFormat.indexOf("t") != -1)
        {
            lBuff = dtExpression.getHours();
            if (lBuff <= 11) {
                sFormat = sFormat.replaceAll("t", "{~°|55}");
            } else {
                sFormat = sFormat.replaceAll("t", "{~°|56}");
            }
        }

        //y

        if (sFormat.indexOf("yyyy") != -1)
        {
            sBuff = dtExpression.getFullYear().toString();
            sFormat = sFormat.replaceAll("yyyy", sBuff);
        }

        if (sFormat.indexOf("yyy") != -1)
        {
            sBuff = dtExpression.getFullYear().toString();
            sFormat = sFormat.replaceAll("yyy", sBuff.substring(1,4));
        }

        if (sFormat.indexOf("yy") != -1)
        {
            sBuff = dtExpression.getFullYear().toString();
            sFormat = sFormat.replaceAll("yy", sBuff.substring(2,4));
        }

        if (sFormat.indexOf("y") != -1)
        {
            sBuff = dtExpression.getFullYear().toString();
            sBuff = sBuff.substring(2,4);
            if (sBuff.substring(0,1) == "0") {
                sBuff = sBuff.substring(1,2);
            }
            sFormat = sFormat.replaceAll("y", sBuff);
        }

        //z

        //w

        //Q

        if (sFormat.indexOf("Q") != -1)
        {
            lBuff = dtExpression.getMonth() + 1;
            if (lBuff >= 1 && lBuff <= 3) {
                sBuff = "1";
            }
            else if (lBuff >= 4 && lBuff <= 6) {
                sBuff = "2";
            }
            else if (lBuff >= 7 && lBuff <= 9) {
                sBuff = "3";
            }
            else if (lBuff >= 10 && lBuff <= 12) {
                sBuff = "4";
            }
            sFormat = sFormat.replaceAll("Q", sBuff);
        }


        sFormat = sFormat.replaceAll("{~°|1}", "d");
        sFormat = sFormat.replaceAll("{~°|2}", "f");
        sFormat = sFormat.replaceAll("{~°|3}", "F");
        sFormat = sFormat.replaceAll("{~°|4}", "g");
        sFormat = sFormat.replaceAll("{~°|5}", "h");
        sFormat = sFormat.replaceAll("{~°|6}", "H");
        sFormat = sFormat.replaceAll("{~°|7}", "K");
	    sFormat = sFormat.replaceAll("{~°|8}", "m");
        sFormat = sFormat.replaceAll("{~°|9}", "M");
        sFormat = sFormat.replaceAll("{~°|10}", "s");
        sFormat = sFormat.replaceAll("{~°|11}", "t");
        sFormat = sFormat.replaceAll("{~°|12}", "y");
        sFormat = sFormat.replaceAll("{~°|13}", "z");
        sFormat = sFormat.replaceAll("{~°|14}", "w");
        sFormat = sFormat.replaceAll("{~°|15}", "Q");

        for (lBuff = 1; lBuff <= 7; lBuff++) {
            sFormat = sFormat.replaceAll("{~°|3" + lBuff + "}", oCulture["DN" + lBuff]);
            sFormat = sFormat.replaceAll("{~°|4" + lBuff + "}", oCulture["ADN" + lBuff]);
        }

        for (lBuff = 1; lBuff <= 12; lBuff++) {
            sFormat = sFormat.replaceAll("{~°|6" + lBuff + "}", oCulture["MN" + lBuff]);
            sFormat = sFormat.replaceAll("{~°|8" + lBuff + "}", oCulture["AMN" + lBuff]);
        }

        if (sFormat.indexOf("{~°|50}") != -1) {
            sFormat = sFormat.replaceAll("{~°|50}", oCulture["AMD"]);
        }

        if (sFormat.indexOf("{~°|51}") != -1) {
            sFormat = sFormat.replaceAll("{~°|51}", oCulture["PMD"]);
        }

        if (sFormat.indexOf("{~°|55}") != -1) {
            sBuff = oCulture["AMD"];
            if (sBuff.length >= 1) {
                sBuff = sBuff.substring(0,1);
            }
            sFormat = sFormat.replaceAll("{~°|55}", sBuff);
        }

        if (sFormat.indexOf("{~°|56}") != -1) {
            sBuff = oCulture["PMD"];
            if (sBuff.length >= 1) {
                sBuff = sBuff.substring(0,1);
            }
            sFormat = sFormat.replaceAll("{~°|56}", sBuff);
        }

        return sFormat;
    }

    AGJQW.g_DayOfYear = function(DateTime) {
        var dtFirstDayInYear = new Date(DateTime.getFullYear(),0,1);
        return Math.floor((DateTime - dtFirstDayInYear) / 86400000) + 1;
    }

    AGJQW.g_GetWeekOfYear = function(time, rule, firstDayOfWeek) {
        var lReturn = 0;
        var dtBase = new Date(time.getFullYear(), 0, 1, 0, 0, 0, 0);
        var dtBuff;
        var lDay = 0;
        var lWeek = 0;
        switch (rule)
        {
            case AGJQW.E_CALENDARWEEKRULES.CWR_FIRSTDAY:
                for (lDay = 0; lDay <= 6; lDay++)
                {
                    dtBuff = new Date(dtBase.getTime() + (lDay * 1000 * 60 * 60 * 24));
                    if (dtBuff.getDay() == firstDayOfWeek)
                    {
                        break; 
                    }
                }

                if (dtBase.getDay() == firstDayOfWeek)
                {
                    lReturn = Math.floor((AGJQW.g_DayOfYear(time) - AGJQW.g_DayOfYear(dtBuff)) / 7) + 1;
                }
                else
                {
                    lReturn = Math.floor((AGJQW.g_DayOfYear(time) - AGJQW.g_DayOfYear(dtBuff)) / 7) + 2;
                }
                break;
            case AGJQW.E_CALENDARWEEKRULES.CWR_FIRSTFULLWEEK:
                for (lDay = 0; lDay <= 6; lDay++)
                {
                    dtBuff = new Date(dtBase.getTime() + (lDay * 1000 * 60 * 60 * 24));
                    if (dtBuff.getDay() == firstDayOfWeek)
                    {
                        break;
                    }
                }

                lWeek = Math.floor((AGJQW.g_DayOfYear(time) - AGJQW.g_DayOfYear(dtBuff)) / 7) + 1;
                if (lWeek == 0)
                {
                    lReturn = AGJQW.g_GetWeekOfYear(new Date(time.getFullYear() - 1, 11, 31, 0, 0, 0, 0), AGJQW.E_CALENDARWEEKRULES.CWR_FIRSTFULLWEEK, firstDayOfWeek);
                }
                else
                {
                    lReturn = lWeek;
                }
                break;
            case AGJQW.E_CALENDARWEEKRULES.CWR_FIRSTFOURDAYWEEK:
                for (lDay = 0; lDay <= 12; lDay++)
                {
                    dtBuff = new Date(dtBase.getTime() + (lDay * 1000 * 60 * 60 * 24));
                    if (dtBuff.getDay() == firstDayOfWeek && AGJQW.g_DayOfYear(dtBuff) >= 5)
                    {
                        break;
                    }
                }

                lWeek = Math.floor((AGJQW.g_DayOfYear(time) - AGJQW.g_DayOfYear(dtBuff)) / 7) + 2;
                if (lWeek == 0)
                {
                    lReturn = GetWeekOfYear(new Date(time.getFullYear() - 1, 11, 31, 0, 0, 0, 0), AGJQW.E_CALENDARWEEKRULES.CWR_FIRSTFOURDAYWEEK, firstDayOfWeek);
                }
                else
                {
                    lReturn = lWeek;
                }
                break;
        }
        return lReturn;
    }


