    ///DateTime

    AGJQW.DateTime = function (Year, Month, Day, Hour, Minute, Second, Millisecond) {
        this.mp_oControl = null;
        if (AGJQW.g_IsNV(Year) == false  && AGJQW.g_IsNV(Month) && AGJQW.g_IsNV(Day) && AGJQW.g_IsNV(Hour) && AGJQW.g_IsNV(Minute) && AGJQW.g_IsNV(Second) && AGJQW.g_IsNV(Millisecond)) {
            if (Year.substring) {
                if (Year.indexOf("/Date(") != -1) {
                    this.mp_dtDateTime = AGJQW.g_ParseJSONDate(Year);
                }
                else {
                    this.mp_dtDateTime = new Date(0);
                }
            }
        }
        else if (AGJQW.g_IsNV(Year) && AGJQW.g_IsNV(Month) && AGJQW.g_IsNV(Day) && AGJQW.g_IsNV(Hour) && AGJQW.g_IsNV(Minute) && AGJQW.g_IsNV(Second) && AGJQW.g_IsNV(Millisecond)) {
            this.mp_dtDateTime = new Date(0);
        }
        else if (AGJQW.g_IsNV(Hour) && AGJQW.g_IsNV(Minute) && AGJQW.g_IsNV(Second) && AGJQW.g_IsNV(Millisecond) ) {
            this.mp_dtDateTime = new Date(Year, Month - 1, Day, 0, 0, 0, 0);
        }
        else if (AGJQW.g_IsNV(Millisecond)) {
            this.mp_dtDateTime = new Date(Year, Month - 1, Day, Hour, Minute, Second, 0);
        }
        else {
            this.mp_dtDateTime = new Date(Year, Month - 1, Day, Hour, Minute, Second, Millisecond);
        }
    };

    AGJQW.DateTime.prototype = {
        get Now(){
            var dtReturn = new AGJQW.DateTime();
            return dtReturn;
        },
        get DateTimePart(){
            return this.mp_dtDateTime;
        },
        set DateTimePart(value){
            this.mp_dtDateTime = value;
        },
        get v() {
            return this.mp_dtDateTime.getTime();
        }

    }

    AGJQW.DateTime.prototype.valueOf = function() {
        return this.mp_dtDateTime.getTime();
    };

    AGJQW.DateTime.prototype.SetControl = function (oControl) {
        this.mp_oControl = oControl;
    };

    //Initialize

    AGJQW.DateTime.prototype.SetDateTime = function (Year, Month, Day, Hour, Minute, Second) {
        this.mp_dtDateTime = new Date(Year, Month - 1, Day, Hour, Minute, Second, 0);
    }

    AGJQW.DateTime.prototype.SetDate = function (Year, Month, Day) {
        this.mp_dtDateTime = new Date(Year, Month - 1, Day, 0, 0, 0, 0);
    }

    AGJQW.DateTime.prototype.SetTime = function (Hour, Minute, Second) {
        this.mp_dtDateTime = new Date(0);
        this.mp_dtDateTime.setHours(Hour);
        this.mp_dtDateTime.setMinutes(Minute);
        this.mp_dtDateTime.setSeconds(Second);
    }

    AGJQW.DateTime.prototype.SetSecondFraction = function (Millisecond) {
        this.mp_dtDateTime = new Date(0);
        this.mp_dtDateTime.setMilliseconds(Millisecond);
    }

    AGJQW.DateTime.prototype.Millisecond = function() {
        return this.mp_dtDateTime.getMilliseconds();
    }

    AGJQW.DateTime.prototype.Second = function() {
        return this.mp_dtDateTime.getSeconds();
    }

    AGJQW.DateTime.prototype.Minute = function() {
        return this.mp_dtDateTime.getMinutes();
    }

    AGJQW.DateTime.prototype.Hour = function() {
        return this.mp_dtDateTime.getHours();
    }

    AGJQW.DateTime.prototype.Day = function() {
        return this.mp_dtDateTime.getDate();
    }

	AGJQW.DateTime.prototype.DayOfWeek = function() {
        return this.mp_dtDateTime.getDay();
	}

	AGJQW.DateTime.prototype.NumericDayOfWeek = function() {
        if (this.mp_oControl == null)
        {
            return -1;
        }
        var lWeekStartDay = this.mp_oControl.Configuration.FirstDayOfWeek;
        var lWeekDay = this.mp_dtDateTime.getDay();
        if ((lWeekDay - lWeekStartDay) >= 0)
        {
            return lWeekDay - lWeekStartDay + 1;
        }
        else
        {
            return lWeekDay + 8 - lWeekStartDay;
        }
	}

    AGJQW.DateTime.prototype.DayOfYear = function() {
        return AGJQW.g_DayOfYear(this.mp_dtDateTime);
    }

	AGJQW.DateTime.prototype.Week = function() {
        if (this.mp_oControl == null)
        {
            return -1;
        }
        else
        {
            if (this.mp_oControl.Configuration.ISO8601Weeks == false)
            {
                return AGJQW.g_GetWeekOfYear(this.mp_dtDateTime, this.mp_oControl.Configuration.CalendarWeekRule, this.mp_oControl.Configuration.FirstDayOfWeek);
            }
            else
            {
                var yDay = this.DayOfWeek();
                var dtBuff = this.mp_dtDateTime;
                if (yDay >= AGJQW.E_WEEKDAY.WD_MONDAY && yDay <= AGJQW.E_WEEKDAY.WD_WEDNESDAY)
                {
                    dtBuff = new Date(this.mp_dtDateTime.getTime() + (3 * 1000 * 60 * 60 * 24));
                }
                return AGJQW.g_GetWeekOfYear(dtBuff, AGJQW.E_CALENDARWEEKRULES.CWR_FIRSTFOURDAYWEEK, AGJQW.E_WEEKDAY.WD_MONDAY);
            }
        }
	}

    AGJQW.DateTime.prototype.Month = function() {
        return this.mp_dtDateTime.getMonth() + 1;
    }

    AGJQW.DateTime.prototype.Quarter = function() {
            switch (this.Month())
            {
                case 1:
                case 2:
                case 3:
                    return 1;
                case 4:
                case 5:
                case 6:
                    return 2;
                case 7:
                case 8:
                case 9:
                    return 3;
                case 10:
                case 11:
                case 12:
                    return 4;
            }
            return -1;
    }

    AGJQW.DateTime.prototype.Year = function() {
        return this.mp_dtDateTime.getFullYear();
    }

    AGJQW.DateTime.prototype.SetToCurrentDateTime = function() {
        this.mp_dtDateTime = new Date();
    }

    AGJQW.DateTime.prototype.Clear = function() {
        this.mp_dtDateTime = new Date(0);
    }

    AGJQW.DateTime.prototype.ToString = function(Format, Culture) {
        if (AGJQW.g_IsNV(Culture)) {Culture = "en-US";}
        return AGJQW.g_Format(this.mp_dtDateTime, Format, Culture);
    }

