    AGJQW.clsMath.prototype.DateTimeAdd = function (Interval, Number, dtDate) {
        var dtBuff = new Date(0);
        switch (Interval)
        {
            case AGJQW.E_INTERVAL.IL_MILLISECOND:
                dtBuff = new Date(dtDate.DateTimePart.getTime() + Number);
                break;
            case AGJQW.E_INTERVAL.IL_SECOND:
                dtBuff = new Date(dtDate.DateTimePart.getTime() + (Number * 1000));
                break;
            case AGJQW.E_INTERVAL.IL_MINUTE:
                dtBuff = new Date(dtDate.DateTimePart.getTime() + (Number * 1000 * 60));
                break;
            case AGJQW.E_INTERVAL.IL_HOUR:
                dtBuff = new Date(dtDate.DateTimePart.getTime() + (Number * 1000 * 60 * 60));
                break;
            case AGJQW.E_INTERVAL.IL_DAY:
                dtBuff = new Date(dtDate.DateTimePart.getTime() + (Number * 1000 * 60 * 60 * 24));
                break;
            case AGJQW.E_INTERVAL.IL_WEEK:
                dtBuff = new Date(dtDate.DateTimePart.getTime() + (Number * 1000 * 60 * 60 * 24 * 7));
                break;
            case AGJQW.E_INTERVAL.IL_MONTH:
                var lDay1;
                var lDay2;
                dtBuff = new Date(dtDate.DateTimePart.getTime());
                lDay1 = dtBuff.getDate();
                dtBuff.setMonth(dtBuff.getMonth() + Number);
                lDay2 = dtBuff.getDate();
                while ((lDay1 - lDay2) > 10)
                {
                    dtBuff = new Date(dtBuff.getTime() - (1000 * 60 * 60 * 24));
                    lDay2 = dtBuff.getDate();
                }
                break;
            case AGJQW.E_INTERVAL.IL_QUARTER:
                dtBuff1 = this.DateTimeAdd(AGJQW.E_INTERVAL.IL_MONTH, 3 * Number, dtDate);
                return dtBuff1;
                break;
            case AGJQW.E_INTERVAL.IL_YEAR:
                dtBuff1 = this.DateTimeAdd(AGJQW.E_INTERVAL.IL_MONTH, 12 * Number, dtDate);
                return dtBuff1;
                break;
        }
        var dtReturn = new AGJQW.DateTime();
        dtReturn.mp_dtDateTime = dtBuff;
        return dtReturn;
    }

    AGJQW.clsMath.prototype.DateTimeDiff = function (Interval, dtDate1, dtDate2) {

        var lReturn = 0;
        var tsResult = 0;
        var dtBuff;
        if (dtDate1.valueOf() == dtDate2.valueOf())
        {
            return 0;
        }
        switch (Interval)
        {
            case AGJQW.E_INTERVAL.IL_MILLISECOND:     
                tsResult = dtDate2.DateTimePart.getTime() - dtDate1.DateTimePart.getTime();
                lReturn = tsResult;
                return lReturn;
            case AGJQW.E_INTERVAL.IL_SECOND:
                tsResult = dtDate2.DateTimePart.getTime() - dtDate1.DateTimePart.getTime();
                lReturn = Math.floor(tsResult / 1000);
                return lReturn;
            case AGJQW.E_INTERVAL.IL_MINUTE:
                tsResult = dtDate2.DateTimePart.getTime() - dtDate1.DateTimePart.getTime();
                lReturn = Math.floor(tsResult / (1000 * 60));
                return lReturn;
            case AGJQW.E_INTERVAL.IL_HOUR:
                tsResult = dtDate2.DateTimePart.getTime() - dtDate1.DateTimePart.getTime();
                lReturn = Math.floor(tsResult / (1000 * 60 * 60));
                return lReturn;
            case AGJQW.E_INTERVAL.IL_DAY:
                tsResult = dtDate2.DateTimePart.getTime() - dtDate1.DateTimePart.getTime();
                lReturn = Math.floor(tsResult / (1000 * 60 * 60 * 24));
                return lReturn;
            case AGJQW.E_INTERVAL.IL_WEEK:
                tsResult = dtDate2.DateTimePart.getTime() - dtDate1.DateTimePart.getTime();
                lReturn = Math.floor(tsResult / (1000 * 60 * 60 * 24 * 7));
                return lReturn;
            case AGJQW.E_INTERVAL.IL_MONTH:
                    if (dtDate2 > dtDate1)
                    {
                        dtBuff = dtDate2;
                        while (dtBuff > dtDate1)
                        {
                            dtBuff = this.DateTimeAdd(AGJQW.E_INTERVAL.IL_MONTH, -1, dtBuff);
                            if (dtBuff >= dtDate1)
                            {
                                lReturn = lReturn + 1;
                            }
                        }
                        return lReturn;
                    }
                    else
                    {
                        dtBuff = dtDate2;
                        while (dtBuff.valueOf() < dtDate1.valueOf())
                        {
                            dtBuff = this.DateTimeAdd(AGJQW.E_INTERVAL.IL_MONTH, 1, dtBuff);
                            if (dtBuff.valueOf() <= dtDate1.valueOf())
                            {
                                lReturn = lReturn - 1;
                            }
                        }
                        return lReturn;
                    }
            case AGJQW.E_INTERVAL.IL_YEAR:
                    if (dtDate2 > dtDate1)
                    {
                        dtBuff = dtDate2;
                        while (dtBuff > dtDate1)
                        {
                            dtBuff = this.DateTimeAdd(AGJQW.E_INTERVAL.IL_YEAR, -1, dtBuff);
                            if (dtBuff >= dtDate1)
                            {
                                lReturn = lReturn + 1;
                            }
                        }
                        return lReturn;
                    }
                    else
                    {
                        dtBuff = dtDate2;
                        while (dtBuff.valueOf() < dtDate1.valueOf())
                        {
                            dtBuff = this.DateTimeAdd(AGJQW.E_INTERVAL.IL_YEAR, 1, dtBuff);
                            if (dtBuff.valueOf() <= dtDate1.valueOf())
                            {
                                lReturn = lReturn - 1;
                            }
                        }
                        return lReturn;
                    }
        }
        return 0;

    }
