	AGJQW.clsMath.prototype.GetXCoordinateFromDate = function(dtCoordinate) {
        return (this.DateTimeDiff(this.mp_oControl.CurrentViewObject.Interval, this.mp_oControl.CurrentViewObject.TimeLine.StartDate, dtCoordinate) / this.mp_oControl.CurrentViewObject.Factor) + this.mp_oControl.CurrentViewObject.TimeLine.f_lStart;
	}
