	AGJQW.clsMath.prototype.mp_GetSeconds = function(yInterval, lFactor) {
        if (lFactor < 0)
        {
            lFactor = lFactor * -1;
        }
        switch (yInterval)
        {
            case AGJQW.E_INTERVAL.IL_SECOND:
                return lFactor;
            case AGJQW.E_INTERVAL.IL_MINUTE:
                return lFactor * 60;
            case AGJQW.E_INTERVAL.IL_HOUR:
                return lFactor * 3600;
            case AGJQW.E_INTERVAL.IL_DAY:
                return lFactor * 86400;
        }
        return -1;
	}

	AGJQW.clsMath.prototype.mp_QuickSortTB = function(aTimeBlocks, StartIndex, EndIndex) {
        // StartIndex = subscript of beginning of array
        // EndIndex = subscript of end of array

        var MiddleIndex;
        if (StartIndex < EndIndex)
        {
            MiddleIndex = this.mp_QSPartitionTB(aTimeBlocks, StartIndex, EndIndex);
            this.mp_QuickSortTB(aTimeBlocks, StartIndex, MiddleIndex);   // sort first section
            this.mp_QuickSortTB(aTimeBlocks, MiddleIndex + 1, EndIndex);    // sort second section
        }
        return;
	}

	AGJQW.clsMath.prototype.mp_QSPartitionTB = function(aTimeBlocks, StartIndex, EndIndex) {
        var oX = aTimeBlocks.tb[StartIndex];
        var x = oX.dtStart;
        var i = StartIndex - 1;
        var j = EndIndex + 1;
        var temp;
        do
        {
            do
            {
                j--;
                oX = aTimeBlocks.tb[j];
            } while (x < oX.dtStart); //Change to > for descending

            do
            {
                i++;
                oX = aTimeBlocks.tb[i];
            } while (x > oX.dtStart); //Change to < for descending

            if (i < j)
            {
                temp = aTimeBlocks.tb[i];
                aTimeBlocks.tb[i] = aTimeBlocks.tb[j];
                aTimeBlocks.tb[j] = temp;
            }

        } while (i < j);
        return j;           // returns middle subscript  
	}

	AGJQW.clsMath.prototype.GetTierIndex = function(Number) {
        var sNumber = null;
        var lLastDigit = 0;
        sNumber = Number.toString();
        lLastDigit = sNumber.substring(sNumber.length - 1);
        if (lLastDigit == 0)
        {
            return "10";
        }
        else
        {
            return lLastDigit.toString();
        }
	}

