	AGJQW.clsMouseKeyboardEvents.prototype.CursorPosition = function(X, Y) {
        if (this.mp_oControl.VerticalScrollBar.ScrollBar.OverControl(X, Y) == true)
        {
            return AGJQW.E_EVENTTARGET.EVT_VSCROLLBAR;
        }
        else if (this.mp_oControl.HorizontalScrollBar.ScrollBar.OverControl(X, Y) == true)
        {
            return AGJQW.E_EVENTTARGET.EVT_HSCROLLBAR;
        }
        else if (this.mp_oControl.f_TimeLineScrollBar.ScrollBar.OverControl(X, Y) == true)
        {
            return AGJQW.E_EVENTTARGET.EVT_TIMELINESCROLLBAR;
        }
        else if (this.mp_oControl.Treeview.OverControl(X, Y) == true)
        {
            return AGJQW.E_EVENTTARGET.EVT_TREEVIEW;
        }
        else if (this.mp_bOverSplitter(X, Y) == true)
        {
            return AGJQW.E_EVENTTARGET.EVT_SPLITTER;
        }
        else if (this.mp_bOverEmptySpace(Y) == true)
        {
            return AGJQW.E_EVENTTARGET.EVT_NONE;
        }
        else if (this.mp_bOverTimeLine(X, Y) == true)
        {
            return AGJQW.E_EVENTTARGET.EVT_TIMELINE;
        }
        else if (this.mp_bOverSelectedColumn(X, Y) == true)
        {
            return AGJQW.E_EVENTTARGET.EVT_SELECTEDCOLUMN;
        }
        else if (this.mp_bOverColumn(X, Y) == true)
        {
            return AGJQW.E_EVENTTARGET.EVT_COLUMN;
        }
        else if (this.mp_bOverSelectedRow(X, Y) == true)
        {
            return AGJQW.E_EVENTTARGET.EVT_SELECTEDROW;
        }
        else if (this.mp_bOverRow(X, Y) == true)
        {
            return AGJQW.E_EVENTTARGET.EVT_ROW;
        }
        else if (this.mp_bOverSelectedPercentage(X, Y) == true && this.mp_yOperationModifier != AGJQW.E_OPERATIONMODIFIER.OPM_PREDECESSORMODE)
        {
            return AGJQW.E_EVENTTARGET.EVT_SELECTEDPERCENTAGE;
        }
        else if (this.mp_bOverPercentage(X, Y) == true && this.mp_yOperationModifier != AGJQW.E_OPERATIONMODIFIER.OPM_PREDECESSORMODE)
        {
            return AGJQW.E_EVENTTARGET.EVT_PERCENTAGE;
        }
        else if (this.mp_bOverSelectedTask(X, Y) == true)
        {
            return AGJQW.E_EVENTTARGET.EVT_SELECTEDTASK;
        }
        else if (this.mp_bOverTask(X, Y) == true)
        {
            return AGJQW.E_EVENTTARGET.EVT_TASK;
        }
        else if (this.mp_bOverSelectedPredecessor(X, Y) == true)
        {
            return AGJQW.E_EVENTTARGET.EVT_SELECTEDPREDECESSOR;
        }
        else if (this.mp_bOverPredecessor(X, Y) == true)
        {
            return AGJQW.E_EVENTTARGET.EVT_PREDECESSOR;
        }
        else if (this.mp_bOverClientArea(X, Y) == true)
        {
            return AGJQW.E_EVENTTARGET.EVT_CLIENTAREA;
        }
        else
        {
            return AGJQW.E_EVENTTARGET.EVT_NONE;
        }
	}

	AGJQW.clsMouseKeyboardEvents.prototype.mp_EO_SPLITTERMOVEMENT = function(yMouseKeyBoardEvent, X, Y) {
        if (this.mp_oControl.AllowSplitterMove == false)
        {
            return;
        }
        switch (yMouseKeyBoardEvent)
        {
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseHover:
                this.mp_SetCursor(AGJQW.E_CURSORTYPE.CT_MOVESPLITTER);
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseDown:
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseMove:
                this.mp_oControl.clsG.mp_EraseReversibleFrames();
                this.mp_DrawMovingReversibleFrame(X, 0, X + 2, 0, AGJQW.E_FOCUSTYPE.FCT_VERTICALSPLITTER);
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseUp:
                var lWidth = 0;
                if (X > (this.mp_oControl.clsG.Width() - 10))
                {
                    X = this.mp_oControl.clsG.Width() - 10;
                }

                if (X < 10)
                {
                    X = 10;
                }
                lWidth = this.mp_oControl.Columns.Width;
                if (X > lWidth)
                {
                    X = lWidth;
                    this.mp_oControl.Splitter.Position = X;
                    this.mp_oControl.HorizontalScrollBar.Value = 0;
                }
                else if (X > (lWidth - this.mp_oControl.HorizontalScrollBar.Value))
                {
                    X = (lWidth - this.mp_oControl.HorizontalScrollBar.Value);
                    this.mp_oControl.Splitter.Position = X;
                }
                else
                {
                    this.mp_oControl.Splitter.Position = X;
                }

                this.mp_oControl.clsG.mp_EraseReversibleFrames();
                this.mp_oControl.Redraw();
                this.mp_SetCursor(AGJQW.E_CURSORTYPE.CT_NORMAL);
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseClick:
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseDblClick:
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseWheel:
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.KeyDown:
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.KeyUp:
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.KeyPress:
                break;
        }
	}

