	AGJQW.clsMouseKeyboardEvents.prototype.mp_EO_COLUMNMOVEMENT = function(yMouseKeyBoardEvent, X, Y) {
        var oColumn = null;
        var oDestinationColumn = null;
        var oRow = null;
        var lIndex = 0;
        if (this.mp_oControl.AllowColumnMove == false)
        {
            return;
        }
        oColumn = this.mp_oControl.Columns.oCollection.m_oReturnArrayElement(this.mp_oControl.SelectedColumnIndex);
        if (oColumn.AllowMove == false)
        {
            return;
        }
        switch (yMouseKeyBoardEvent)
        {
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseHover:
                this.mp_SetCursor(AGJQW.E_CURSORTYPE.CT_MOVECOLUMN);
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseDown:
                this.s_clmnMVT.lColumnIndex = this.mp_oControl.MathLib.GetColumnIndexByPosition(X, Y);
                System.Diagnostics.Debug.Assert(this.s_clmnMVT.lColumnIndex >= 1);
                this.mp_oControl.ObjectStateChangedEventArgs.Clear();
                this.mp_oControl.ObjectStateChangedEventArgs.EventTarget = AGJQW.E_EVENTTARGET.EVT_COLUMN;
                this.mp_oControl.ObjectStateChangedEventArgs.Index = this.s_clmnMVT.lColumnIndex;
                this.mp_oControl.ObjectStateChangedEventArgs.Cancel = false;
                this.mp_oControl.ObjectStateChangedEventArgs.ChangeType = AGJQW.E_CHANGETYPE.CT_MOVE;
                this.mp_oControl.FireBeginObjectChange();
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseMove:
                if (this.mp_oControl.ObjectStateChangedEventArgs.Cancel == false)
                {
                    this.mp_oControl.clsG.mp_EraseReversibleFrames();
                    this.mp_DynamicColumnMove(X);
                    this.s_clmnMVT.lDestinationColumnIndex = this.mp_oControl.MathLib.GetColumnIndexByPosition(X, Y);
                    if (this.s_clmnMVT.lDestinationColumnIndex >= 1)
                    {
                        this.mp_oControl.clsG.mp_EraseReversibleFrames();
                        this.mp_oControl.ObjectStateChangedEventArgs.DestinationIndex = this.s_clmnMVT.lDestinationColumnIndex;
                        this.mp_oControl.FireObjectChange();
                        if (this.mp_oControl.ObjectStateChangedEventArgs.Cancel == false)
                        {
                            oDestinationColumn = this.mp_oControl.Columns.oCollection.m_oReturnArrayElement(this.s_clmnMVT.lDestinationColumnIndex);
                            this.mp_DrawMovingReversibleFrame(oDestinationColumn.LeftTrim, oDestinationColumn.Top, oDestinationColumn.RightTrim, oDestinationColumn.Bottom, AGJQW.E_FOCUSTYPE.FCT_NORMAL);
                        }
                    }
                }

                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseUp:
                if (this.mp_oControl.ObjectStateChangedEventArgs.Cancel == false)
                {
                    this.mp_oControl.clsG.mp_EraseReversibleFrames();
                    this.mp_oControl.FireEndObjectChange();
                    if (this.mp_oControl.ObjectStateChangedEventArgs.Cancel == false)
                    {
                        this.s_clmnMVT.lDestinationColumnIndex = this.mp_oControl.MathLib.GetColumnIndexByPosition(X, Y);
                        if (this.s_clmnMVT.lDestinationColumnIndex >= 1 && (this.s_clmnMVT.lColumnIndex != this.s_clmnMVT.lDestinationColumnIndex))
                        {
                            this.mp_oControl.FireCompleteObjectChange();
                            if (this.mp_oControl.ObjectStateChangedEventArgs.Cancel == false)
                            {
                                if (this.mp_oControl.TreeviewColumnIndex > 0)
                                {
                                    for (lIndex = 1; lIndex <= this.mp_oControl.Columns.Count; lIndex++)
                                    {
                                        oColumn = this.mp_oControl.Columns.oCollection.m_oReturnArrayElement(lIndex);
                                        if (lIndex == this.mp_oControl.TreeviewColumnIndex)
                                        {
                                            oColumn.mp_bTreeViewColumnIndex = true;
                                        }
                                        else
                                        {
                                            oColumn.mp_bTreeViewColumnIndex = false;
                                        }
                                    }
                                }
                                this.mp_oControl.SelectedColumnIndex = this.mp_oControl.Columns.oCollection.m_lCopyAndMoveItems(this.s_clmnMVT.lColumnIndex, this.s_clmnMVT.lDestinationColumnIndex);
                                for (lIndex = 1; lIndex <= this.mp_oControl.Rows.Count; lIndex++)
                                {
                                    oRow = this.mp_oControl.Rows.oCollection.m_oReturnArrayElement(lIndex);
                                    oRow.Cells.oCollection.m_lCopyAndMoveItems(this.s_clmnMVT.lColumnIndex, this.s_clmnMVT.lDestinationColumnIndex);
                                }
                                if (this.mp_oControl.TreeviewColumnIndex > 0)
                                {
                                    for (lIndex = 1; lIndex <= this.mp_oControl.Columns.Count; lIndex++)
                                    {
                                        oColumn = this.mp_oControl.Columns.oCollection.m_oReturnArrayElement(lIndex);
                                        if (oColumn.mp_bTreeViewColumnIndex == true)
                                        {
                                            this.mp_oControl.TreeviewColumnIndex = lIndex;
                                        }
                                    }
                                }
                            } 
                        }
                    }
                }

                this.mp_oControl.Redraw();
                this.mp_SetCursor(AGJQW.E_CURSORTYPE.CT_NORMAL);
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseClick:
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseDblClick:
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseWheel:
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.KeyDown:
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.KeyUp:
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.KeyPress:
                break;
        }

	}

