	AGJQW.clsMouseKeyboardEvents.prototype.mp_EO_TASKSTRETCHRIGHT = function(yMouseKeyBoardEvent, X, Y) {
        var oTask = null;
        var oRow = null;
        if (this.mp_oControl.AllowEdit == false)
        {
            return;
        }
        oTask = this.mp_oControl.Tasks.oCollection.m_oReturnArrayElement(this.mp_oControl.SelectedTaskIndex);
        if (oTask.AllowStretchRight == false)
        {
            return;
        }
        switch (yMouseKeyBoardEvent)
        {
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseHover:
                this.mp_SetCursor(AGJQW.E_CURSORTYPE.CT_SIZETASK);
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseDown:
                this.s_tskSTR.lRowIndex = this.mp_oControl.MathLib.GetRowIndexByPosition(Y);
                X = this.mp_fSnapX(X);
                this.mp_oControl.ObjectStateChangedEventArgs.Clear();
                this.mp_oControl.ObjectStateChangedEventArgs.EventTarget = AGJQW.E_EVENTTARGET.EVT_TASK;
                this.mp_oControl.ObjectStateChangedEventArgs.Index = this.mp_oControl.SelectedTaskIndex;
                this.mp_oControl.ObjectStateChangedEventArgs.Cancel = false;
                this.mp_oControl.ObjectStateChangedEventArgs.ChangeType = AGJQW.E_CHANGETYPE.CT_SIZE;
                this.mp_oControl.FireBeginObjectChange();
                if (this.mp_oControl.ObjectStateChangedEventArgs.Cancel == false)
                {
                    this.s_tskSTR.dtInitialStartDate = oTask.StartDate;
                    this.s_tskSTR.dtInitialEndDate = oTask.EndDate;
                }

                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseMove:
                if (this.mp_oControl.ObjectStateChangedEventArgs.Cancel == false)
                {
                    X = this.mp_fSnapX(X);
                    this.mp_oControl.clsG.mp_EraseReversibleFrames();
                    oRow = this.mp_oControl.Rows.oCollection.m_oReturnArrayElement(this.s_tskSTR.lRowIndex);
                    this.s_tskSTR.dtFinalEndDate = this.mp_oControl.MathLib.GetDateFromXCoordinate(X);
                    this.mp_oControl.FireObjectChange();
                    if (this.mp_oControl.ObjectStateChangedEventArgs.Cancel == false)
                    {
                        if (this.mp_oControl.MathLib.DetectConflict(oTask.StartDate, this.mp_oControl.MathLib.GetDateFromXCoordinate(X), oRow.Key, this.mp_oControl.SelectedTaskIndex, oTask.LayerIndex) == true && this.mp_oControl.CurrentViewObject.ClientArea.DetectConflicts == true)
                        {
                            this.mp_SetCursor(AGJQW.E_CURSORTYPE.CT_NODROP);
                        }
                        else
                        {
                            this.mp_SetCursor(AGJQW.E_CURSORTYPE.CT_SIZETASK);
                        }
                        this.mp_DynamicTimeLineMove(X);
                        this.mp_oControl.ToolTipEventArgs.Clear();
                        this.mp_oControl.ToolTipEventArgs.TaskIndex = this.mp_oControl.SelectedTaskIndex;
                        this.mp_oControl.ToolTipEventArgs.RowIndex = this.s_tskSTR.lRowIndex;
                        this.mp_oControl.ToolTipEventArgs.InitialStartDate = this.s_tskSTR.dtInitialStartDate;
                        this.mp_oControl.ToolTipEventArgs.InitialEndDate = this.s_tskSTR.dtInitialEndDate;
                        this.mp_oControl.ToolTipEventArgs.StartDate = this.s_tskSTR.dtInitialStartDate;
                        this.mp_oControl.ToolTipEventArgs.EndDate = this.s_tskSTR.dtFinalEndDate;
                        this.mp_oControl.ToolTipEventArgs.X = X;
                        this.mp_oControl.ToolTipEventArgs.Y = Y;
                        this.mp_oControl.FireToolTipOnMouseMove(this.mp_yOperation);
                        this.mp_DrawMovingReversibleFrame(this.mp_oControl.MathLib.GetXCoordinateFromDate(oTask.StartDate), oRow.Top, X, oRow.Bottom, AGJQW.E_FOCUSTYPE.FCT_KEEPLEFTRIGHTBOUNDS);
                    }
                }

                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseUp:
                if (this.s_tskSTR.dtFinalEndDate == null)
                {
                    this.s_tskSTR.dtFinalEndDate = this.s_tskSTR.dtInitialStartDate;
                }
                if (this.s_tskSTR.dtFinalEndDate.valueOf() <= this.s_tskSTR.dtInitialStartDate.valueOf())
                {
                    this.mp_oControl.ObjectStateChangedEventArgs.Cancel = true;
                }

                if (this.mp_oControl.ObjectStateChangedEventArgs.Cancel == false)
                {
                    this.mp_oControl.clsG.mp_EraseReversibleFrames();
                    if (this.s_tskSTR.dtFinalEndDate > this.mp_oControl.CurrentViewObject.TimeLine.EndDate)
                    {
                        this.s_tskSTR.dtFinalEndDate = this.mp_oControl.CurrentViewObject.TimeLine.EndDate;
                    }
                    this.mp_oControl.FireEndObjectChange();
                    if (this.mp_oControl.ObjectStateChangedEventArgs.Cancel == false)
                    {
                        oRow = this.mp_oControl.Rows.oCollection.m_oReturnArrayElement(this.s_tskSTR.lRowIndex);
                        if (this.mp_oControl.MathLib.DetectConflict(oTask.StartDate, this.mp_oControl.MathLib.GetDateFromXCoordinate(X), oRow.Key, this.mp_oControl.SelectedTaskIndex, oTask.LayerIndex) == true && this.mp_oControl.CurrentViewObject.ClientArea.DetectConflicts == true)
                        {
                        }
                        else
                        {
                            if (oTask.TaskType == AGJQW.E_TASKTYPE.TT_START_END)
                            {
                                oTask.EndDate = this.s_tskSTR.dtFinalEndDate;
                                if (this.mp_oControl.CurrentViewObject.ClientArea.Grid.SnapToGrid == true)
                                {
                                    oTask.StartDate = this.mp_oControl.MathLib.RoundDate(this.mp_oControl.CurrentViewObject.ClientArea.Grid.Interval, this.mp_oControl.CurrentViewObject.ClientArea.Grid.Factor, oTask.StartDate);
                                    oTask.EndDate = this.mp_oControl.MathLib.RoundDate(this.mp_oControl.CurrentViewObject.ClientArea.Grid.Interval, this.mp_oControl.CurrentViewObject.ClientArea.Grid.Factor, oTask.EndDate);
                                }
                            }
                            else if (oTask.TaskType == AGJQW.E_TASKTYPE.TT_DURATION)
                            {
                                oTask.DurationFactor = this.mp_oControl.MathLib.CalculateDuration(this.s_tskSTR.dtInitialStartDate, this.s_tskSTR.dtFinalEndDate, oTask.DurationInterval);
                            }
                            if (oTask.EndDate.valueOf() != this.s_tskSTR.dtInitialEndDate.valueOf())
                            {
                                this.mp_oControl.FireCompleteObjectChange();
                                if (this.mp_oControl.ObjectStateChangedEventArgs.Cancel == true)
                                {
                                    oTask.EndDate = this.s_tskSTR.dtInitialEndDate;
                                }
                            }
                        }
                    }
                }
                if (this.mp_oControl.EnforcePredecessors == true)
                {
                    this.mp_oControl.CheckPredecessors();
                }
                this.mp_oControl.Redraw();
                this.mp_SetCursor(AGJQW.E_CURSORTYPE.CT_NORMAL);
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseClick:
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseDblClick:
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseWheel:
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.KeyDown:
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.KeyUp:
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.KeyPress:
                break;
        }
	}

