	AGJQW.clsMouseKeyboardEvents.prototype.mp_EO_TASKADDITION = function(yMouseKeyBoardEvent, X, Y) {
        var oRow = null;
        if (this.mp_oControl.AllowAdd == false)
        {
            this.mp_SetCursor(AGJQW.E_CURSORTYPE.CT_NORMAL);
            return;
        }
        this.s_tskADD.lRowIndex = this.mp_oControl.MathLib.GetRowIndexByPosition(Y);
        if (this.s_tskADD.lRowIndex <= 0)
        {
            return;
        }
        // es un event listener se ejecuta continuamente si tengo el mouse sobre el Gantt
        // console.log('mouse over gantt');

        oRow = this.mp_oControl.Rows.oCollection.m_oReturnArrayElement(this.s_tskADD.lRowIndex);
        // console.log(oRow);
        if (oRow.Container == false)
        {
            return;
        }
        switch (yMouseKeyBoardEvent)
        {
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseHover:
                this.mp_SetCursor(AGJQW.E_CURSORTYPE.CT_CLIENTAREA);
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseDown:
                this.s_tskADD.bCancel = false;
                X = this.mp_fSnapX(X);
                if ((oRow.Container == false) || (this.mp_oControl.MathLib.DetectConflict(this.mp_oControl.MathLib.GetDateFromXCoordinate(X), this.mp_oControl.MathLib.GetDateFromXCoordinate(X), oRow.Key, 0, this.mp_oControl.CurrentLayer) == true && this.mp_oControl.CurrentViewObject.ClientArea.DetectConflicts == true))
                {
                    this.s_tskADD.bCancel = true;
                }
                else
                {
                    this.s_tskADD.dtStartDate = this.mp_oControl.MathLib.GetDateFromXCoordinate(X);
                }

                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseMove:
                if (this.s_tskADD.bCancel == false)
                {
                    X = this.mp_fSnapX(X);
                    this.mp_oControl.clsG.mp_EraseReversibleFrames();
                    if ((this.mp_oControl.MathLib.DetectConflict(this.s_tskADD.dtStartDate, this.mp_oControl.MathLib.GetDateFromXCoordinate(X), oRow.Key, 0, this.mp_oControl.CurrentLayer) == true || oRow.Container == false) && this.mp_oControl.CurrentViewObject.ClientArea.DetectConflicts == true)
                    {
                        this.mp_SetCursor(AGJQW.E_CURSORTYPE.CT_NODROP);
                        this.s_tskADD.bInConflict = true;
                    }
                    else
                    {
                        this.s_tskADD.bInConflict = false;
                        this.mp_SetCursor(AGJQW.E_CURSORTYPE.CT_CLIENTAREA);
                        this.s_tskADD.dtEndDate = this.mp_oControl.MathLib.GetDateFromXCoordinate(X);
                        this.mp_DynamicTimeLineMove(X);
                        this.mp_oControl.ToolTipEventArgs.Clear();
                        this.mp_oControl.ToolTipEventArgs.RowIndex = this.s_tskADD.lRowIndex;
                        this.mp_oControl.ToolTipEventArgs.StartDate = this.s_tskADD.dtStartDate;
                        this.mp_oControl.ToolTipEventArgs.EndDate = this.s_tskADD.dtEndDate;
                        this.mp_oControl.ToolTipEventArgs.X = X;
                        this.mp_oControl.ToolTipEventArgs.Y = Y;
                        this.mp_oControl.FireToolTipOnMouseMove(this.mp_yOperation);
                        this.mp_DrawMovingReversibleFrame(this.mp_oControl.MathLib.GetXCoordinateFromDate(this.s_tskADD.dtStartDate), oRow.Top, X, oRow.Bottom, AGJQW.E_FOCUSTYPE.FCT_ADD);
                    }
                }

                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseUp:
                this.mp_oControl.clsG.mp_EraseReversibleFrames();
                if (this.s_tskADD.bCancel == false && this.s_tskADD.bInConflict == false)
                {
                    X = this.mp_fSnapX(X);
                    this.s_tskADD.dtEndDate = this.mp_oControl.MathLib.GetDateFromXCoordinate(X);
                    if (this.s_tskADD.dtEndDate.valueOf() == this.s_tskADD.dtStartDate.valueOf())
                    {
                        if (this.mp_oControl.AddMode == AGJQW.E_ADDMODE.AT_BOTH || this.mp_oControl.AddMode == AGJQW.E_ADDMODE.AT_MILESTONEADD)
                        {
                            this.mp_oControl.Tasks.Add("", oRow.Key, this.s_tskADD.dtEndDate, this.s_tskADD.dtStartDate, "", "DS_TASK", this.mp_oControl.CurrentLayer);
                        }
                        else if (this.mp_oControl.AddMode == AGJQW.E_ADDMODE.AT_DURATION_BOTH || this.mp_oControl.AddMode == AGJQW.E_ADDMODE.AT_DURATION_MILESTONEADD)
                        {
                            var dtStartDate = this.s_tskADD.dtStartDate;
                            var dtTLStartDate = this.mp_oControl.CurrentViewObject.TimeLine.StartDate;
                            var dtTLEndDate = this.mp_oControl.CurrentViewObject.TimeLine.EndDate;
                            var aTimeBlocks = new ArrayList();
                            this.mp_oControl.MathLib.mp_GetTimeBlocks(aTimeBlocks, dtTLStartDate, dtTLEndDate);
                            this.mp_oControl.MathLib.mp_ValidateStartDate(aTimeBlocks, dtStartDate);
                            this.mp_oControl.Tasks.DAdd(oRow.Key, dtStartDate, this.mp_oControl.AddDurationInterval, 0, "", "", "DS_TASK", this.mp_oControl.CurrentLayer);
                        }
                        if (this.mp_oControl.AddMode == AGJQW.E_ADDMODE.AT_DURATION_BOTH || this.mp_oControl.AddMode == AGJQW.E_ADDMODE.AT_BOTH || this.mp_oControl.AddMode == AGJQW.E_ADDMODE.AT_MILESTONEADD || this.mp_oControl.AddMode == AGJQW.E_ADDMODE.AT_DURATION_MILESTONEADD)
                        {
                            this.mp_oControl.SelectedTaskIndex = this.mp_oControl.Tasks.Count;
                            this.mp_oControl.ObjectAddedEventArgs.Clear();
                            this.mp_oControl.ObjectAddedEventArgs.TaskIndex = this.mp_oControl.Tasks.Count;
                            this.mp_oControl.ObjectAddedEventArgs.EventTarget = AGJQW.E_EVENTTARGET.EVT_MILESTONE;
                            this.mp_oControl.FireObjectAdded();
                        }
                    }
                    else
                    {
                        if (this.mp_oControl.AddMode == AGJQW.E_ADDMODE.AT_BOTH || this.mp_oControl.AddMode == AGJQW.E_ADDMODE.AT_TASKADD)
                        {
                            if (this.s_tskADD.dtEndDate < this.s_tskADD.dtStartDate)
                            {
                                this.mp_oControl.Tasks.Add("", oRow.Key, this.s_tskADD.dtEndDate, this.s_tskADD.dtStartDate, "", "DS_TASK", this.mp_oControl.CurrentLayer);
                            }
                            else
                            {
                                this.mp_oControl.Tasks.Add("", oRow.Key, this.s_tskADD.dtStartDate, this.s_tskADD.dtEndDate, "", "DS_TASK", this.mp_oControl.CurrentLayer);
                            }
                            this.mp_oControl.SelectedTaskIndex = this.mp_oControl.Tasks.Count;
                            this.mp_oControl.ObjectAddedEventArgs.Clear();
                            this.mp_oControl.ObjectAddedEventArgs.TaskIndex = this.mp_oControl.Tasks.Count;
                            this.mp_oControl.ObjectAddedEventArgs.EventTarget = AGJQW.E_EVENTTARGET.EVT_TASK;
                            this.mp_oControl.FireObjectAdded();
                        }
                        else if (this.mp_oControl.AddMode == AGJQW.E_ADDMODE.AT_DURATION_BOTH || this.mp_oControl.AddMode == AGJQW.E_ADDMODE.AT_DURATION_TASKADD)
                        {
                            var lDuration = 0;
                            var dtStartDate;
                            var dtEndDate;
                            if (this.s_tskADD.dtEndDate > this.s_tskADD.dtStartDate)
                            {
                                dtStartDate = this.s_tskADD.dtStartDate;
                                dtEndDate = this.s_tskADD.dtEndDate;
                            }
                            else
                            {
                                dtStartDate = this.s_tskADD.dtEndDate;
                                dtEndDate = this.s_tskADD.dtStartDate;
                            }
                            lDuration = this.mp_oControl.MathLib.CalculateDuration(dtStartDate, dtEndDate, this.mp_oControl.AddDurationInterval);
                            this.mp_oControl.Tasks.DAdd(oRow.Key, dtStartDate, this.mp_oControl.AddDurationInterval, lDuration, "", "", "DS_TASK", this.mp_oControl.CurrentLayer);
                            this.mp_oControl.SelectedTaskIndex = this.mp_oControl.Tasks.Count;
                            this.mp_oControl.ObjectAddedEventArgs.Clear();
                            this.mp_oControl.ObjectAddedEventArgs.TaskIndex = this.mp_oControl.Tasks.Count;
                            this.mp_oControl.ObjectAddedEventArgs.EventTarget = AGJQW.E_EVENTTARGET.EVT_TASK;
                            this.mp_oControl.FireObjectAdded();
                        }
                    }
                }
                this.mp_oControl.Redraw();
                this.mp_SetCursor(AGJQW.E_CURSORTYPE.CT_NORMAL);
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseClick:
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseDblClick:
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.MouseWheel:
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.KeyDown:
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.KeyUp:
                break;
            case AGJQW.E_MOUSEKEYBOARDEVENTS.KeyPress:
                break;
        }
	}

