	AGJQW.clsMouseKeyboardEvents.prototype.mp_bOverSelectedPercentage = function(X, Y) {
        var oSelectedPercentage = null;
        if (X < this.mp_oControl.CurrentViewObject.TimeLine.f_lStart)
        {
            return false;
        }
        if (X > this.mp_oControl.CurrentViewObject.TimeLine.f_lEnd)
        {
            return false;
        }
        if (this.mp_oControl.SelectedPercentageIndex < 1 || this.mp_oControl.Percentages.Count == 0)
        {
            return false;
        }
        oSelectedPercentage = this.mp_oControl.Percentages.oCollection.m_oReturnArrayElement(this.mp_oControl.SelectedPercentageIndex);
        if (X >= oSelectedPercentage.Left && X <= oSelectedPercentage.RightSel && Y >= oSelectedPercentage.Top && Y <= oSelectedPercentage.Bottom)
        {
            return true;
        }
        else
        {
            return false;
        }
	}

	AGJQW.clsMouseKeyboardEvents.prototype.mp_yTaskArea = function(X, Y) {
        var oSelectedTask = null;
        oSelectedTask = this.mp_oControl.Tasks.oCollection.m_oReturnArrayElement(this.mp_oControl.SelectedTaskIndex);
        if (X >= oSelectedTask.Left && X <= oSelectedTask.Right && Y >= oSelectedTask.Top && Y <= oSelectedTask.Bottom && this.mp_oControl.MathLib.InCurrentLayer(oSelectedTask.LayerIndex))
        {
            if (X >= oSelectedTask.Left && X <= oSelectedTask.Left + this.mp_oControl.CurrentViewObject.ClientArea.TaskBorderSelectionOffset)
            {
                if (oSelectedTask.f_bLeftVisible == true)
                {
                    return AGJQW.E_AREA.EA_LEFT;
                }
                else
                {
                    return AGJQW.E_AREA.EA_CENTER;
                }
            }
            if (X >= oSelectedTask.Right - this.mp_oControl.CurrentViewObject.ClientArea.TaskBorderSelectionOffset && X <= oSelectedTask.Right)
            {
                if (oSelectedTask.f_bRightVisible == true)
                {
                    return AGJQW.E_AREA.EA_RIGHT;
                }
                else
                {
                    return AGJQW.E_AREA.EA_CENTER;
                }
            }
            return AGJQW.E_AREA.EA_CENTER;
        }
        return AGJQW.E_AREA.EA_NONE;
	}

	AGJQW.clsMouseKeyboardEvents.prototype.mp_yRowArea = function(X, Y) {
        var oSelectedRow = null;
        oSelectedRow = this.mp_oControl.Rows.oCollection.m_oReturnArrayElement(this.mp_oControl.SelectedRowIndex);
        if (Y >= oSelectedRow.Bottom && Y <= oSelectedRow.Bottom + 3)
        {
            return AGJQW.E_AREA.EA_BOTTOM;
        }
        else
        {
            return AGJQW.E_AREA.EA_CENTER;
        }
	}

	AGJQW.clsMouseKeyboardEvents.prototype.mp_yColumnArea = function(X, Y) {
        var oSelectedColumn = null;
        oSelectedColumn = this.mp_oControl.Columns.oCollection.m_oReturnArrayElement(this.mp_oControl.SelectedColumnIndex);
        if (X >= (oSelectedColumn.Right - 3) && X <= oSelectedColumn.Right)
        {
            return AGJQW.E_AREA.EA_RIGHT;
        }
        else
        {
            return AGJQW.E_AREA.EA_CENTER;
        }
	}

	AGJQW.clsMouseKeyboardEvents.prototype.mp_DynamicColumnMove = function(v_X) {
        if (v_X < this.mp_oControl.mt_LeftMargin)
        {
            if (this.mp_oControl.HorizontalScrollBar.Value > 20)
            {
                this.mp_oControl.HorizontalScrollBar.Value = this.mp_oControl.HorizontalScrollBar.Value - 20;
            }
            else
            {
                this.mp_oControl.HorizontalScrollBar.Value = 0;
            }
            this.mp_oControl.Redraw();
            return;
        }
        if (v_X > this.mp_oControl.Splitter.Left)
        {
            if (this.mp_oControl.HorizontalScrollBar.Value < (this.mp_oControl.HorizontalScrollBar.Max - 20))
            {
                this.mp_oControl.HorizontalScrollBar.Value = this.mp_oControl.HorizontalScrollBar.Value + 20;
            }
            else
            {
                this.mp_oControl.HorizontalScrollBar.Value = this.mp_oControl.HorizontalScrollBar.Max;
            }
            this.mp_oControl.Redraw();
            return;
        }
	}

	AGJQW.clsMouseKeyboardEvents.prototype.mp_DynamicRowMove = function(v_Y) {
        if (v_Y < this.mp_oControl.CurrentViewObject.TimeLine.Bottom)
        {
            if (this.mp_oControl.CurrentViewObject.ClientArea.FirstVisibleRow > 1)
            {
                this.mp_oControl.CurrentViewObject.ClientArea.FirstVisibleRow = this.mp_oControl.CurrentViewObject.ClientArea.FirstVisibleRow - 1;
                this.mp_oControl.VerticalScrollBar.Value = this.mp_oControl.VerticalScrollBar.Value - 1;
                this.mp_oControl.Redraw();
                return;
            }
        }
        if (v_Y > this.mp_oControl.CurrentViewObject.ClientArea.Bottom)
        {
            if (this.mp_oControl.VerticalScrollBar.Value < this.mp_oControl.VerticalScrollBar.Max)
            {
                this.mp_oControl.CurrentViewObject.ClientArea.FirstVisibleRow = this.mp_oControl.CurrentViewObject.ClientArea.FirstVisibleRow + 1;
                this.mp_oControl.VerticalScrollBar.Value = this.mp_oControl.VerticalScrollBar.Value + 1;
                this.mp_oControl.Redraw();
            }
        }
	}

	AGJQW.clsMouseKeyboardEvents.prototype.mp_DynamicTimeLineMove = function(v_X) {
        if (v_X > this.mp_oControl.CurrentViewObject.TimeLine.f_lEnd)
        {
            if (this.mp_oControl.f_TimeLineScrollBar.Enabled == false)
            {
                this.mp_oControl.CurrentViewObject.TimeLine.f_StartDate = this.mp_oControl.MathLib.DateTimeAdd(this.mp_oControl.CurrentViewObject.f_ScrollInterval, this.mp_oControl.CurrentViewObject.Factor, this.mp_oControl.CurrentViewObject.TimeLine.StartDate);
            }
            else
            {
                if (this.mp_oControl.f_TimeLineScrollBar.Value < this.mp_oControl.f_TimeLineScrollBar.Max)
                {
                    this.mp_oControl.f_TimeLineScrollBar.Value = this.mp_oControl.f_TimeLineScrollBar.Value + 1;
                }
            }
            this.mp_oControl.Redraw();
        }
        if (v_X < this.mp_oControl.CurrentViewObject.TimeLine.f_lStart)
        {
            if (this.mp_oControl.f_TimeLineScrollBar.Enabled == false)
            {
                this.mp_oControl.CurrentViewObject.TimeLine.f_StartDate = this.mp_oControl.MathLib.DateTimeAdd(this.mp_oControl.CurrentViewObject.f_ScrollInterval, -this.mp_oControl.CurrentViewObject.Factor, this.mp_oControl.CurrentViewObject.TimeLine.StartDate);
            }
            else
            {
                if (this.mp_oControl.f_TimeLineScrollBar.Value > 0)
                {
                    this.mp_oControl.f_TimeLineScrollBar.Value = this.mp_oControl.f_TimeLineScrollBar.Value - 1;
                }
            }
            this.mp_oControl.Redraw();
        }
	}

	AGJQW.clsMouseKeyboardEvents.prototype.mp_bOverTask = function(X, Y) {
        var oTask = null;
        var lIndex = 0;
        for (lIndex = this.mp_oControl.Tasks.Count; lIndex >= 1; lIndex += -1)
        {
            oTask = this.mp_oControl.Tasks.oCollection.m_oReturnArrayElement(lIndex);
            if (oTask.Visible == true && this.mp_oControl.MathLib.InCurrentLayer(oTask.LayerIndex))
            {
                if (X >= oTask.Left && X <= oTask.Right && Y >= oTask.Top && Y <= oTask.Bottom)
                {
                    return true;
                }
            }
        }
        return false;
	}

