    AGJQW.clsGraphics.prototype.mp_DrawEdge = function (X1, Y1, X2, Y2, clrBackColor, yButtonStyle, yEdgeType, bFilled, oStyle) {
		var lExteriorLeftTopColor = AGJQW.Color_FromArgb(255, 255, 255, 255);
		var lInteriorLeftTopColor = AGJQW.Color_FromArgb(255, 255, 255, 255);
		var lExteriorRightBottomColor = AGJQW.Color_FromArgb(255, 255, 255, 255);
		var lInteriorRightBottomColor = AGJQW.Color_FromArgb(255, 255, 255, 255);
		if (yButtonStyle == AGJQW.GRE_BUTTONSTYLE.BT_NORMALWINDOWS) 
		{
            switch (yEdgeType)
            {
                case AGJQW.GRE_EDGETYPE.ET_RAISED:
                    if (oStyle == null)
                    {
                        lExteriorLeftTopColor = AGJQW.Color_FromArgb(255, 240, 240, 240);
                        lInteriorLeftTopColor = AGJQW.Color_FromArgb(255, 192, 192, 192);
                        lInteriorRightBottomColor = AGJQW.Color_FromArgb(255, 128, 128, 128);
                        lExteriorRightBottomColor = AGJQW.Color_FromArgb(255, 64, 64, 64);
                    }
                    else
                    {
                        lExteriorLeftTopColor = oStyle.ButtonBorderStyle.RaisedExteriorLeftTopColor;
                        lInteriorLeftTopColor = oStyle.ButtonBorderStyle.RaisedInteriorLeftTopColor;
                        lInteriorRightBottomColor = oStyle.ButtonBorderStyle.RaisedInteriorRightBottomColor;
                        lExteriorRightBottomColor = oStyle.ButtonBorderStyle.RaisedExteriorRightBottomColor;
                    }
                    break;
                case AGJQW.GRE_EDGETYPE.ET_SUNKEN:
                    if (oStyle == null)
                    {
                        lExteriorLeftTopColor = AGJQW.Color_FromArgb(255, 128, 128, 128);
                        lInteriorLeftTopColor = AGJQW.Color_FromArgb(255, 64, 64, 64);
                        lInteriorRightBottomColor = AGJQW.Color_FromArgb(255, 192, 192, 192);
                        lExteriorRightBottomColor = AGJQW.Color_FromArgb(255, 240, 240, 240);
                    }
                    else
                    {
                        lExteriorLeftTopColor = oStyle.ButtonBorderStyle.SunkenExteriorLeftTopColor;
                        lInteriorLeftTopColor = oStyle.ButtonBorderStyle.SunkenInteriorLeftTopColor;
                        lInteriorRightBottomColor = oStyle.ButtonBorderStyle.SunkenInteriorRightBottomColor;
                        lExteriorRightBottomColor = oStyle.ButtonBorderStyle.SunkenExteriorRightBottomColor;
                    }
                    break;
            }
            // Exterior Left
            this.mp_DrawLine(X1, Y1, X1, Y2, AGJQW.GRE_LINETYPE.LT_NORMAL, lExteriorLeftTopColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID);
            // Exterior Top
            this.mp_DrawLine(X1, Y1, X2, Y1, AGJQW.GRE_LINETYPE.LT_NORMAL, lExteriorLeftTopColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID);
            // Exterior Right
            this.mp_DrawLine(X2, Y2, X2, Y1, AGJQW.GRE_LINETYPE.LT_NORMAL, lExteriorRightBottomColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID);
            // Exterior Bottom
            this.mp_DrawLine(X1, Y2, X2, Y2, AGJQW.GRE_LINETYPE.LT_NORMAL, lExteriorRightBottomColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID);

            // Interior Left
            this.mp_DrawLine(X1 + 1, Y1 + 1, X1 + 1, Y2 - 1, AGJQW.GRE_LINETYPE.LT_NORMAL, lInteriorLeftTopColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID);
            // Interior Top
            this.mp_DrawLine(X1 + 1, Y1 + 1, X2 - 1, Y1 + 1, AGJQW.GRE_LINETYPE.LT_NORMAL, lInteriorLeftTopColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID);
            // Interior Right
            this.mp_DrawLine(X2 - 1, Y2 - 1, X2 - 1, Y1 + 1, AGJQW.GRE_LINETYPE.LT_NORMAL, lInteriorRightBottomColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID);
            // Interior Bottom
            this.mp_DrawLine(X1 + 1, Y2 - 1, X2 - 1, Y2 - 1, AGJQW.GRE_LINETYPE.LT_NORMAL, lInteriorRightBottomColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID);
			if (bFilled == true) 
			{
				this.mp_DrawLine(X1 + 2, Y1 + 2, X2 - 2, Y2 - 2, AGJQW.GRE_LINETYPE.LT_FILLED, clrBackColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID, 1, true);
			}
		}
		else 
		{
            switch (yEdgeType)
            {
                case AGJQW.GRE_EDGETYPE.ET_RAISED:
                    if (oStyle == null)
                    {
                        lExteriorLeftTopColor = AGJQW.Color_FromArgb(255, 255, 255, 255);
                        lExteriorRightBottomColor = AGJQW.Color_FromArgb(255, 64, 64, 64);
                    }
                    else
                    {
                        lExteriorLeftTopColor = oStyle.ButtonBorderStyle.RaisedExteriorLeftTopColor;
                        lExteriorRightBottomColor = oStyle.ButtonBorderStyle.RaisedExteriorRightBottomColor;
                    }
                    break;
                case AGJQW.GRE_EDGETYPE.ET_SUNKEN:
                    if (oStyle == null)
                    {
                        lExteriorLeftTopColor = AGJQW.Color_FromArgb(255, 128, 128, 128);
                        lExteriorRightBottomColor = AGJQW.Color_FromArgb(255, 245, 245, 245);
                    }
                    else
                    {
                        lExteriorLeftTopColor = oStyle.ButtonBorderStyle.SunkenExteriorLeftTopColor;
                        lExteriorRightBottomColor = oStyle.ButtonBorderStyle.SunkenExteriorRightBottomColor;
                    }
                    break;
            }
			this.mp_DrawLine(X1, Y1, X2, Y1, AGJQW.GRE_LINETYPE.LT_NORMAL, lExteriorLeftTopColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID, 1, true);
			this.mp_DrawLine(X1, Y1, X1, Y2, AGJQW.GRE_LINETYPE.LT_NORMAL, lExteriorLeftTopColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID, 1, true);
			this.mp_DrawLine(X1, Y2, X2, Y2, AGJQW.GRE_LINETYPE.LT_NORMAL, lExteriorRightBottomColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID, 1, true);
			this.mp_DrawLine(X2, Y2, X2, Y1 - 1, AGJQW.GRE_LINETYPE.LT_NORMAL, lExteriorRightBottomColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID, 1, true);
			if (bFilled == true) 
			{
				this.mp_DrawLine(X1 + 1, Y1 + 1, X2 - 1, Y2 - 1, AGJQW.GRE_LINETYPE.LT_FILLED, clrBackColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID, 1, true);
			}
		}
	}

    AGJQW.clsGraphics.prototype.mp_DrawLine = function (X1, Y1, X2, Y2, yStyle, clrColor, yDrawStyle, lWidth, bCreatePens) {
        if (AGJQW.g_IsNV(lWidth)) {lWidth = 1;}
        if (AGJQW.g_IsNV(bCreatePens)) {bCreatePens = true;}
        var iBuff = 0;
        if (yStyle == AGJQW.GRE_LINETYPE.LT_BORDER || yStyle == AGJQW.GRE_LINETYPE.LT_FILLED) {
            if ((X2 - X1) < 0)
            {
                iBuff = X1;
                X1 = X2;
                X2 = iBuff;
            }
            if ((Y2 - Y1) < 0)
            {
                iBuff = Y1;
                Y1 = Y2;
                Y2 = iBuff;
            }
        }
        switch (yStyle) 
		{
			case AGJQW.GRE_LINETYPE.LT_NORMAL:
                this.oGraphics.beginPath();
                this.oGraphics.moveTo(X1 + 1.5, Y1 + 1.5);
                this.oGraphics.lineTo(X2 + 1.5, Y2 + 1.5);
                this.oGraphics.strokeStyle = clrColor.ToString();
                this.oGraphics.lineWidth = 1;
                this.oGraphics.stroke();
				break;
			case AGJQW.GRE_LINETYPE.LT_BORDER:
                this.oGraphics.beginPath();
                this.oGraphics.rect(X1 + 1.5, Y1 + 1.5, Math.abs(X2 - X1), Math.abs(Y2 - Y1));
                this.oGraphics.lineWidth = lWidth;
                this.oGraphics.strokeStyle = clrColor.ToString();
                this.oGraphics.stroke();
				break;
			case AGJQW.GRE_LINETYPE.LT_FILLED:
                this.oGraphics.fillStyle = clrColor.ToString();
                this.oGraphics.fillRect(X1 + 1, Y1 + 1, Math.abs(X2 - X1) + 1, Math.abs(Y2 - Y1) + 1);
				break;
		}
    }

    AGJQW.clsGraphics.prototype.mp_DrawFigure = function (X, Y, lDx, lDy, yFigureType, clrBorderColor, clrFillColor, yBorderStyle) {
        var Points = [];
		if (lDx % 2 != 0) 
		{
			lDx = lDx + 1;
			lDy = lDy + 1;
		}
		switch (yFigureType) 
		{
			case AGJQW.GRE_FIGURETYPE.FT_PROJECTUP:
                Points.push(new AGJQW.Point(X,Y));
                Points.push(new AGJQW.Point(X + lDx / 2,Y + lDy / 2));
                Points.push(new AGJQW.Point(X + lDx / 2,Y + lDy));
                Points.push(new AGJQW.Point(X - lDx / 2,Y + lDy));
                Points.push(new AGJQW.Point(X - lDx / 2,Y + lDy / 2));
				this.mp_DrawFigureAux(clrFillColor, clrBorderColor, Points);
				break;
			case AGJQW.GRE_FIGURETYPE.FT_PROJECTDOWN:
				Points.push(new AGJQW.Point(X + lDx / 2, Y));
				Points.push(new AGJQW.Point(X + lDx / 2, Y + lDy / 2));
				Points.push(new AGJQW.Point(X, Y + lDy));
				Points.push(new AGJQW.Point(X - lDx / 2, Y + lDy / 2));
				Points.push(new AGJQW.Point(X - lDx / 2, Y));
				this.mp_DrawFigureAux(clrFillColor, clrBorderColor, Points);
				break;
			case AGJQW.GRE_FIGURETYPE.FT_DIAMOND:
				Points.push(new AGJQW.Point(X,Y));
				Points.push(new AGJQW.Point(X + lDx / 2,Y + lDy / 2));
				Points.push(new AGJQW.Point(X,Y + lDy));
				Points.push(new AGJQW.Point(X - lDx / 2,Y + lDy / 2));
				this.mp_DrawFigureAux(clrFillColor, clrBorderColor, Points);
				break;
			case AGJQW.GRE_FIGURETYPE.FT_CIRCLEDIAMOND:
				Points.push(new AGJQW.Point(X,Y + lDy / 4));
				Points.push(new AGJQW.Point(X + lDx / 4,Y + lDy / 2));
				Points.push(new AGJQW.Point(X,Y + (3 * lDy) / 4));
				Points.push(new AGJQW.Point(X - lDx / 4,Y + lDy / 2));
				oGraphics.DrawEllipse(oPen, mp_oControl.MathLib.RoundDouble(X - lDx / 2), Y, lDx, lDy);
				this.mp_DrawFigureAux(clrFillColor, clrBorderColor, Points);
				break;
			case AGJQW.GRE_FIGURETYPE.FT_TRIANGLEUP:
				Points.push(new AGJQW.Point(X,Y));
				Points.push(new AGJQW.Point(X + lDx / 2,Y + lDy));
				Points.push(new AGJQW.Point(X - lDx / 2,Y + lDy));
				this.mp_DrawFigureAux(clrFillColor, clrBorderColor, Points);
				break;
			case AGJQW.GRE_FIGURETYPE.FT_TRIANGLEDOWN:
				Points.push(new AGJQW.Point(X + lDx / 2,Y));
				Points.push(new AGJQW.Point(X - lDx / 2,Y));
				Points.push(new AGJQW.Point(X,Y + lDy));
				this.mp_DrawFigureAux(clrFillColor, clrBorderColor, Points);
				break;
			case AGJQW.GRE_FIGURETYPE.FT_TRIANGLERIGHT:
				Points.push(new AGJQW.Point(X,Y));
				Points.push(new AGJQW.Point(X,Y + lDy));
				Points.push(new AGJQW.Point(X + lDx,Y + lDy / 2));
				this.mp_DrawFigureAux(clrFillColor, clrBorderColor, Points);
				break;
			case AGJQW.GRE_FIGURETYPE.FT_TRIANGLELEFT:
				Points.push(new AGJQW.Point(X,Y));
				Points.push(new AGJQW.Point(X,Y + lDy));
				Points.push(new AGJQW.Point(X - lDx,Y + lDy / 2));
				this.mp_DrawFigureAux(clrFillColor, clrBorderColor, Points);
				break;
			case AGJQW.GRE_FIGURETYPE.FT_CIRCLETRIANGLEUP:
				Points.push(new AGJQW.Point(X,Y + lDy / 4));
				Points.push(new AGJQW.Point(X + lDx / 4,Y + (3 * lDy) / 4));
				Points.push(new AGJQW.Point(X - lDx / 4,Y + (3 * lDy) / 4));
				this.mp_DrawEllipse(clrBorderColor, (X - lDx / 2), Y, lDx, lDy);
				this.mp_DrawFigureAux(clrFillColor, clrBorderColor, Points);
				break;
			case AGJQW.GRE_FIGURETYPE.FT_CIRCLETRIANGLEDOWN:
				Points.push(new AGJQW.Point(X - lDx / 4,Y + lDy / 4));
				Points.push(new AGJQW.Point(X + lDx / 4,Y + lDy / 4));
				Points.push(new AGJQW.Point(X,Y + (3 * lDy) / 4));
				this.mp_DrawEllipse(clrBorderColor, (X - lDx / 2), Y, lDx, lDy);
				this.mp_DrawFigureAux(clrFillColor, clrBorderColor, Points);
				break;
			case AGJQW.GRE_FIGURETYPE.FT_ARROWUP:
				Points.push(new AGJQW.Point(X,Y));
				Points.push(new AGJQW.Point(X + lDx / 2,Y + lDy / 2));
				Points.push(new AGJQW.Point(X + lDx / 4,Y + lDy / 2));
				Points.push(new AGJQW.Point(X + lDx / 4,Y + lDy));
				Points.push(new AGJQW.Point(X - lDx / 4,Y + lDy));
				Points.push(new AGJQW.Point(X - lDx / 4,Y + lDy / 2));
				Points.push(new AGJQW.Point(X - lDx / 2,Y + lDy / 2));
				this.mp_DrawFigureAux(clrFillColor, clrBorderColor, Points);
				break;
			case AGJQW.GRE_FIGURETYPE.FT_ARROWDOWN:
				Points.push(new AGJQW.Point(X - lDx / 4,Y));
				Points.push(new AGJQW.Point(X + lDx / 4,Y));
				Points.push(new AGJQW.Point(X + lDx / 4,Y + lDy / 2));
				Points.push(new AGJQW.Point(X + lDx / 2,Y + lDy / 2));
				Points.push(new AGJQW.Point(X,Y + lDy));
				Points.push(new AGJQW.Point(X - lDx / 2,Y + lDy / 2));
				Points.push(new AGJQW.Point(X - lDx / 4,Y + lDy / 2));
				this.mp_DrawFigureAux(clrFillColor, clrBorderColor, Points);
				break;
			case AGJQW.GRE_FIGURETYPE.FT_CIRCLEARROWUP:
				Points.push(new AGJQW.Point(X,Y + lDy / 4));
				Points.push(new AGJQW.Point(X + lDx / 4,Y + lDy / 2));
				Points.push(new AGJQW.Point(X + lDx / 8,Y + lDy / 2));
				Points.push(new AGJQW.Point(X + lDx / 8,Y + (3 * lDy) / 4));
				Points.push(new AGJQW.Point(X - lDx / 8,Y + (3 * lDy) / 4));
				Points.push(new AGJQW.Point(X - lDx / 8,Y + lDy / 2));
				Points.push(new AGJQW.Point(X - lDx / 4,Y + lDy / 2));
				this.mp_DrawEllipse(clrBorderColor, X - lDx / 2, Y, lDx, lDy);
				this.mp_DrawFigureAux(clrFillColor, clrBorderColor, Points);
				break;
			case AGJQW.GRE_FIGURETYPE.FT_CIRCLEARROWDOWN:
				Points.push(new AGJQW.Point(X - lDx / 8,Y + lDy / 4));
				Points.push(new AGJQW.Point(X + lDx / 8,Y + lDy / 4));
				Points.push(new AGJQW.Point(X + lDx / 8,Y + lDy / 2));
				Points.push(new AGJQW.Point(X + lDx / 4,Y + lDy / 2));
				Points.push(new AGJQW.Point(X,Y + (3 * lDy) / 4));
				Points.push(new AGJQW.Point(X - lDx / 4,Y + lDy / 2));
				Points.push(new AGJQW.Point(X - lDx / 8,Y + lDy / 2));
				this.mp_DrawEllipse(clrBorderColor, X - lDx / 2, Y, lDx, lDy);
				this.mp_DrawFigureAux(clrFillColor, clrBorderColor, Points);
				break;
			case AGJQW.GRE_FIGURETYPE.FT_SMALLPROJECTUP:
				Points.push(new AGJQW.Point(X,Y + lDy / 2));
				Points.push(new AGJQW.Point(X + lDx / 4,Y + (3 * lDy) / 4));
				Points.push(new AGJQW.Point(X + lDx / 4,Y + lDy));
				Points.push(new AGJQW.Point(X - lDx / 4,Y + lDy));
				Points.push(new AGJQW.Point(X - lDx / 4,Y + (3 * lDy) / 4));
				this.mp_DrawFigureAux(clrFillColor, clrBorderColor, Points);
				break;
			case AGJQW.GRE_FIGURETYPE.FT_SMALLPROJECTDOWN:
				Points.push(new AGJQW.Point(X + lDx / 4,Y));
				Points.push(new AGJQW.Point(X + lDx / 4,Y + lDy / 4));
				Points.push(new AGJQW.Point(X,Y + lDy / 2));
				Points.push(new AGJQW.Point(X - lDx / 4,Y + lDy / 4));
				Points.push(new AGJQW.Point(X - lDx / 4,Y));
				this.mp_DrawFigureAux(clrFillColor, clrBorderColor, Points);
				break;
			case AGJQW.GRE_FIGURETYPE.FT_RECTANGLE:
				Points.push(new AGJQW.Point(X - lDx / 8,Y));
				Points.push(new AGJQW.Point(X + lDx / 8,Y));
				Points.push(new AGJQW.Point(X + lDx / 8,Y + lDy));
				Points.push(new AGJQW.Point(X - lDx / 8,Y + lDy));
				this.mp_DrawFigureAux(clrFillColor, clrBorderColor, Points);
				break;
			case AGJQW.GRE_FIGURETYPE.FT_SQUARE:
				Points.push(new AGJQW.Point(X - lDx / 4,Y + lDx / 4));
				Points.push(new AGJQW.Point(X + lDx / 4,Y + lDx / 4));
				Points.push(new AGJQW.Point(X + lDx / 4,Y + (3 * lDy) / 4));
				Points.push(new AGJQW.Point(X - lDx / 4,Y + (3 * lDy) / 4));
				this.mp_DrawFigureAux(clrFillColor, clrBorderColor, Points);
				break;
			case AGJQW.GRE_FIGURETYPE.FT_CIRCLE:
				this.mp_FillEllipse(clrFillColor, X - lDx / 2, Y, lDx, lDy);
				break;
			default:
				return; 
		}
    }

    AGJQW.clsGraphics.prototype.mp_DrawFigureAux = function(oBrush, oPen, aPoints) {
        this.oGraphics.fillStyle = oBrush.ToString();
        this.oGraphics.beginPath();
        this.oGraphics.moveTo(aPoints[0].x + 1.5, aPoints[0].y + 1.5);
        for (i = 1; i <= aPoints.length - 1; i++) {
            this.oGraphics.lineTo(aPoints[i].x + 1.5, aPoints[i].y + 1.5);
        }
        this.oGraphics.closePath();
        this.oGraphics.fill();

        this.oGraphics.lineWidth = 1;
        this.oGraphics.strokeStyle = oPen.ToString();
        this.oGraphics.beginPath();
        this.oGraphics.moveTo(aPoints[0].x + 1.5, aPoints[0].y + 1.5);
        for (i = 1; i <= aPoints.length - 1; i++) {
            this.oGraphics.lineTo(aPoints[i].x + 1.5, aPoints[i].y + 1.5);
        }
        this.oGraphics.closePath();
        this.oGraphics.stroke();
    }

	AGJQW.clsGraphics.prototype.mp_DrawPattern = function(X1, Y1, X2, Y2, clrColor, yDrawStyle, lPatternFactor) {
		var tmp = 0;
		var c = 0;
		var c1 = 0;
		var c2 = 0;
		var i1 = 0;
		var j1 = 0;
		var i2 = 0;
		var j2 = 0;
		if (X1 > X2) 
		{
			tmp = X1;
			X1 = X2;
			X2 = tmp;
		}
		if (Y1 > Y2) 
		{
			tmp = Y1;
			Y1 = Y2;
			Y2 = tmp;
		}
		if (yDrawStyle == AGJQW.GRE_PATTERN.FP_HORIZONTALLINE || yDrawStyle == AGJQW.GRE_PATTERN.FP_CROSS) 
		{
			for (j1 = (Y1 + lPatternFactor); j1 <= Y2; j1 += lPatternFactor) 
			{
				this.mp_DrawLine(X1, j1, X2, j1, AGJQW.GRE_LINETYPE.LT_NORMAL, clrColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID, 1, true);
			}
		}
		if (yDrawStyle == AGJQW.GRE_PATTERN.FP_VERTICALLINE || yDrawStyle == AGJQW.GRE_PATTERN.FP_CROSS) 
		{
			for (j1 = (X1 + lPatternFactor); j1 <= X2; j1 += lPatternFactor) 
			{
				this.mp_DrawLine(j1, Y1, j1, Y2, AGJQW.GRE_LINETYPE.LT_NORMAL, clrColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID, 1, true);
			}
		}
		if (yDrawStyle == AGJQW.GRE_PATTERN.FP_UPWARDDIAGONAL || yDrawStyle == AGJQW.GRE_PATTERN.FP_DIAGONALCROSS) 
		{
			c1 = (Y1 + X1) / lPatternFactor + 1;
			c2 = (Y2 + X2) / lPatternFactor;
			for (c = c1; c <= c2; c++) 
			{
				i1 = X1;
				i2 = X2;
				j1 = c * lPatternFactor - i1;
				j2 = c * lPatternFactor - i2;
				if (j2 < Y1) 
				{
					i2 = c * lPatternFactor - Y1;
					j2 = c * lPatternFactor - i2;
				}
				if (j1 > Y2) 
				{
					i1 = c * lPatternFactor - Y2;
					j1 = c * lPatternFactor - i1;
				}
				this.mp_DrawLine(i1, j1, i2, j2, AGJQW.GRE_LINETYPE.LT_NORMAL, clrColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID, 1, false);
			}
		}
		if (yDrawStyle == AGJQW.GRE_PATTERN.FP_DOWNWARDDIAGONAL || yDrawStyle == AGJQW.GRE_PATTERN.FP_DIAGONALCROSS) 
		{
			c1 = (Y1 - X2) / lPatternFactor + 1;
			c2 = (Y2 - X1) / lPatternFactor;
			for (c = c1; c <= c2; c++) 
			{
				i1 = X1;
				i2 = X2;
				j1 = i1 + c * lPatternFactor;
				j2 = i2 + c * lPatternFactor;
				if (j1 < Y1) 
				{
					i1 = Y1 - c * lPatternFactor;
					j1 = i1 + c * lPatternFactor;
				}
				if (j2 > Y2) 
				{
					i2 = Y2 - c * lPatternFactor;
					j2 = i2 + c * lPatternFactor;
				}
				this.mp_DrawLine(i1, j1, i2, j2, AGJQW.GRE_LINETYPE.LT_NORMAL, clrColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID, 1, false);
			}
		}
		if (yDrawStyle == AGJQW.GRE_PATTERN.FP_LIGHT) 
		{
			for (j1 = (Y1 + 1); j1 <= (Y2 - 1); j1++) 
			{
				if (j1 % 2 == 0) 
				{
					for (j2 = (X1 + 1); j2 <= (X2 - 1); j2 += 4) 
					{
						this.mp_DrawLine(j2, j1, j2 + 1, j1, AGJQW.GRE_LINETYPE.LT_NORMAL, clrColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID, 1, true);
					}
				}
				else 
				{
					for (j2 = (X1 + 3); j2 <= (X2 - 1); j2 += 4) 
					{
						this.mp_DrawLine(j2, j1, j2 + 1, j1, AGJQW.GRE_LINETYPE.LT_NORMAL, clrColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID, 1, true);
					}
				}
			}
		}
		if (yDrawStyle == AGJQW.GRE_PATTERN.FP_MEDIUM) 
		{
			for (j1 = (Y1 + 1); j1 <= (Y2 - 1); j1++) 
			{
				if (j1 % 2 == 0) 
				{
					for (j2 = (X1 + 1); j2 <= (X2 - 1); j2 += 2) 
					{
						this.mp_DrawLine(j2, j1, j2 + 1, j1, AGJQW.GRE_LINETYPE.LT_NORMAL, clrColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID, 1, true);
					}
				}
				else 
				{
					for (j2 = (X1 + 2); j2 <= (X2 - 1); j2 += 2) 
					{
						this.mp_DrawLine(j2, j1, j2 + 1, j1, AGJQW.GRE_LINETYPE.LT_NORMAL, clrColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID, 1, true);
					}
				}
			}
		}
		if (yDrawStyle == AGJQW.GRE_PATTERN.FP_DARK) 
		{
			for (j1 = (Y1 + 1); j1 <= (Y2 - 1); j1++) 
			{
				if (j1 % 2 == 0) 
				{
					for (j2 = (X1 + 1); j2 <= (X2 - 1); j2 += 4) 
					{
						if (j2 + 3 < X2) 
						{
							this.mp_DrawLine(j2, j1, j2 + 3, j1, AGJQW.GRE_LINETYPE.LT_NORMAL, clrColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID, 1, true);
						}
						else 
						{
							this.mp_DrawLine(j2, j1, X2, j1, AGJQW.GRE_LINETYPE.LT_NORMAL, clrColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID, 1, true);
						}
					}
				}
				else 
				{
					this.mp_DrawLine(X1, j1, X1 + 2, j1, AGJQW.GRE_LINETYPE.LT_NORMAL, clrColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID, 1, true);
					for (j2 = (X1 + 3); j2 <= (X2 - 1); j2 += 4) 
					{
						if (j2 + 3 < X2) 
						{
							this.mp_DrawLine(j2, j1, j2 + 3, j1, AGJQW.GRE_LINETYPE.LT_NORMAL, clrColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID, 1, true);
						}
						else 
						{
							this.mp_DrawLine(j2, j1, X2, j1, AGJQW.GRE_LINETYPE.LT_NORMAL, clrColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID, 1, true);
						}
					}
				}
			}
		}
	}

    AGJQW.clsGraphics.prototype.mp_DrawTextEx = function (X1, Y1, X2, Y2, sParam, yFlags, clrColor, oFont, bClip) {
        this.mp_DrawString(X1, Y1, X2, Y2, sParam, oFont, clrColor, yFlags);
    }

    AGJQW.clsGraphics.prototype.mp_DrawString = function (X1, Y1, X2, Y2, sParam, oFont, clrColor, oStringFormat) {
        this.oGraphics.font = oFont.ToString();
        this.oGraphics.fillStyle = clrColor.ToString();
        var lWidth = this.mp_lStrWidth(sParam, oFont);
        var lHeight = this.mp_lStrHeight(sParam, oFont);
        var lTextX = 0;
        var lTextY = 0;
        switch(oStringFormat.HorizontalAlignment)
        {
            case AGJQW.GRE_HORIZONTALALIGNMENT.HAL_LEFT:
                lTextX = X1 + 3;
                break;
            case AGJQW.GRE_HORIZONTALALIGNMENT.HAL_CENTER:
                lTextX = Math.floor((X2 - X1 - lWidth) / 2) + X1 + 1;
                break;
            case AGJQW.GRE_HORIZONTALALIGNMENT.HAL_RIGHT:
                lTextX = X2 - lWidth - 1;
                break;
        }
        switch(oStringFormat.VerticalAlignment)
        {
            case AGJQW.GRE_VERTICALALIGNMENT.VAL_TOP:
                lTextY = Y1 + lHeight - 1;
                break;
            case AGJQW.GRE_VERTICALALIGNMENT.VAL_CENTER:
                lTextY = ((Y2 - Y1 - lHeight) / 2) + Y1 + lHeight - 2;
                break;
            case AGJQW.GRE_VERTICALALIGNMENT.VAL_BOTTOM:
                lTextY = Y2 - 3;
                break;
        }
        this.oGraphics.fillText(sParam,lTextX,lTextY);
    }

	AGJQW.clsGraphics.prototype.mp_DrawAlignedText = function(X1, Y1, X2, Y2, sParam, yHPos, yVPos, clrColor, oFont, bClip) {
        if (AGJQW.g_IsNV(bClip)) {bClip = true;}
        var yFlags = new AGJQW.clsTextFlags(this.mp_oControl);
        yFlags.VerticalAlignment = yVPos;
        yFlags.HorizontalAlignment = yHPos;
        this.mp_DrawString(X1, Y1, X2, Y2, sParam, oFont, clrColor, yFlags);
	}

    AGJQW.clsGraphics.prototype.mp_lStrWidth =  function (sString, r_oFont) {
        return this.mp_MeasureText(sString, false, r_oFont.FontFamily, r_oFont.Size)[0];
    }

    AGJQW.clsGraphics.prototype.mp_lStrHeight =  function (sString, r_oFont) {
        return this.mp_MeasureText(sString, false, r_oFont.FontFamily, r_oFont.Size)[1];
    }

    AGJQW.clsGraphics.prototype.mp_MeasureText = function (text, bold, font, size)
    {
        var str = text + ':' + bold + ':' + font + ':' + size;
        if (typeof(__measuretext_cache__) == 'object' && __measuretext_cache__[str]) {
            return __measuretext_cache__[str];
        }
        var div = document.createElement('DIV');
            div.innerHTML = text;
            div.style.position = 'absolute';
            div.style.top = '-100px';
            div.style.left = '-100px';
            div.style.fontFamily = font;
            div.style.fontWeight = bold ? 'bold' : 'normal';
            div.style.fontSize = size + 'pt';
        document.body.appendChild(div);
        var size = [div.offsetWidth, div.offsetHeight];
        document.body.removeChild(div);
        if (typeof(__measuretext_cache__) != 'object') {
            __measuretext_cache__ = [];
        }
        __measuretext_cache__[str] = size;
        return size;
    }

    AGJQW.clsGraphics.prototype.mp_ClipRegion = function (X1, Y1, X2, Y2, bStore) {
        this.mp_ClearClipRegion();
        this.oGraphics.rect(X1 + 1.5, Y1 + 1.5, Math.abs(X2 - X1), Math.abs(Y2 - Y1));
        this.oGraphics.save();
        this.oGraphics.clip();
        this.mp_bRegionClipped = true;
    }

    AGJQW.clsGraphics.prototype.mp_ClearClipRegion = function () {
        if (this.mp_bRegionClipped == true) {
            this.oGraphics.restore();
            this.mp_bRegionClipped = false;
        }
    }

