    AGJQW.clsGraphics.prototype.mp_GradientFill = function (X1, Y1, X2, Y2, clrStartColor, clrEndColor, yGradientType) {
        var iBuff = 0;
        if ((X2 - X1) < 0)
        {
            iBuff = X1;
            X1 = X2;
            X2 = iBuff;
        }
        if ((Y2 - Y1) < 0)
        {
            iBuff = Y1;
            Y1 = Y2;
            Y2 = iBuff;
        }
        var oGradient;
        if (yGradientType == AGJQW.GRE_GRADIENTFILLMODE.GDT_HORIZONTAL) {
            oGradient = this.oGraphics.createLinearGradient(X1 + 1,Y1 + 1,X2 + 1,Y1 + 1);
            oGradient.addColorStop(0,clrStartColor.ToString());
            oGradient.addColorStop(1,clrEndColor.ToString());
        }
        else if (yGradientType == AGJQW.GRE_GRADIENTFILLMODE.GDT_VERTICAL) {
            oGradient = this.oGraphics.createLinearGradient(X1 + 1,Y1 + 1,X1 + 1,Y2 + 1);
            oGradient.addColorStop(0,clrStartColor.ToString());
            oGradient.addColorStop(1,clrEndColor.ToString());
        }
        this.oGraphics.fillStyle = oGradient;
        this.oGraphics.fillRect(X1 + 1,Y1 + 1,(X2 - X1) + 1,(Y2 - Y1) + 1);
    }

