		oXML.WriteProperty("HatchStyle", this.mp_yHatchStyle);
		oXML.WriteProperty("ImageAlignmentHorizontal", this.mp_yImageAlignmentHorizontal);
		oXML.WriteProperty("ImageAlignmentVertical", this.mp_yImageAlignmentVertical);
		oXML.WriteProperty("ImageXMargin", this.mp_lImageXMargin);
