		oXML.WriteProperty("OffsetBottom", this.mp_lOffsetBottom);
		oXML.WriteProperty("OffsetTop", this.mp_lOffsetTop);
		oXML.WriteProperty("Pattern", this.mp_yPattern);
		oXML.WriteProperty("PatternFactor", this.mp_lPatternFactor);
		oXML.WriteProperty("Placement", this.mp_yPlacement);
		oXML.WriteProperty("StartGradientColor", this.mp_clrStartGradientColor);
		oXML.WriteProperty("Tag", this.mp_sTag);
        oXML.WriteProperty("BorderWidth", this.mp_lBorderWidth);
		oXML.WriteProperty("TextAlignmentHorizontal", this.mp_yTextAlignmentHorizontal);
		oXML.WriteProperty("TextAlignmentVertical", this.mp_yTextAlignmentVertical);
