    AGJQW.clsStyles.prototype.ContainsKey = function(Key) {
        if (AGJQW.g_IsNumeric(Key))
        {
            this.mp_oControl.mp_ErrorReport(AGJQW.SYS_ERRORS.STYLES_ADD_1, "Invalid Style object key, key cannot be numeric", "ActiveGanttJQWCtl.Styles.ContainsKey");
            return false;
        }
        return this.mp_oCollection.m_bDoesKeyExist(Key);
    }

	AGJQW.clsStyles.prototype.Item = function(Index) {
		return this.mp_oCollection.m_oItem(Index, AGJQW.SYS_ERRORS.STYLES_ITEM_1, AGJQW.SYS_ERRORS.STYLES_ITEM_2, AGJQW.SYS_ERRORS.STYLES_ITEM_3, AGJQW.SYS_ERRORS.STYLES_ITEM_4);
	}

	AGJQW.clsStyles.prototype.FItem = function(Index) {
		if (Index == "DS_TASK") 
		{
			return this.mp_oDefaultTaskStyle;
		}
		else if (Index == "DS_ROW") 
		{
			return this.mp_oDefaultRowStyle;
		}
		else if (Index == "DS_CLIENTAREA") 
		{
			return this.mp_oDefaultClientAreaStyle;
		}
		else if (Index == "DS_CELL") 
		{
			return this.mp_oDefaultCellStyle;
		}
		else if (Index == "DS_COLUMN") 
		{
			return this.mp_oDefaultColumnStyle;
		}
		else if (Index == "DS_PERCENTAGE") 
		{
			return this.mp_oDefaultPercentageStyle;
		}
		else if (Index == "DS_PREDECESSOR") 
		{
			return this.mp_oDefaultPredecessorStyle;
		}
		else if (Index == "DS_TIMELINE") 
		{
			return this.mp_oDefaultTimeLineStyle;
		}
		else if (Index == "DS_TIMEBLOCK") 
		{
			return this.mp_oDefaultTimeBlockStyle;
		}
		else if (Index == "DS_TICKMARKAREA") 
		{
			return this.mp_oDefaultTickMarkAreaStyle;
		}
        else if (Index == "DS_SPLITTER")
        {
            return this.mp_oDefaultSplitterStyle;
        }
        else if (Index == "DS_PROGRESSLINE")
        {
            return this.mp_oDefaultProgressLineStyle;
        }
        else if (Index == "DS_CONTROL") 
        {
			return this.mp_oDefaultControlStyle;
		}
        else if (Index == "DS_NODE") 
        {
			return this.mp_oDefaultNodeStyle;
		}
        else if (Index == "DS_TIER")
        {
            return this.mp_oDefaultTierStyle;
        }
        else if (Index == "DS_SCROLLBAR")
        {
            return this.mp_oDefaultScrollBarStyle;
        }
        else if (Index == "DS_SB_NORMAL")
        {
            return this.mp_oDefaultSBNormalStyle;
        }
        else if (Index == "DS_SB_PRESSED")
        {
            return this.mp_oDefaultSBPressedStyle;
        }
        else if (Index == "DS_SB_DISABLED")
        {
            return this.mp_oDefaultSBDisabledStyle;
        }
        else if (Index == "DS_SB_SEPARATOR")
        {
            return this.mp_oDefaultSBSeparatorStyle;
        }
        else
        {
            return this.mp_oCollection.m_oItem(Index, AGJQW.SYS_ERRORS.STYLES_ITEM_1, AGJQW.SYS_ERRORS.STYLES_ITEM_2, AGJQW.SYS_ERRORS.STYLES_ITEM_3, AGJQW.SYS_ERRORS.STYLES_ITEM_4);
        }
	}

	AGJQW.clsStyles.prototype.Add = function(Key) {
		this.mp_oCollection.AddMode = true;
        var oStyle = new AGJQW.clsStyle(this.mp_oControl);
		Key = AGJQW.g_Trim(Key);
		oStyle.Key = Key;
		this.mp_oCollection.m_Add(oStyle, Key, AGJQW.SYS_ERRORS.STYLES_ADD_1, AGJQW.SYS_ERRORS.STYLES_ADD_2, true, AGJQW.SYS_ERRORS.STYLES_ADD_3);
		return oStyle;
	}

