    AGJQW.clsStyles.prototype.mp_GetNewStyleIndex = function(sKey, sIndex, sStyleIndex) {
        if (sIndex == sStyleIndex)
        {
            return "";
        }
        if (sKey == sStyleIndex)
        {
            return "";
        }
        return sStyleIndex;
    }

	AGJQW.clsStyles.prototype.GetXML = function() {
		var lIndex;
		var oStyle;
		var oXML = new AGJQW.clsXML(this.mp_oControl,"Styles");
		oXML.InitializeWriter();
		for (lIndex = 1;lIndex <= Count;lIndex++) 
		{
			oStyle = this.mp_oCollection.m_oReturnArrayElement(lIndex);
			oXML.WriteObject(oStyle.GetXML());
		}
		return oXML.GetXML();
	}

	AGJQW.clsStyles.prototype.SetXML = function(sXML) {
		var lIndex;
		var oXML = new AGJQW.clsXML(this.mp_oControl,"Styles");
		oXML.SetXML(sXML);
		oXML.InitializeReader();
		this.mp_oCollection.m_Clear();
		for (lIndex = 1;lIndex <= oXML.ReadCollectionCount();lIndex++) 
		{
            var oStyle = new AGJQW.clsStyle(mp_oControl);
			oStyle.SetXML(oXML.ReadCollectionObject(lIndex));
			this.mp_oCollection.AddMode = true;
			this.mp_oCollection.m_Add(oStyle, oStyle.Key, AGJQW.SYS_ERRORS.STYLES_ADD_1, AGJQW.SYS_ERRORS.STYLES_ADD_2, true, AGJQW.SYS_ERRORS.STYLES_ADD_3);
			oStyle = null;
		}
	}

    ///clsSplitter

    AGJQW.clsSplitter = function (oControl) {
        this.mp_oControl = oControl;
		this.mp_lPosition = 125;
        this.mp_aColors = new AGJQW.ArrayList();
		this.mp_yAppearance = AGJQW.E_BORDERSTYLE.TLB_3D;
        this.mp_yType = AGJQW.E_SPLITTERTYPE.SA_APPEARANCE;
        this.Width = 6;
        this.mp_sStyleIndex = "DS_SPLITTER";
        this.mp_oStyle = this.mp_oControl.Styles.FItem("DS_SPLITTER");
        this.mp_lOffset = -1;
    }

    AGJQW.clsSplitter.prototype = {
        get Type(){
            return this.mp_yType;
        },
        set Type(value){
            this.mp_yType = value;
        },
        get Width(){
            if (this.mp_yType == AGJQW.E_SPLITTERTYPE.SA_APPEARANCE)
            {
                return 6;
            }
            else
            {
                return this.mp_lWidth;
            }
        },
        set Width(value){
            if (this.mp_yType == AGJQW.E_SPLITTERTYPE.SA_APPEARANCE)
            {
                this.mp_lWidth = 6;
            }
            else
            {
                if (value < 0)
                {
                    this.mp_oControl.mp_ErrorReport(AGJQW.SYS_ERRORS.SPLITTER_INVALID_WIDTH, "Invalid Width Value", "ActiveGanttJQWCtl.clsSplitter.Width");
                    return;
                }
                this.mp_lWidth = value;
            }
            var i = 0;
            this.mp_aColors.Clear();
            for (i = 0; i <= this.mp_lWidth - 1; i++)
            {
                this.mp_aColors.Add(AGJQW.Color_FromArgb(255, 255, 255, 255));
            }
        },
        get Appearance(){
            return this.mp_yAppearance;
        },
        set Appearance(value){
            this.mp_yAppearance = value;
        },
        get Position(){
            return this.mp_lPosition;
        },
        set Position(value){
			if ((value <= 0))
			{
				return;
			}
			this.mp_lPosition = value;
            if (this.mp_lPosition > (this.mp_oControl.Columns.Width + this.mp_lOffset))
            {
                this.mp_lPosition = this.mp_oControl.Columns.Width + this.mp_lOffset;
                this.mp_oControl.HorizontalScrollBar.Value = 0;
            }
        },
        get Left(){
			if (this.mp_oControl.Columns.Count != 0)
			{
				return this.Position + this.mp_oControl.mt_BorderThickness - 1;
			}
			else
			{
				if ((this.mp_oControl.f_UserMode == true))
				{
					return 0;
				}
				else
				{
					return 125 + this.mp_oControl.mt_BorderThickness - 1;
				}
			}
        },
        get Right(){
			if (this.mp_oControl.Columns.Count != 0)
			{
				return this.Position + this.mp_oControl.mt_BorderThickness + this.Width;
			}
			else
			{
				if ((this.mp_oControl.f_UserMode == true))
				{
					return this.mp_oControl.mt_BorderThickness;
				}
				else
				{
					return 125 + this.mp_oControl.mt_BorderThickness + this.Width;
				}
			}
        },

        get StyleIndex(){
                if (this.mp_sStyleIndex == "DS_SPLITTER")
                {
                    return "";
                }
                else
                {
                    return this.mp_sStyleIndex;
                }
        },
        set StyleIndex(value){
                value = value.trim();
                if (value.length == 0)
                    value = "DS_SPLITTER";
                this.mp_sStyleIndex = value;
                this.mp_oStyle = this.mp_oControl.Styles.FItem(value);
        },
        get Style(){
            return this.mp_oStyle;
        },
        get Offset(){
            return this.mp_lOffset;
        },
        set Offset(value){
            this.mp_lOffset = value;
        }
    }

    AGJQW.clsSplitter.prototype.SetColor = function(Index, oColor) {
        Index = Index - 1;
        if (this.mp_yType != AGJQW.E_SPLITTERTYPE.SA_USERDEFINED)
        {
            this.mp_oControl.mp_ErrorReport(AGJQW.SYS_ERRORS.SPLITTER_INVALIDOP, "Invalid Operation", "ActiveGanttJQWCtl.clsSplitter.SetColor");
            return;
        }
        if (Index < 0)
        {
            this.mp_oControl.mp_ErrorReport(AGJQW.SYS_ERRORS.SPLITTER_INVALID_INDEX, "Invalid Index", "ActiveGanttJQWCtl.clsSplitter.SetColor");
            return;
        }
        if (Index > this.mp_aColors.Count - 1)
        {
            this.mp_oControl.mp_ErrorReport(AGJQW.SYS_ERRORS.SPLITTER_INVALID_INDEX, "Invalid Index", "ActiveGanttJQWCtl.clsSplitter.SetColor");
            return;
        }
        this.mp_aColors.tb[Index] = oColor;
    }

    AGJQW.clsSplitter.prototype.GetColor = function(Index) {
        Index = Index - 1;
        if (this.mp_yType != AGJQW.E_SPLITTERTYPE.SA_USERDEFINED)
        {
            this.mp_oControl.mp_ErrorReport(AGJQW.SYS_ERRORS.SPLITTER_INVALIDOP, "Invalid Operation", "ActiveGanttJQWCtl.clsSplitter.GetColor");
            return null;
        }
        if (Index < 0)
        {
            this.mp_oControl.mp_ErrorReport(AGJQW.SYS_ERRORS.SPLITTER_INVALID_INDEX, "Invalid Index", "ActiveGanttJQWCtl.clsSplitter.GetColor");
            return null;
        }
        if (Index > mp_aColors.Count - 1)
        {
            this.mp_oControl.mp_ErrorReport(AGJQW.SYS_ERRORS.SPLITTER_INVALID_INDEX, "Invalid Index", "ActiveGanttJQWCtl.clsSplitter.GetColor");
            return null;
        }
        return this.mp_aColors.tb[Index];
    }

    AGJQW.clsSplitter.prototype.Draw = function() {
        if (this.mp_oControl.Columns.Count == 0 && this.mp_oControl.f_UserMode == true)
        {
            return;
        }
        this.mp_oControl.clsG.mp_ClipRegion(this.Left + 1, 0, this.Left + this.Width + 1, this.mp_oControl.mt_BottomMargin, true);
        if (this.mp_yType == AGJQW.E_SPLITTERTYPE.SA_STYLE)
        {
            this.mp_oControl.clsG.mp_DrawItem(this.Left + 1, 0, this.Left + this.Width + 1, this.mp_oControl.clsG.Height(), "", "", false, null, 0, 0, this.Style);
        }
        else
        {
            var i = 0;
            if (this.mp_yType == AGJQW.E_SPLITTERTYPE.SA_APPEARANCE)
            {
                this.mp_aColors.Clear();
                for (i = 0; i <= 5; i++)
                {
                    this.mp_aColors.Add(AGJQW.Color_FromArgb(255, 255, 255, 255));
                }
                switch (this.mp_yAppearance)
                {
                    case AGJQW.E_BORDERSTYLE.TLB_3D:
                        this.mp_aColors.tb[0] = AGJQW.Color_FromArgb(255, 192, 192, 192);
                        this.mp_aColors.tb[1] = AGJQW.Color_FromArgb(255, 255, 255, 255);
                        this.mp_aColors.tb[2] = AGJQW.Color_FromArgb(255, 192, 192, 192);
                        this.mp_aColors.tb[3] = AGJQW.Color_FromArgb(255, 192, 192, 192);
                        this.mp_aColors.tb[4] = AGJQW.Color_FromArgb(255, 64, 64, 64);
                        this.mp_aColors.tb[5] = AGJQW.Color_FromArgb(255, 66, 66, 66);
                        break;
                    case AGJQW.E_BORDERSTYLE.TLB_NONE:
                        this.mp_aColors.tb[0] = AGJQW.Color_FromArgb(255, 192, 192, 192);
                        this.mp_aColors.tb[1] = AGJQW.Color_FromArgb(255, 192, 192, 192);
                        this.mp_aColors.tb[2] = AGJQW.Color_FromArgb(255, 192, 192, 192);
                        this.mp_aColors.tb[3] = AGJQW.Color_FromArgb(255, 192, 192, 192);
                        this.mp_aColors.tb[4] = AGJQW.Color_FromArgb(255, 192, 192, 192);
                        this.mp_aColors.tb[5] = AGJQW.Color_FromArgb(255, 192, 192, 192);
                        break;
                    case AGJQW.E_BORDERSTYLE.TLB_SINGLE:
                        this.mp_aColors.tb[0] = AGJQW.Color_FromArgb(255, 0, 0, 0);
                        this.mp_aColors.tb[1] = AGJQW.Color_FromArgb(255, 192, 192, 192);
                        this.mp_aColors.tb[2] = AGJQW.Color_FromArgb(255, 192, 192, 192);
                        this.mp_aColors.tb[3] = AGJQW.Color_FromArgb(255, 192, 192, 192);
                        this.mp_aColors.tb[4] = AGJQW.Color_FromArgb(255, 192, 192, 192);
                        this.mp_aColors.tb[5] = AGJQW.Color_FromArgb(255, 0, 0, 0);
                        break;
                }
            }
            for (i = 0; i <= this.mp_aColors.Count - 1; i++)
            {
                this.mp_oControl.clsG.mp_DrawLine(this.Left + i + 1, 0, this.Left + i + 1, this.mp_oControl.clsG.Height(), AGJQW.GRE_LINETYPE.LT_NORMAL, this.mp_aColors.tb[i], AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID);
            }
        }
    }

    AGJQW.clsSplitter.prototype.f_AdjustPosition = function() {
		var lWidth;
        lWidth = this.mp_oControl.Columns.Width + this.mp_lOffset;
		if (lWidth < (this.mp_oControl.clsG.Width() - 25))
		{
			if (this.mp_lPosition < lWidth)
			{
				this.mp_lPosition = lWidth;
			}
		}
		if (this.mp_lPosition > lWidth)
		{
			this.mp_lPosition = lWidth;
            this.mp_oControl.HorizontalScrollBar.Value = 0;
		}
    }

    AGJQW.clsSplitter.prototype.GetXML = function() {
		var oXML = new AGJQW.clsXML(this.mp_oControl,"Splitter");
		oXML.InitializeWriter();
		oXML.WriteProperty("Appearance", this.mp_yAppearance);
        oXML.WriteProperty("Offset", this.mp_lOffset);
		oXML.WriteProperty("Position", this.mp_lPosition);
        oXML.WriteProperty("Type", this.mp_yType);
        oXML.WriteProperty("StyleIndex", this.mp_sStyleIndex);
        oXML.WriteProperty("Width", this.mp_lWidth);
        if (this.mp_yType == AGJQW.E_SPLITTERTYPE.SA_USERDEFINED)
        {
            oXML.WriteProperty("ColorCount", this.mp_aColors.Count);
            var i = 0;
            for (i = 0; i <= this.mp_aColors.Count - 1; i++)
            {
                oXML.WriteProperty("Color" + i, this.mp_aColors.tb[i]);
            }
        }
        else
        {
            oXML.WriteProperty("ColorCount", 0);
        }
        return oXML.GetXML();
    }

    AGJQW.clsSplitter.prototype.SetXML = function(sXML) {
		var oXML = new AGJQW.clsXML(this.mp_oControl,"Splitter");
		oXML.SetXML(sXML);
		oXML.InitializeReader();
        oXML.ReadProperty("Appearance", this.mp_yAppearance);
        oXML.ReadProperty("Offset", this.mp_lOffset);
        oXML.ReadProperty("Position", this.mp_lPosition);
        this.Position = this.mp_lPosition;
        oXML.ReadProperty("Type", this.mp_yType);
        oXML.ReadProperty("StyleIndex", this.mp_sStyleIndex);
        this.StyleIndex = this.mp_sStyleIndex;
        oXML.ReadProperty("Width", this.mp_lWidth);
        this.mp_aColors.Clear();
        var lColorCount = 0;
        oXML.ReadProperty("ColorCount", lColorCount);
        if (lColorCount > 0)
        {
            var i = 0;
            for (i = 0; i <= lColorCount - 1; i++)
            {
                var oColor = AGJQW.Color_FromArgb(255, 255, 255, 255);
                oXML.ReadProperty("Color" + i, oColor);
                this.mp_aColors.Add(oColor);
            }
        }
        this.StyleIndex = this.mp_sStyleIndex;
    }


