	AGJQW.clsTreeview.prototype.mp_bCursorEditTextNode = function(X, Y) {
        var oNode;
        var oRow;
        oRow = this.mp_oControl.Rows.Item(this.mp_oControl.SelectedRowIndex);
        oNode = oRow.Node;
        if (oNode.AllowTextEdit == true)
        {
            if (X >= oNode.mp_lTextLeft && X <= oNode.mp_lTextRight)
            {
                if (Y >= oNode.mp_lTextTop && Y <= oNode.mp_lTextBottom)
                {
                    this.mp_oControl.MouseKeyboardEvents.mp_SetCursor(AGJQW.E_CURSORTYPE.CT_IBEAM);
                    return true;
                }
            }
        }
        this.mp_oControl.MouseKeyboardEvents.mp_SetCursor(AGJQW.E_CURSORTYPE.CT_NORMAL);
        return false;
	}

	AGJQW.clsTreeview.prototype.mp_bShowEditTextNode = function(X, Y) {
        var oNode;
        var oRow;
        oRow = this.mp_oControl.Rows.Item(this.mp_oControl.SelectedRowIndex);
        oNode = oRow.Node;
        if (oNode.AllowTextEdit == true)
        {
            if (X >= oNode.mp_lTextLeft && X <= oNode.mp_lTextRight)
            {
                if (Y >= oNode.mp_lTextTop && Y <= oNode.mp_lTextBottom)
                {
                    this.mp_oControl.mp_oTextBox.Initialize(this.mp_oControl.SelectedRowIndex, 0, AGJQW.E_TEXTOBJECTTYPE.TOT_NODE, X, Y);
                    return true;
                }
            }
        }
        return false;
	}

