        var oLayer = new AGJQW.clsLayer(this.mp_oControl);
		oLayer.Key = Key;
		oLayer.Visible = Visible;
		this.mp_oCollection.m_Add(oLayer, Key, AGJQW.SYS_ERRORS.LAYERS_ADD_1, AGJQW.SYS_ERRORS.LAYERS_ADD_2, false, AGJQW.SYS_ERRORS.LAYERS_ADD_3);
