	AGJQW.clsLayers.prototype.Clear = function() {
        this.mp_oControl.Tasks.oCollection.m_CollectionRemoveWhereNot("LayerIndex", "0");
        this.mp_oControl.CurrentLayer = "0";
		this.mp_oCollection.m_Clear();
	}

	AGJQW.clsLayers.prototype.Remove = function(Index) {
		var sRIndex = "";
		var sRKey = "";
        var rRIndex = new AGJQW.ByRef(sRIndex);
        var rRKey = new AGJQW.ByRef(sRKey);
        mp_oCollection.m_GetKeyAndIndex(Index, rRKey, rRIndex);
        sRIndex = rRIndex.value;
        sRKey = rRKey.value;
        this.mp_oControl.Tasks.oCollection.m_CollectionRemoveWhere("LayerIndex", sRKey, sRIndex);
        this.mp_oControl.CurrentLayer = "0";
		this.mp_oCollection.m_Remove(Index, AGJQW.SYS_ERRORS.LAYERS_REMOVE_1, AGJQW.SYS_ERRORS.LAYERS_REMOVE_2, AGJQW.SYS_ERRORS.LAYERS_REMOVE_3, AGJQW.SYS_ERRORS.LAYERS_REMOVE_4);
	}

	AGJQW.clsLayers.prototype.GetXML = function() {
		var lIndex;
		var oLayer;
		var oXML = new AGJQW.clsXML(this.mp_oControl,"Layers");
		oXML.InitializeWriter();
		for (lIndex = 1;lIndex <= Count;lIndex++) 
		{
			oLayer = this.mp_oCollection.m_oReturnArrayElement(lIndex);
			oXML.WriteObject(oLayer.GetXML());
		}
		return oXML.GetXML();
	}

	AGJQW.clsLayers.prototype.SetXML = function(sXML) {
		var lIndex;
		var oXML = new AGJQW.clsXML(this.mp_oControl,"Layers");
		oXML.SetXML(sXML);
		oXML.InitializeReader();
		this.mp_oCollection.m_Clear();
		for (lIndex = 1;lIndex <= oXML.ReadCollectionCount();lIndex++) 
		{
            var oLayer = new AGJQW.clsLayer(this.mp_oControl);
			oLayer.SetXML(oXML.ReadCollectionObject(lIndex));
			this.mp_oCollection.AddMode = true;
			this.mp_oCollection.m_Add(oLayer, oLayer.Key, AGJQW.SYS_ERRORS.LAYERS_ADD_1, AGJQW.SYS_ERRORS.LAYERS_ADD_2, false, AGJQW.SYS_ERRORS.LAYERS_ADD_3);
			oLayer = null;
		}
	}

