	AGJQW.clsNode.prototype.NextSibling = function() {
		var lIndex = this.Index;
		var oNode = null;
		var oRow = null;
		if ((lIndex + 1) <= this.mp_oControl.Rows.Count) 
		{
			for (lIndex = (this.Index + 1); lIndex <= this.mp_oControl.Rows.Count; lIndex++) 
			{
                oRow = this.mp_oControl.Rows.oCollection.m_oReturnArrayElement(lIndex);
				oNode = oRow.Node;
				if (oNode.Depth == this.Depth) 
				{
					return oNode;
				}
				else if (oNode.Depth == this.Depth - 1) 
				{
					return null;
				}
			}
			return null;
		}
		else 
		{
			//This Node is the Last Node
			return null;
		}
	}

	AGJQW.clsNode.prototype.PreviousSibling = function() {
		var lIndex = this.Index;
		var oNode = null;
		var oRow = null;
		if (lIndex > 1) 
		{
			for (lIndex = (this.Index - 1); lIndex >= 1; lIndex += -1) 
			{
                oRow = this.mp_oControl.Rows.oCollection.m_oReturnArrayElement(lIndex);
				oNode = oRow.Node;
				if (oNode.Depth == this.Depth) 
				{
					return oNode;
				}
				else if (oNode.Depth == this.Depth - 1) 
				{
					return null;
				}
			}
			return null;
		}
		else 
		{
			//This node is the First Node
			return null;
		}
	}

	AGJQW.clsNode.prototype.IsFirstSibling = function() {
		var oNode = null;
		oNode = this.PreviousSibling();
		if (oNode == null) 
		{
			return true;
		}
		else 
		{
			return false;
		}
	}

	AGJQW.clsNode.prototype.FirstSibling = function() {
		var oNode = null;
		var oReturnNode = null;
		oReturnNode = this;
		oNode = this.PreviousSibling();
		while ((oNode != null)) 
		{
			oReturnNode = oNode;
			oNode = oReturnNode.PreviousSibling();
		}
		return oReturnNode;
	}

	AGJQW.clsNode.prototype.IsLastSibling = function() {
		var oNode = null;
		oNode = this.NextSibling();
		if (oNode == null) 
		{
			return true;
		}
		else 
		{
			return false;
		}
	}

	AGJQW.clsNode.prototype.LastSibling = function() {
		var oNode = null;
		var oReturnNode = null;
		oReturnNode = this;
		oNode = this.NextSibling();
		while ((oNode != null)) 
		{
			oReturnNode = oNode;
			oNode = oReturnNode.NextSibling();
		}
		return oReturnNode;
	}

	AGJQW.clsNode.prototype.Child = function() {
		var lIndex = this.Index + 1;
		var oNode = null;
		var oRow = null;
		if (lIndex <= this.mp_oControl.Rows.Count) 
		{
            oRow = this.mp_oControl.Rows.oCollection.m_oReturnArrayElement(lIndex);
			oNode = oRow.Node;
			if (oNode.Depth == (this.Depth + 1)) 
			{
				return oNode;
			}
			else 
			{
				return null;
			}
		}
		else 
		{
			return null;
		}
	}

	AGJQW.clsNode.prototype.Parent = function() {
        return this.mp_oParent;
	}

	AGJQW.clsNode.prototype.IsRoot = function() {
		if (this.Parent() == null) 
		{
			return true;
		}
		else 
		{
			return false;
		}
	}

	AGJQW.clsNode.prototype.FullPath = function() {
		var oNode = null;
		var sReturn = "";
		oNode = this.Parent();
		while ((oNode != null)) 
		{
			sReturn = oNode.Text + this.mp_oControl.Treeview.PathSeparator + sReturn;
			oNode = oNode.Parent();
		}
		return sReturn + this.Text;
	}

	AGJQW.clsNode.prototype.Children = function() {
		var lIndex = 0;
		var oNode = null;
		var oRow = null;
		var lReturn = 0;
		for (lIndex = (this.mp_oRow.Index + 1); lIndex <= this.mp_oControl.Rows.Count; lIndex++) 
		{
            oRow = this.mp_oControl.Rows.oCollection.m_oReturnArrayElement(lIndex);
			oNode = oRow.Node;
			if (this.Depth < oNode.Depth) 
			{
				if (this.Depth + 1 == oNode.Depth) 
				{
					lReturn = lReturn + 1;
				}
			}
			else 
			{
				break;
			}
		}
		return lReturn;
	}

	AGJQW.clsNode.prototype.RecurseHidden = function(oNode, bHidden) {
		oNode = oNode.Parent();
		if ((oNode != null)) 
		{
			if (oNode.mp_bExpanded == false) 
			{
				bHidden = true;
			}
			bHidden = this.RecurseHidden(oNode, bHidden);
		}
		return bHidden;
	}

