	AGJQW.clsRows.prototype.Item = function(Index) {
        return this.mp_oCollection.m_oItem(Index, AGJQW.SYS_ERRORS.ROWS_ITEM_1, AGJQW.SYS_ERRORS.ROWS_ITEM_2, AGJQW.SYS_ERRORS.ROWS_ITEM_3, AGJQW.SYS_ERRORS.ROWS_ITEM_4);
	}

	AGJQW.clsRows.prototype.Add = function(Key, Text, MergeCells, Container, StyleIndex, UpdateScrollBar) {
        if (AGJQW.g_IsNV(Text)) {Text="";}
        if (AGJQW.g_IsNV(MergeCells)) {MergeCells=false;}
        if (AGJQW.g_IsNV(Container)) {Container=true;}
        if (AGJQW.g_IsNV(StyleIndex)) {StyleIndex="";}
        if (AGJQW.g_IsNV(UpdateScrollBar)) {UpdateScrollBar=true;}
		this.mp_oCollection.AddMode = true;
        var oRow = new AGJQW.clsRow(this.mp_oControl);
		var lIndex = 0;
		oRow.Key = Key;
		oRow.Text = Text;
		oRow.MergeCells = MergeCells;
		oRow.Container = Container;
		oRow.StyleIndex = StyleIndex;
		this.mp_oCollection.m_Add(oRow, Key, AGJQW.SYS_ERRORS.ROWS_ADD_1, AGJQW.SYS_ERRORS.ROWS_ADD_2, true, AGJQW.SYS_ERRORS.ROWS_ADD_3);
		for (lIndex = 1; lIndex <= this.mp_oControl.Columns.Count; lIndex++) 
		{
			oRow = this.mp_oControl.Rows.oCollection.m_oReturnArrayElement(this.mp_oControl.Rows.Count);
			oRow.Cells.Add();
		}
        if (UpdateScrollBar == true)
        {
            this.mp_oControl.VerticalScrollBar.Update();
        }
		return oRow;
	}

	AGJQW.clsRows.prototype.Clear = function() {
		this.mp_oControl.Tasks.Clear();
		this.mp_oCollection.m_Clear();
		this.mp_oControl.SelectedRowIndex = 0;
		this.mp_oControl.VerticalScrollBar.Reset();
	}

	AGJQW.clsRows.prototype.Remove = function(Index) {
		var sRIndex = "";
		var sRKey = "";
        var rRIndex = new AGJQW.ByRef(sRIndex);
        var rRKey = new AGJQW.ByRef(sRKey);
        mp_oCollection.m_GetKeyAndIndex(Index, rRKey, rRIndex);
        sRIndex = rRIndex.value;
        sRKey = rRKey.value;
		this.mp_oControl.Tasks.oCollection.m_CollectionRemoveWhere("RowKey", sRKey, sRIndex);
		this.mp_oCollection.m_Remove(Index, AGJQW.SYS_ERRORS.ROWS_REMOVE_1, AGJQW.SYS_ERRORS.ROWS_REMOVE_2, AGJQW.SYS_ERRORS.ROWS_REMOVE_3, AGJQW.SYS_ERRORS.ROWS_REMOVE_4);
		this.mp_oControl.SelectedRowIndex = 0;
        this.mp_oControl.SelectedTaskIndex = 0;
		this.mp_oControl.VerticalScrollBar.Update();
	}

	AGJQW.clsRows.prototype.MoveRow = function(OriginRowIndex, DestRowIndex) {
		if (OriginRowIndex < 1 || OriginRowIndex > this.Count) 
		{
			return;
		}
		if (DestRowIndex < 1 || DestRowIndex > this.Count) 
		{
			return;
		}
		if (DestRowIndex == OriginRowIndex) 
		{
			return;
		}
		this.mp_oCollection.m_lCopyAndMoveItems(OriginRowIndex, DestRowIndex);
	}

	AGJQW.clsRows.prototype.SortRows = function(PropertyName, Descending, SortType, StartIndex, EndIndex) {
        if (StartIndex == -1) 
		{
			StartIndex = 1;
		}
		if (EndIndex == -1) 
		{
			EndIndex = this.Count;
		}
		if (this.Count == 0) 
		{
			return;
		}
		if (StartIndex < 1 || StartIndex > this.Count) 
		{
			return;
		}
		if (EndIndex < 1 ||  EndIndex > this.Count) 
		{
			return;
		}
		if (EndIndex == StartIndex) 
		{
			return;
		}
		this.mp_oCollection.m_Sort(PropertyName, Descending, SortType, StartIndex, EndIndex);
	}

	AGJQW.clsRows.prototype.SortCells = function(CellIndex, PropertyName, Descending, SortType, StartIndex, EndIndex) {
		if (StartIndex == -1) 
		{
			StartIndex = 1;
		}
		if (EndIndex == -1) 
		{
			EndIndex = Count;
		}
		if (Count == 0) 
		{
			return;
		}
		if (StartIndex < 1 || StartIndex > this.Count) 
		{
			return;
		}
		if (EndIndex < 1 || EndIndex > this.Count) 
		{
			return;
		}
		if (EndIndex == StartIndex) 
		{
			return;
		}
		if (CellIndex < 1 || CellIndex > this.mp_oControl.Columns.Count) 
		{
			return;
		}
		this.mp_oCollection.m_SortCells(CellIndex, PropertyName, Descending, SortType, StartIndex, EndIndex);
	}

	AGJQW.clsRows.prototype.ClearCells = function() {
		var lIndex = 0;
		var oRow = null;
		for (lIndex = 1; lIndex <= this.mp_oCollection.m_lCount(); lIndex++) 
		{
			oRow = this.mp_oCollection.m_oReturnArrayElement(lIndex);
			oRow.Cells.Clear();
		}
	}

	AGJQW.clsRows.prototype.Height = function(lRow) {
        if (AGJQW.g_IsNV(lRow)) { lRow = this.Count;}
        var lBuffer = 0;
        var lIndex = 0;
        var oRow = null;
        if (this.Count == 0 || lRow == 0)
        {
            return 0;
        }
        var bChildrenHidden = false;
        var lCurrentDepth = 0;
        for (lIndex = 1; lIndex <= lRow; lIndex++)
        {
            var bHidden = false;
            oRow = this.mp_oCollection.m_oReturnArrayElement(lIndex);
            if (oRow.Node.Depth == 0)
            {
                bHidden = false;
            }
            if (bChildrenHidden == true)
            {
                bHidden = true;
            }
            if (oRow.Node.Depth < lCurrentDepth)
            {
                lCurrentDepth = oRow.Node.Depth;
                bHidden = false;
                bChildrenHidden = false;
            }
            if (bHidden == false)
            {
                lBuffer = lBuffer + oRow.Height + 1;
            }
            if (oRow.Node.Expanded == false && bChildrenHidden == false)
            {
                lCurrentDepth = oRow.Node.Depth + 1;
                bChildrenHidden = true;
            }
        }

        return lBuffer;
	}

	AGJQW.clsRows.prototype.CalculateHeight = function(StartIndex, EndIndex) {
		var lBuffer = 0;
		var lIndex = 0;
		var oRow = null;
		if (StartIndex == 0) 
		{
			return 0;
		}
		for (lIndex = StartIndex; lIndex <= EndIndex; lIndex++) 
		{
			oRow = this.mp_oCollection.m_oReturnArrayElement(lIndex);
			lBuffer = lBuffer + oRow.Height;
		}
		return lBuffer;
	}

	AGJQW.clsRows.prototype.CalculateRows = function(StartIndex, Height) {
		var lBuffer = 0;
		var lIndex = 0;
		var oRow = null;
		var lRows = 0;
		lRows = 1;
		if (StartIndex == 0) 
		{
			return lRows;
		}
		for (lIndex = StartIndex; lIndex <= Count; lIndex++) 
		{
			oRow = this.mp_oCollection.m_oReturnArrayElement(lIndex);
			lBuffer = lBuffer + oRow.Height;
			if (lBuffer > Height) 
			{
				break; 
			}
			lRows = lRows + 1;
		}
		return lRows;
	}

	AGJQW.clsRows.prototype.PositionRows = function() {
		var oRow = null;
		var lRowIndex = 0;
		var lBottomBuff = 0;
		var oClientArea = null;
		oClientArea = this.mp_oControl.CurrentViewObject.ClientArea;
		if (this.Count == 0) 
		{
			oClientArea.f_LastVisibleRow = 0;
			this.mp_lTopOffset = this.mp_oControl.CurrentViewObject.ClientArea.Top;
			return;
		}
		else 
		{
			this.mp_lTopOffset = 0;
		}
		for (lRowIndex = (this.mp_lRealFirstVisibleRow - 1); lRowIndex >= 1; lRowIndex += -1) 
		{
			oRow = this.mp_oCollection.m_oReturnArrayElement(lRowIndex);
			if (lRowIndex == (this.mp_lRealFirstVisibleRow - 1)) 
			{
				oRow.f_lBottom = this.mp_oControl.CurrentViewObject.ClientArea.Top - 1;
			}
			else 
			{
				oRow.f_lBottom = lBottomBuff - 1;
			}
			oRow.f_lTop = oRow.Bottom - oRow.Height;
			lBottomBuff = oRow.Top;
			oRow.ClientAreaVisibility = AGJQW.E_CLIENTAREAVISIBILITY.VS_ABOVEVISIBLEAREA;
		}
		for (lRowIndex = this.mp_lRealFirstVisibleRow; lRowIndex <= this.Count; lRowIndex++) 
		{
			oRow = this.mp_oCollection.m_oReturnArrayElement(lRowIndex);
            if (this.mp_lTopOffset < this.mp_oControl.mt_TableBottom) 
			{
				if (lRowIndex == this.mp_lRealFirstVisibleRow) 
				{
					oRow.f_lTop = this.mp_oControl.CurrentViewObject.ClientArea.Top;
				}
				else 
				{
					oRow.f_lTop = lBottomBuff + 1;
				}
				oRow.f_lBottom = oRow.Top + oRow.Height;
				lBottomBuff = oRow.Bottom;
				this.mp_lTopOffset = oRow.Bottom;
				oClientArea.f_LastVisibleRow = lRowIndex;
				oRow.ClientAreaVisibility = AGJQW.E_CLIENTAREAVISIBILITY.VS_INSIDEVISIBLEAREA;
			}
			else 
			{
				break; 
			}
		}
		for (lRowIndex = (oClientArea.LastVisibleRow + 1); lRowIndex <= this.Count; lRowIndex++) 
		{
			oRow = this.mp_oCollection.m_oReturnArrayElement(lRowIndex);
			oRow.f_lTop = lBottomBuff + 1;
			oRow.f_lBottom = oRow.Top + oRow.Height;
			lBottomBuff = oRow.Bottom;
			oRow.ClientAreaVisibility = AGJQW.E_CLIENTAREAVISIBILITY.VS_BELOWVISIBLEAREA;
		}
	}

	AGJQW.clsRows.prototype.InitializePosition = function() {
        this.mp_lRealFirstVisibleRow = this.RealFirstVisibleRow;
	}

	AGJQW.clsRows.prototype.NodesDrawBackground = function() {
        var lIndex = 0;
        var oNode = null;
        var oRow = null;
        var oCell = null;
        if (this.Count == 0)
        {
            return;
        }
        for (lIndex = this.mp_lRealFirstVisibleRow; lIndex <= this.Count; lIndex++)
        {
            oRow = this.mp_oCollection.m_oReturnArrayElement(lIndex);
            oCell = oRow.Cells.oCollection.m_oReturnArrayElement(this.mp_oControl.TreeviewColumnIndex);
            oNode = oRow.Node;
            if (this.mp_oControl.Treeview.FullColumnSelect == true)
            {
                this.mp_oControl.clsG.mp_DrawItemRow(oCell.Left, oCell.Top, oCell.Right - 1, oCell.Bottom, "", (oRow.Index == this.mp_oControl.SelectedRowIndex && mp_oControl.TreeviewColumnIndex == this.mp_oControl.SelectedCellIndex), oCell.Image, oCell.LeftTrim, oCell.RightTrim, oNode.Style, oRow);
            }
            else
            {
                this.mp_oControl.clsG.mp_DrawItemRow(oCell.Left, oCell.Top, oCell.Right - 1, oCell.Bottom, "", false, oCell.Image, oCell.LeftTrim, oCell.RightTrim, oNode.Style, oRow);
                if ((oRow.Index == this.mp_oControl.SelectedRowIndex && this.mp_oControl.TreeviewColumnIndex == this.mp_oControl.SelectedCellIndex && oNode.Style.SelectionRectangleStyle.Visible == true))
                {
                    this.mp_oControl.clsG.mp_DrawSelectionRectangle(oNode.mt_TextLeft, oNode.Top, this.mp_oControl.Splitter.Left, oNode.Bottom - 1, oNode.Style);
                }
            }
        }
	}

	AGJQW.clsRows.prototype.NodesDrawTreeLines = function() {
		var lIndex = 0;
		var oNode = null;
		var oRow = null;
		var oRelative = null;
		if (this.Count == 0 ||  this.mp_oControl.Treeview.TreeLines == false) 
		{
			return;
		}
		for (lIndex = this.mp_lRealFirstVisibleRow; lIndex <= this.Count; lIndex++) 
		{
			oRow = this.mp_oCollection.m_oReturnArrayElement(lIndex);
			oNode = oRow.Node;
            if ((oRow.ClientAreaVisibility == AGJQW.E_CLIENTAREAVISIBILITY.VS_INSIDEVISIBLEAREA || oRow.ClientAreaVisibility == AGJQW.E_CLIENTAREAVISIBILITY.VS_BELOWVISIBLEAREA) && oNode.Hidden == false) 
			{
                if (lIndex <= this.mp_oControl.CurrentViewObject.ClientArea.LastVisibleRow)
                {
                    if (oNode.CheckBoxVisible == true)
                    {
                        this.mp_oControl.clsG.mp_DrawLine(oNode.Left, oNode.YCenter, oNode.Left + 15, oNode.YCenter, AGJQW.GRE_LINETYPE.LT_NORMAL, this.mp_oControl.Treeview.TreeLineColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID);
                    }
                    else if (oNode.ImageVisible == true)
                    {
                        this.mp_oControl.clsG.mp_DrawLine(oNode.Left, oNode.YCenter, oNode.Left + 15, oNode.YCenter, AGJQW.GRE_LINETYPE.LT_NORMAL, this.mp_oControl.Treeview.TreeLineColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID);
                    }
                    else if (oNode.ImageVisible == false && oNode.CheckBoxVisible == false)
                    {
                        this.mp_oControl.clsG.mp_DrawLine(oNode.Left, oNode.YCenter, oNode.mt_TextLeft, oNode.YCenter, AGJQW.GRE_LINETYPE.LT_NORMAL, this.mp_oControl.Treeview.TreeLineColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID);
                    }
                }
				if (oNode.Index == 1) 
				{
                    //Dont Draw anything
				}
				else 
				{
                    oRelative = null;
					if (oNode.IsFirstSibling()) 
					{
						oRelative = oNode.Parent();
                        if (oRelative.Row.Index > this.mp_oControl.CurrentViewObject.ClientArea.LastVisibleRow)
                        {
                            oRelative = null;
                        }
                        else
                        {
                            this.mp_oControl.clsG.mp_DrawLine(oNode.Left, oNode.YCenter, oNode.Left, oRelative.mt_TextBottom, AGJQW.GRE_LINETYPE.LT_NORMAL, this.mp_oControl.Treeview.TreeLineColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID);
                        }
					}
                    else if (oNode.IsLastSibling()) 
					{
                        oRelative = oNode.FirstSibling();
                        if (oRelative.Row.Index > this.mp_oControl.CurrentViewObject.ClientArea.LastVisibleRow)
                        {
                            oRelative = null;
                        }
                        else
                        {
                            this.mp_oControl.clsG.mp_DrawLine(oNode.Left, oNode.YCenter, oNode.Left, oRelative.YCenter, AGJQW.GRE_LINETYPE.LT_NORMAL, this.mp_oControl.Treeview.TreeLineColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID);
                        }
					}
				}
			}
		}
	}

	AGJQW.clsRows.prototype.NodesDraw = function() {
		var lIndex = 0;
		var oNode = null;
		var oRow = null;
		if (this.Count == 0) 
		{
			return;
		}
		for (lIndex = this.mp_lRealFirstVisibleRow; lIndex <= this.Count; lIndex++) 
		{
			oRow = this.mp_oCollection.m_oReturnArrayElement(lIndex);
			oNode = oRow.Node;
            if (oRow.ClientAreaVisibility == AGJQW.E_CLIENTAREAVISIBILITY.VS_INSIDEVISIBLEAREA && oNode.Hidden == false) 
			{
                this.mp_oControl.clsG.mp_DrawAlignedText(oNode.mt_TextLeft, oNode.mt_TextTop, oNode.mt_TextRight, oNode.mt_TextBottom, oNode.Text, AGJQW.GRE_HORIZONTALALIGNMENT.HAL_LEFT, AGJQW.GRE_VERTICALALIGNMENT.VAL_CENTER, oNode.Style.ForeColor, oNode.Style.Font);
                if (oNode.Text.Length > 0)
                {
                    oNode.mp_lTextLeft = this.mp_oControl.clsG.mp_oTextFinalLayout.Left;
                    oNode.mp_lTextTop = this.mp_oControl.clsG.mp_oTextFinalLayout.Top;
                    oNode.mp_lTextRight = this.mp_oControl.clsG.mp_oTextFinalLayout.Left + this.mp_oControl.clsG.mp_oTextFinalLayout.Width - 1;
                    oNode.mp_lTextBottom = this.mp_oControl.clsG.mp_oTextFinalLayout.Top + this.mp_oControl.clsG.mp_oTextFinalLayout.Height - 1;
                }
                else
                {
                    oNode.mp_lTextLeft = oNode.mt_TextLeft;
                    oNode.mp_lTextTop = oNode.mt_TextTop;
                    oNode.mp_lTextRight = oNode.mt_TextRight;
                    oNode.mp_lTextBottom = oNode.mt_TextBottom;
                }
			}
		}
	}

	AGJQW.clsRows.prototype.mp_DrawSign = function(bExpanded, X, Y, oRow) {
        if (this.mp_oControl.Treeview.TreeviewMode == AGJQW.E_TREEVIEWMODE.TM_NONE)
        {
            return;
        }
        else if (this.mp_oControl.Treeview.TreeviewMode == AGJQW.E_TREEVIEWMODE.TM_PLUSMINUSSIGNS)
        {
            Y = Y - 1;
            if (this.mp_oControl.Treeview.PlusMinusBackgroundMode == AGJQW.GRE_BACKGROUNDMODE.FP_SOLID)
            {
                this.mp_oControl.clsG.mp_DrawLine(X - 4, Y - 3, X + 4, Y + 4, AGJQW.GRE_LINETYPE.LT_FILLED, this.mp_oControl.Treeview.PlusMinusBackColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID);
            }
            else
            {
                this.mp_oControl.clsG.mp_DrawLine(X - 4, Y - 3, X + 4, Y + 4, AGJQW.GRE_LINETYPE.LT_FILLED, oRow.f_RowBackColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID);
            }
            this.mp_oControl.clsG.mp_DrawLine(X - 4, Y - 3, X + 4, Y + 5, AGJQW.GRE_LINETYPE.LT_BORDER, this.mp_oControl.Treeview.PlusMinusBorderColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID);
            this.mp_oControl.clsG.mp_DrawLine(X - 2, Y + 1, X + 2, Y + 1, AGJQW.GRE_LINETYPE.LT_NORMAL, this.mp_oControl.Treeview.PlusMinusSignColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID);
            if (bExpanded == false)
            {
                this.mp_oControl.clsG.mp_DrawLine(X, Y - 1, X, Y + 3, AGJQW.GRE_LINETYPE.LT_NORMAL, this.mp_oControl.Treeview.PlusMinusSignColor, AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID);
            }
        }
        else if (this.mp_oControl.Treeview.TreeviewMode == AGJQW.E_TREEVIEWMODE.TM_EXPANDCOLLAPSEICONS)
        {
            if (bExpanded == false)
            {
                this.mp_oControl.clsG.mp_DrawExpandIcon(X - 3, Y - 4, this.mp_oControl.Treeview.ExpandIconForeColor, this.mp_oControl.Treeview.ExpandIconDropShadowColor, this.mp_oControl.Treeview.ExpandIconBackColor);
            }
            else
            {
                this.mp_oControl.clsG.mp_DrawCollapseIcon(X - 3, Y - 4, this.mp_oControl.Treeview.CollapseIconForeColor, this.mp_oControl.Treeview.CollapseIconDropShadowColor);
            }
        }
	}

	AGJQW.clsRows.prototype.HiddenRows = function() {
        var lIndex = 0;
        var oRow = null;
        var lReturn = 0;

        var bChildrenHidden = false;
        var lCurrentDepth = 0;
        for (lIndex = 1; lIndex <= this.Count; lIndex++)
        {
            var bHidden = false;
            oRow = this.mp_oCollection.m_oReturnArrayElement(lIndex);
            if (oRow.Node.Depth == 0)
            {
                bHidden = false;
            }
            if (bChildrenHidden == true)
            {
                bHidden = true;
            }
            if (oRow.Node.Depth < lCurrentDepth)
            {
                lCurrentDepth = oRow.Node.Depth;
                bHidden = false;
                bChildrenHidden = false;
            }
            if (bHidden == true)
            {
                lReturn = lReturn + 1;
            }
            if (oRow.Node.Expanded == false && bChildrenHidden == false)
            {
                lCurrentDepth = oRow.Node.Depth + 1;
                bChildrenHidden = true;
            }
        }

        return lReturn;
	}

	AGJQW.clsRows.prototype.RealIndex = function(Index) {
        var lIndex = 0;
        var oRow = null;
        var oNode = null;
        var lCount = 0;
        for (lIndex = 1; lIndex <= this.Count; lIndex++)
        {
            oRow = this.mp_oControl.Rows.oCollection.m_oReturnArrayElement(lIndex);
            oNode = oRow.Node;
            if (oNode.Hidden == false)
            {
                lCount = lCount + 1;
                if (lCount == Index)
                {
                    return lIndex;
                }
            }
        }
        return -1;
	}

