	AGJQW.clsRows.prototype.mp_DrawImage = function(oNode) {
		var oImage = null;
		var lImageWidth = 0;
		var lImageHeight = 0;
		if (this.mp_oControl.Treeview.Images == false) 
		{
			return;
		}
		if (oNode.ImageVisible == true) 
		{
			if (oNode.Expanded == true && oNode.Children() > 0 && (oNode.ExpandedImage != null)) 
			{
				oImage = oNode.ExpandedImage;
			}
			else if (oNode.Selected == true && (oNode.SelectedImage != null)) 
			{
				oImage = oNode.SelectedImage;
			}
			else if ((oNode.Image != null)) 
			{
				oImage = oNode.Image;
			}
			if ((oImage != null)) 
			{
				lImageWidth = oImage.width;
				lImageHeight = oImage.height;
                this.mp_oControl.clsG.mp_PaintImage(oImage, oNode.ImageLeft, oNode.ImageTop, oNode.ImageRight, oNode.ImageBottom, 0, 0, true);
			}
		}
	}
// Dibujar
	AGJQW.clsRows.prototype.Draw = function() {
		var lCellIndex = 0;
		var lRowIndex = 0;
		var oRow = null;
		var oColumn = null;
		var oCell = null;
        var lTableBottom = this.mp_oControl.mt_TableBottom;
        var lBottom;
        this.mp_oControl.clsG.mp_ClipRegion(this.mp_oControl.mt_LeftMargin, this.mp_oControl.CurrentViewObject.ClientArea.Top, this.mp_oControl.Splitter.Left, this.mp_oControl.mt_TableBottom, false);
        this.mp_oControl.DrawEventArgs.Clear();
        this.mp_oControl.DrawEventArgs.CustomDraw = false;
        this.mp_oControl.DrawEventArgs.EventTarget = AGJQW.E_EVENTTARGET.EVT_GRID;
        this.mp_oControl.DrawEventArgs.ObjectIndex = 0;
        this.mp_oControl.DrawEventArgs.ParentObjectIndex = 0;
        this.mp_oControl.DrawEventArgs.Graphics = this.mp_oControl.clsG.oGraphics;
        this.mp_oControl.FireDraw();
		if (this.mp_oControl.DrawEventArgs.CustomDraw == true) 
		{
			return;
		}
		if (this.Count == 0) 
		{
			return;
		}
        console.log("----------------------------------------------------------");
        console.log("mp_lRealFirstVisibleRow: " + this.mp_lRealFirstVisibleRow);
        console.log("LastVisibleRow: " + this.mp_oControl.CurrentViewObject.ClientArea.LastVisibleRow);
		for (lRowIndex = this.mp_lRealFirstVisibleRow; lRowIndex <= this.mp_oControl.CurrentViewObject.ClientArea.LastVisibleRow; lRowIndex++) 
		{
			oRow = this.mp_oCollection.m_oReturnArrayElement(lRowIndex);
			if (oRow.Visible == true && oRow.Height > -1) 
			{
				if (oRow.MergeCells == true) 
				{
                    if (oRow.Bottom > lTableBottom)
                    {
                        lBottom = lTableBottom;
                    }
                    else
                    {
                        lBottom = oRow.Bottom;
                    }
                    this.mp_oControl.clsG.mp_ClipRegion(oRow.Left, oRow.Top, oRow.Right, lBottom, true);
                    this.mp_oControl.DrawEventArgs.Clear();
                    this.mp_oControl.DrawEventArgs.CustomDraw = false;
                    this.mp_oControl.DrawEventArgs.EventTarget = AGJQW.E_EVENTTARGET.EVT_ROW;
                    this.mp_oControl.DrawEventArgs.ObjectIndex = lRowIndex;
                    this.mp_oControl.DrawEventArgs.ParentObjectIndex = 0;
                    this.mp_oControl.DrawEventArgs.Graphics = this.mp_oControl.clsG.oGraphics;
                    this.mp_oControl.FireDraw();
					if (this.mp_oControl.DrawEventArgs.CustomDraw == false) 
					{
                        this.mp_oControl.clsG.mp_DrawItemRow(oRow.Left, oRow.Top, oRow.Right, oRow.Bottom, oRow.Text, (lRowIndex == this.mp_oControl.SelectedRowIndex), oRow.Image, 0, 0, oRow.Style, oRow);
                        if (oRow.Text.Length > 0)
                        {
                            oRow.mp_lTextLeft = this.mp_oControl.clsG.mp_oTextFinalLayout.Left;
                            oRow.mp_lTextTop = this.mp_oControl.clsG.mp_oTextFinalLayout.Top;
                            oRow.mp_lTextRight = this.mp_oControl.clsG.mp_oTextFinalLayout.Left + this.mp_oControl.clsG.mp_oTextFinalLayout.Width - 1;
                            oRow.mp_lTextBottom = this.mp_oControl.clsG.mp_oTextFinalLayout.Top + this.mp_oControl.clsG.mp_oTextFinalLayout.Height - 1;
                        }
                        else
                        {
                            oRow.mp_lTextLeft = oRow.Left;
                            oRow.mp_lTextTop = oRow.Top;
                            oRow.mp_lTextRight = oRow.Right;
                            oRow.mp_lTextBottom = oRow.Bottom;
                        }
					}
				}
				else 
				{
					for (lCellIndex = 1; lCellIndex <= this.mp_oControl.Columns.Count; lCellIndex++) 
					{
                        if (lCellIndex != this.mp_oControl.TreeviewColumnIndex)
                        {
                            oCell = oRow.Cells.oCollection.m_oReturnArrayElement(lCellIndex);
                            oColumn = this.mp_oControl.Columns.oCollection.m_oReturnArrayElement(lCellIndex);
                            if (oColumn.Visible == true)
                            {
                                if (oCell.Bottom > lTableBottom)
                                {
                                    lBottom = lTableBottom;
                                }
                                else
                                {
                                    lBottom = oCell.Bottom;
                                }
                                this.mp_oControl.clsG.mp_ClipRegion(oCell.LeftTrim, oCell.Top, oCell.RightTrim, lBottom, true);
                                this.mp_oControl.DrawEventArgs.Clear();
                                this.mp_oControl.DrawEventArgs.CustomDraw = false;
                                this.mp_oControl.DrawEventArgs.EventTarget = AGJQW.E_EVENTTARGET.EVT_CELL;
                                this.mp_oControl.DrawEventArgs.ObjectIndex = lCellIndex;
                                this.mp_oControl.DrawEventArgs.ParentObjectIndex = lRowIndex;
                                this.mp_oControl.DrawEventArgs.Graphics = this.mp_oControl.clsG.oGraphics;
                                this.mp_oControl.FireDraw();
                                if (this.mp_oControl.DrawEventArgs.CustomDraw == false)
                                {
                                    this.mp_oControl.clsG.mp_DrawItemRow(oCell.Left, oCell.Top, oCell.Right - 1, oCell.Bottom, oCell.Text, (lRowIndex == this.mp_oControl.SelectedRowIndex && lCellIndex == this.mp_oControl.SelectedCellIndex), oCell.Image, oCell.LeftTrim, oCell.RightTrim, oCell.Style, oRow);
                                    if (oCell.Text.Length > 0)
                                    {
                                        oCell.mp_lTextLeft = this.mp_oControl.clsG.mp_oTextFinalLayout.Left;
                                        oCell.mp_lTextTop = this.mp_oControl.clsG.mp_oTextFinalLayout.Top;
                                        oCell.mp_lTextRight = this.mp_oControl.clsG.mp_oTextFinalLayout.Left + this.mp_oControl.clsG.mp_oTextFinalLayout.Width - 1;
                                        oCell.mp_lTextBottom = this.mp_oControl.clsG.mp_oTextFinalLayout.Top + this.mp_oControl.clsG.mp_oTextFinalLayout.Height - 1;
                                    }
                                    else
                                    {
                                        oCell.mp_lTextLeft = oCell.Left;
                                        oCell.mp_lTextTop = oCell.Top;
                                        oCell.mp_lTextRight = oCell.Right;
                                        oCell.mp_lTextBottom = oCell.Bottom;
                                    }
                                }
                            }
                        }
					}
				}
			}
		}
	}

	AGJQW.clsRows.prototype.GetXML = function() {
		var lIndex = 0;
		var oRow = null;
		var oXML = new AGJQW.clsXML(this.mp_oControl,"Rows");
		oXML.InitializeWriter();
		for (lIndex = 1; lIndex <= this.Count; lIndex++) 
		{
			oRow = this.mp_oCollection.m_oReturnArrayElement(lIndex);
			oXML.WriteObject(oRow.GetXML());
		}
		return oXML.GetXML();
	}

	AGJQW.clsRows.prototype.SetXML = function(sXML) {
		var lIndex = 0;
		var oXML = new AGJQW.clsXML(this.mp_oControl,"Rows");
		oXML.SetXML(sXML);
		oXML.InitializeReader();
		this.mp_oCollection.m_Clear();
		for (lIndex = 1; lIndex <= oXML.ReadCollectionCount(); lIndex++) 
		{
            var oRow = new AGJQW.clsRow(this.mp_oControl);
			oRow.SetXML(oXML.ReadCollectionObject(lIndex));
			this.mp_oCollection.AddMode = true;
			this.mp_oCollection.m_Add(oRow, oRow.Key, AGJQW.SYS_ERRORS.ROWS_ADD_1, AGJQW.SYS_ERRORS.ROWS_ADD_2, true, AGJQW.SYS_ERRORS.ROWS_ADD_3);
			oRow = null;
		}
        this.mp_oControl.VerticalScrollBar.Update();
        this.mp_oControl.VerticalScrollBar.Value = 1;
	}

	AGJQW.clsRows.prototype.UpdateScrollBar = function() {
        this.mp_oControl.VerticalScrollBar.Update();
	}

	AGJQW.clsRows.prototype.UpdateTree = function() {
        if (this.VerifyTree() == false)
        {
            this.mp_oControl.mp_ErrorReport(AGJQW.SYS_ERRORS.ROWS_INVALID_TREE_STRUCTURE, "Invalid treeview structure", "clsRow.UpdateTree");
            return;
        }
        var lIndex = 0;
        var oRow;
        this.mp_oTempNodeList = new AGJQW.ArrayList();
        for (lIndex = 1; lIndex <= this.Count; lIndex++)
        {
            oRow = this.mp_oCollection.m_oReturnArrayElement(lIndex);
            if (oRow.Node.Depth == 0)
            {
                oRow.Node.mp_oParent = null;
            }
            else
            {
                oRow.Node.mp_oParent = this.mp_oTempNodeList.tb[oRow.Node.Depth - 1];
            }
            if (oRow.Node.Depth > (this.mp_oTempNodeList.Count - 1))
            {
                this.mp_oTempNodeList.Add(oRow.Node);
            }
            else
            {
                this.mp_oTempNodeList.tb[oRow.Node.Depth] = oRow.Node;
            }
        }
	}

	AGJQW.clsRows.prototype.VerifyTree = function() {
        var lPreviousDepth = 0;
        var lIndex = 0;
        var oRow = null;
        for (lIndex = 1; lIndex <= this.Count; lIndex++)
        {
            oRow = this.mp_oCollection.m_oReturnArrayElement(lIndex);
            var lDepth = oRow.Node.Depth;
            if (lIndex == 1 && lDepth != 0)
            {
                return false;
            }
            if ((lDepth - lPreviousDepth) > 1)
            {
                return false;
            }
            lPreviousDepth = lDepth;
        }
        return true;
	}

	AGJQW.clsRows.prototype.NodesDrawElements = function() {
        var lIndex = 0;
        var oNode = null;
        var oRow = null;
        if (this.Count == 0)
        {
            return;
        }
        for (lIndex = this.mp_lRealFirstVisibleRow; lIndex <= this.Count; lIndex++)
        {
            oRow = this.mp_oCollection.m_oReturnArrayElement(lIndex);
            oNode = oRow.Node;
            if (oRow.ClientAreaVisibility == AGJQW.E_CLIENTAREAVISIBILITY.VS_INSIDEVISIBLEAREA && oNode.Hidden == false)
            {
                if (oNode.Children() > 0)
                {
                    this.mp_DrawSign(oNode.Expanded, oNode.Left, oNode.YCenter, oRow);
                }
                this.mp_DrawCheckBox(oNode);
                this.mp_DrawImage(oNode);
            }
        }
	}

