    AGJQW.clsTask.prototype = {
        get Index(){
            return this.mp_lIndex;
        },
        set Index(value){
            this.mp_lIndex = value;
        },
        get Key(){
            return this.mp_sKey;
        },
        set Key(value){
            this.mp_sKey = value;
        },
        get AllowTextEdit(){
            return this.mp_bAllowTextEdit;
        },
        set AllowTextEdit(value){
            this.mp_bAllowTextEdit = value;
        },
        get EndDate(){
            return this.mp_dtEndDate;
        },
        set EndDate(value){
            if (this.mp_yTaskType == AGJQW.E_TASKTYPE.TT_START_END)
            {
                this.mp_dtEndDate = value;
            }
        },
        get StartDate(){
            return this.mp_dtStartDate;
        },
        set StartDate(value){
            this.mp_dtStartDate = value;
            if (this.mp_yTaskType == AGJQW.E_TASKTYPE.TT_DURATION && this.mp_lDurationFactor != 0)
            {
                this.mp_GetDuration();
            }
        },
        get Text(){
            return this.mp_sText;
        },
        set Text(value){
            this.mp_sText = value;
        },
        get RowKey(){
            return this.mp_sRowKey;
        },
        set RowKey(value){
			if (this.mp_oControl.Rows.oCollection.m_bDoesKeyExist(value) == false) 
			{
                this.mp_oControl.mp_ErrorReport(AGJQW.SYS_ERRORS.INVALID_ROW_KEY, "Invalid Row Key (\"" + value + "\")", "ActiveGanttJQWCtl.clsTask.Let RowKey");
				return;
			}
			this.mp_sRowKey = value;
			this.mp_oRow = this.mp_oControl.Rows.Item(this.mp_sRowKey);
        },
        get Row(){
            return this.mp_oRow;
        },
        get LayerIndex(){
            return this.mp_sLayerIndex;
        },
        set LayerIndex(value){
			if (value.trim() == "") 
			{
				value = "0";
			}
			this.mp_sLayerIndex = value;
			this.mp_oLayer = this.mp_oControl.Layers.FItem(value);
        },
        get StyleIndex(){
			if (this.mp_sStyleIndex == "DS_TASK") 
			{
				return "";
			}
			else 
			{
				return this.mp_sStyleIndex;
			}
        },
        set StyleIndex(value){
			value = value.trim();
            if (value.length == 0) { value = "DS_TASK"; }
			this.mp_sStyleIndex = value;
			this.mp_oStyle = this.mp_oControl.Styles.FItem(value);
        },
        get Style(){
            return this.mp_oStyle;
        },
        get LeftTrim(){
			if (this.Left < this.mp_oControl.Splitter.Right) 
			{
				return this.mp_oControl.Splitter.Right;
			}
			else 
			{
				return this.Left;
			}
        },
        get RightTrim(){
			if (this.Right > this.mp_oControl.mt_RightMargin) 
			{
				return this.mp_oControl.mt_RightMargin;
			}
			else 
			{
				return this.Right;
			}
        },
        get f_bLeftVisible(){
			if (this.LeftTrim == this.Left) 
			{
				return true;
			}
			else 
			{
				return false;
			}
        },
        get f_bRightVisible(){
			if (this.RightTrim == this.Right) 
			{
				return true;
			}
			else 
			{
				return false;
			}
        },
        get Left(){
            if (this.mp_dtStartDate.valueOf() == this.mp_dtEndDate.valueOf())
            {
                return this.mp_oControl.MathLib.GetXCoordinateFromDate(this.StartDate) - this.mp_oControl.CurrentViewObject.ClientArea.MilestoneSelectionOffset;
            }
            else
            {
                return this.mp_oControl.MathLib.GetXCoordinateFromDate(this.StartDate);
            }
        },
        get Right(){
            if (this.mp_dtStartDate.valueOf() == this.mp_dtEndDate.valueOf())
            {
                return this.mp_oControl.MathLib.GetXCoordinateFromDate(this.EndDate) + this.mp_oControl.CurrentViewObject.ClientArea.MilestoneSelectionOffset;
            }
            else
            {
                return this.mp_oControl.MathLib.GetXCoordinateFromDate(this.EndDate);
            }
        },
        get Top(){
			if ((this.mp_oRow.Height <= -1)) 
			{
				return this.mp_oRow.Top;
			}
			if (this.mp_oStyle.Placement == AGJQW.E_PLACEMENT.PLC_ROWEXTENTSPLACEMENT) 
			{
				return this.mp_oRow.Top;
			}
			if (this.mp_oStyle.Placement == AGJQW.E_PLACEMENT.PLC_OFFSETPLACEMENT) 
			{
				return this.mp_oRow.Top + this.mp_oStyle.OffsetTop;
			}
			return 0;
        },
        get Bottom(){
			if ((this.mp_oRow.Height <= -1)) 
			{
				return this.mp_oRow.Top;
			}
			if (this.mp_oStyle.Placement == AGJQW.E_PLACEMENT.PLC_ROWEXTENTSPLACEMENT) 
			{
				return this.mp_oRow.Bottom - 1;
			}
			if (this.mp_oStyle.Placement == AGJQW.E_PLACEMENT.PLC_OFFSETPLACEMENT) 
			{
				return this.mp_oRow.Top + this.mp_oStyle.OffsetTop + this.mp_oStyle.OffsetBottom;
			}
			return 0;
        },
        get Visible(){
			if (this.mp_oLayer.Visible == false) 
			{
				return false;
			}
			if ((this.mp_oRow.Height <= -1)) 
			{
				return false;
			}
			if (this.mp_oRow.Visible == false) 
			{
				return false;
			}
			return this.mp_bVisible;
        },
        set Visible(value){
            this.mp_bVisible = value;
        },
        get InsideVisibleTimeLineArea(){
            if (this.StartDate > this.mp_oControl.CurrentViewObject.TimeLine.EndDate)
            {
                return false;
            }
            if (this.EndDate < this.mp_oControl.CurrentViewObject.TimeLine.StartDate)
            {
                return false;
            }
            return true;
        },
        get ClientAreaVisiblity(){
            if (this.StartDate > this.mp_oControl.CurrentViewObject.TimeLine.EndDate)
            {
                return AGJQW.E_CLIENTAREAVISIBILITY.VS_RIGHTOFVISIBLEAREA;
            }
            if (this.EndDate < this.mp_oControl.CurrentViewObject.TimeLine.StartDate)
            {
                return AGJQW.E_CLIENTAREAVISIBILITY.VS_LEFTOFVISIBLEAREA;
            }
            return AGJQW.E_CLIENTAREAVISIBILITY.VS_INSIDEVISIBLEAREA;
        },
        get Type(){
            if (this.mp_yTaskType == AGJQW.E_TASKTYPE.TT_DURATION && this.mp_lDurationFactor == 0)
            {
                return AGJQW.E_OBJECTTYPE.OT_MILESTONE;
            }
			if (this.StartDate.valueOf() == this.EndDate.valueOf()) 
			{
				return AGJQW.E_OBJECTTYPE.OT_MILESTONE;
			}
			else 
			{
				return AGJQW.E_OBJECTTYPE.OT_TASK;
			}
        },
        get ImageTag(){
            return this.mp_sImageTag;
        },
        set ImageTag(value){
            this.mp_sImageTag = value;
        },
        get Warning(){
            if (this.mp_oControl.Predecessors.Count == 0)
            {
                return false;
            }
            else
            {
                return this.mp_bWarning;
            }
        },
        get WarningStyleIndex(){
            return this.mp_sWarningStyleIndex;
        },
        set WarningStyleIndex(value){
            value = value.trim();
            this.mp_sWarningStyleIndex = value;
            if (value.length > 0)
            {
                this.mp_oWarningStyle = this.mp_oControl.Styles.FItem(value);
            }
            else
            {
                this.mp_oWarningStyle = null;
            }
        },
        get WarningStyle(){
            if (this.mp_sWarningStyleIndex.Length == 0)
            {
                return this.mp_oStyle;
            }
            else
            {
                return this.mp_oWarningStyle;
            }
        },
        get TaskType(){
            return this.mp_yTaskType;
        },
        set TaskType(value){
            this.mp_yTaskType = value;
            if (this.mp_yTaskType == AGJQW.E_TASKTYPE.TT_DURATION)
            {
                this.mp_GetDuration();
            }
        },
        get DurationInterval(){
            return this.mp_yDurationInterval;
        },
        set DurationInterval(value){
            if (!(value == AGJQW.E_INTERVAL.IL_SECOND ||  value == AGJQW.E_INTERVAL.IL_MINUTE ||  value == AGJQW.E_INTERVAL.IL_HOUR ||  value == AGJQW.E_INTERVAL.IL_DAY))
            {
                this.mp_oControl.mp_ErrorReport(AGJQW.SYS_ERRORS.INVALID_DURATION_INTERVAL, "Interval is invalid for a duration", "clsTask.Set_DurationInterval");
                return;
            }
            this.mp_yDurationInterval = value;
            if (this.mp_yTaskType == AGJQW.E_TASKTYPE.TT_DURATION)
            {
                this.mp_GetDuration();
            }
        },
        get DurationFactor(){
            return this.mp_lDurationFactor;
        },
        set DurationFactor(value){
            if (value < 0)
            {
                value = value * -1;
            }
            this.mp_lDurationFactor = value;
            if (this.mp_yTaskType == AGJQW.E_TASKTYPE.TT_DURATION)
            {
                this.mp_GetDuration();
            }
        }
    };

