	AGJQW.clsTasks.prototype.Remove = function(Index) {
		var lIndex = 0;
		var sRIndex = "";
		var sRKey = "";
		var oPredecessor = null;
        var rRIndex = new AGJQW.ByRef(sRIndex);
        var rRKey = new AGJQW.ByRef(sRKey);
        this.mp_oCollection.m_GetKeyAndIndex(Index, rRKey, rRIndex);
        sRIndex = rRIndex.value;
        sRKey = rRKey.value;
		this.mp_oControl.Percentages.oCollection.m_CollectionRemoveWhere("TaskKey", sRKey, sRIndex);
        if (sRKey.Length > 0)
        {
            for (lIndex = this.mp_oControl.Predecessors.Count; lIndex >= 1; lIndex--)
            {
                oPredecessor = this.mp_oControl.Predecessors.oCollection.m_oReturnArrayElement(lIndex);
                if (oPredecessor.SuccessorKey == sRKey || oPredecessor.PredecessorKey == sRKey)
                {
                    this.mp_oControl.Predecessors.Remove(lIndex);
                }
            }
        }
		this.mp_oCollection.m_Remove(Index, AGJQW.SYS_ERRORS.TASKS_REMOVE_1, AGJQW.SYS_ERRORS.TASKS_REMOVE_2, AGJQW.SYS_ERRORS.TASKS_REMOVE_3, AGJQW.SYS_ERRORS.TASKS_REMOVE_4);
        this.mp_oControl.SelectedTaskIndex = 0;
	}

	AGJQW.clsTasks.prototype.Sort = function(PropertyName, Descending, SortType, StartIndex, EndIndex) {
			if (StartIndex == -1) 
			{
				StartIndex = 1;
			}
			if (EndIndex == -1) 
			{
				EndIndex = Count;
			}
			if (this.Count == 0) return; 
			if (StartIndex < 1 || StartIndex > this.Count) 
			{
				return;
			}
			if (EndIndex < 1 || EndIndex > this.Count) 
			{
				return;
			}
			if (EndIndex == StartIndex) 
			{
				return;
			}
			this.mp_oCollection.m_Sort(PropertyName, Descending, SortType, StartIndex, EndIndex);
	}

	AGJQW.clsTasks.prototype.Draw = function() {
		var lIndex = 0;
		var oTask = null;
		if (this.Count == 0) 
		{
			return;
		}
		for (lIndex = 1; lIndex <= this.Count; lIndex++) 
		{
			oTask = this.mp_oCollection.m_oReturnArrayElement(lIndex);
            if (oTask.Visible == true && oTask.InsideVisibleTimeLineArea == true) 
			{
                this.mp_oControl.DrawEventArgs.Clear();
                this.mp_oControl.DrawEventArgs.CustomDraw = false;
                this.mp_oControl.DrawEventArgs.EventTarget = AGJQW.E_EVENTTARGET.EVT_TASK;
                this.mp_oControl.DrawEventArgs.ObjectIndex = lIndex;
                this.mp_oControl.DrawEventArgs.ParentObjectIndex = 0;
                this.mp_oControl.DrawEventArgs.Graphics = this.mp_oControl.clsG.oGraphics;
                this.mp_oControl.FireDraw();
				if (this.mp_oControl.DrawEventArgs.CustomDraw == false) 
				{
					if (oTask.Type == AGJQW.E_OBJECTTYPE.OT_MILESTONE) 
					{
                        this.mp_oControl.clsG.mp_DrawItemM(oTask, "", lIndex == this.mp_oControl.SelectedTaskIndex, this.mp_GetTaskStyle(oTask));
					}
					else 
					{
                        this.mp_oControl.clsG.mp_DrawItem(oTask.Left, oTask.Top, oTask.Right, oTask.Bottom, "", oTask.Text, (lIndex == this.mp_oControl.SelectedTaskIndex), oTask.Image, oTask.LeftTrim, oTask.RightTrim, this.mp_GetTaskStyle(oTask));
					}
                    if (oTask.Text.Length > 0)
                    {
                        oTask.mp_lTextLeft = this.mp_oControl.clsG.mp_oTextFinalLayout.Left;
                        oTask.mp_lTextTop = this.mp_oControl.clsG.mp_oTextFinalLayout.Top;
                        oTask.mp_lTextRight = this.mp_oControl.clsG.mp_oTextFinalLayout.Left + this.mp_oControl.clsG.mp_oTextFinalLayout.Width - 1;
                        oTask.mp_lTextBottom = this.mp_oControl.clsG.mp_oTextFinalLayout.Top + this.mp_oControl.clsG.mp_oTextFinalLayout.Height - 1;
                    }
                    else
                    {
                        if (oTask.Style.TextPlacement == AGJQW.E_TEXTPLACEMENT.SCP_EXTERIORPLACEMENT)
                        {
                            if (oTask.Style.TextAlignmentHorizontal == AGJQW.GRE_HORIZONTALALIGNMENT.HAL_LEFT)
                            {
                                oTask.mp_lTextLeft = oTask.Left - this.mp_oControl.clsG.mp_lStrWidth("WWWWW", oTask.Style.Font) - oTask.Style.TextXMargin;
                                oTask.mp_lTextRight = oTask.Left - oTask.Style.TextXMargin + 1;
                            }
                            if (oTask.Style.TextAlignmentHorizontal == AGJQW.GRE_HORIZONTALALIGNMENT.HAL_RIGHT)
                            {
                                oTask.mp_lTextLeft = oTask.Right + oTask.Style.TextXMargin;
                                oTask.mp_lTextRight = oTask.Right + this.mp_oControl.clsG.mp_lStrWidth("WWWWW", oTask.Style.Font) + oTask.Style.TextXMargin + 1;
                            }
                            if (oTask.Style.TextAlignmentHorizontal == AGJQW.GRE_HORIZONTALALIGNMENT.HAL_CENTER)
                            {
                                oTask.mp_lTextLeft = oTask.Left;
                                oTask.mp_lTextRight = oTask.Right + 1;
                            }
                            if (oTask.Style.TextAlignmentVertical == AGJQW.GRE_VERTICALALIGNMENT.VAL_TOP)
                            {
                                oTask.mp_lTextTop = oTask.Top - this.mp_oControl.clsG.mp_lStrHeight("WWWWW", oTask.Style.Font) - oTask.Style.TextYMargin;
                                oTask.mp_lTextBottom = oTask.Top - oTask.Style.TextYMargin + 3;
                            }
                            if (oTask.Style.TextAlignmentVertical == AGJQW.GRE_VERTICALALIGNMENT.VAL_BOTTOM)
                            {
                                oTask.mp_lTextTop = oTask.Bottom + oTask.Style.TextYMargin;
                                oTask.mp_lTextBottom = oTask.Bottom + this.mp_oControl.clsG.mp_lStrHeight("WWWWW", oTask.Style.Font) + oTask.Style.TextYMargin + 3;
                            }
                            if (oTask.Style.TextAlignmentVertical == AGJQW.GRE_VERTICALALIGNMENT.VAL_CENTER)
                            {
                                oTask.mp_lTextTop = oTask.Top;
                                oTask.mp_lTextBottom = oTask.Bottom + 3;
                            }
                        }
                        else
                        {
                            oTask.mp_lTextLeft = oTask.Left;
                            oTask.mp_lTextTop = oTask.Top;
                            oTask.mp_lTextRight = oTask.Right;
                            oTask.mp_lTextBottom = oTask.Bottom;
                        }

                    }
				}
			}
		}
	}

