	AGJQW.clsPredecessors.prototype.Draw = function() {
        var lIndex = 0;
        var oPredecessor;
        for (lIndex = 1; lIndex <= this.Count; lIndex++)
        {
            oPredecessor = this.mp_oCollection.m_oReturnArrayElement(lIndex);
            oPredecessor.ClearRectangles();
            if (oPredecessor.SuccessorTask.Row.Height > -1 && oPredecessor.PredecessorTask.Row.Height > -1 && oPredecessor.Visible == true)
            {
                switch (oPredecessor.PredecessorType)
                {
                    case AGJQW.E_CONSTRAINTTYPE.PCT_END_TO_END:
                        this.mp_DrawEndToEnd(oPredecessor);
                        break;
                    case AGJQW.E_CONSTRAINTTYPE.PCT_START_TO_START:
                        this.mp_DrawStartToStart(oPredecessor);
                        break;
                    case AGJQW.E_CONSTRAINTTYPE.PCT_START_TO_END:
                        this.mp_DrawStartToEnd(oPredecessor);
                        break;
                    case AGJQW.E_CONSTRAINTTYPE.PCT_END_TO_START:
                        this.mp_DrawEndToStart(oPredecessor);
                        break;
                }
            }
        }
	}

	AGJQW.clsPredecessors.prototype.mp_DrawEndToEnd = function(oPredecessor) {
        var oPredecessorTask;
        var oSuccessorTask;
        var lPredecessorCtr = 0;
        var lSuccessorCtr = 0;
        var lXOffset = 0;
        var lYOffset = 0;
        var oStyle;
        var oPoints = [];
        oStyle = this.mp_GetPredecessorStyle(oPredecessor);
        lXOffset = oStyle.XOffset;
        lYOffset = oStyle.YOffset;
        oPredecessorTask = oPredecessor.PredecessorTask;
        oSuccessorTask = oPredecessor.SuccessorTask;
        if (this.mp_DrawPredecessor(oPredecessorTask, oSuccessorTask) == false)
        {
            return;
        }
        lPredecessorCtr = oPredecessorTask.Top + ((oPredecessorTask.Bottom - oPredecessorTask.Top) / 2);
        lSuccessorCtr = oSuccessorTask.Top + ((oSuccessorTask.Bottom - oSuccessorTask.Top) / 2);
        if (oPredecessorTask.Right >= oSuccessorTask.Right)
        {
            oPoints.push(new AGJQW.Point(oPredecessorTask.Right,lPredecessorCtr));
            oPoints.push(new AGJQW.Point(oPredecessorTask.Right + lXOffset,lPredecessorCtr));
            oPoints.push(new AGJQW.Point(oPredecessorTask.Right + lXOffset,lSuccessorCtr));
            oPoints.push(new AGJQW.Point(oSuccessorTask.Right,lSuccessorCtr));
            this.mp_DrawPredecessorLines(oPoints, oPredecessor);
            this.mp_oControl.clsG.mp_DrawArrow(oPoints[3].x + 1, oPoints[3].y, AGJQW.GRE_ARROWDIRECTION.AWD_LEFT, oStyle.ArrowSize, oStyle.LineColor);
        }
        else
        {
            oPoints.push(new AGJQW.Point(oSuccessorTask.Right,lSuccessorCtr));
            oPoints.push(new AGJQW.Point(oSuccessorTask.Right + lXOffset,lSuccessorCtr));
            oPoints.push(new AGJQW.Point(oSuccessorTask.Right + lXOffset,lPredecessorCtr));
            oPoints.push(new AGJQW.Point(oPredecessorTask.Right,lPredecessorCtr));
            this.mp_DrawPredecessorLines(oPoints, oPredecessor);
            this.mp_oControl.clsG.mp_DrawArrow(oPoints[0].x + 1, oPoints[0].y, AGJQW.GRE_ARROWDIRECTION.AWD_LEFT, oStyle.ArrowSize, oStyle.LineColor);
        }
	}

