	AGJQW.clsTimeBlocks.prototype.CreateTemporaryTimeBlocks = function() {
        var lIndex = 0;
        this.mp_oControl.TempTimeBlocks().Clear();

        for (lIndex = 1; lIndex <= this.Count; lIndex++)
        {
            var oTimeBlock = null;
            var oTempTimeBlock = null;
            var dtTimeLineStart = new AGJQW.DateTime();
            var dtTimeLineEnd = new AGJQW.DateTime();
            var dtCurrent = new AGJQW.DateTime();
            var dtStartBuff = new AGJQW.DateTime();
            var dtEndBuff = new AGJQW.DateTime();
            var dtBase;
            var dtStartDate = new AGJQW.DateTime();
            var dtEndDate = new AGJQW.DateTime();
            oTimeBlock = this.mp_oCollection.m_oReturnArrayElement(lIndex);
            if (oTimeBlock.TimeBlockType == AGJQW.E_TIMEBLOCKTYPE.TBT_RECURRING)
            {
                dtTimeLineStart = this.mp_oControl.CurrentViewObject.TimeLine.StartDate;
                dtTimeLineEnd = this.mp_oControl.CurrentViewObject.TimeLine.EndDate;
                switch (oTimeBlock.RecurringType)
                {
                    case AGJQW.E_RECURRINGTYPE.RCT_DAY:
                        dtTimeLineStart = this.mp_oControl.MathLib.DateTimeAdd(AGJQW.E_INTERVAL.IL_DAY, -1, dtTimeLineStart);
                        dtCurrent = new AGJQW.DateTime(dtTimeLineStart.Year(), dtTimeLineStart.Month(), dtTimeLineStart.Day(), 0, 0, 0);
                        while (dtCurrent < dtTimeLineEnd)
                        {
                            dtBase = new AGJQW.DateTime(dtCurrent.Year(), dtCurrent.Month(), dtCurrent.Day(), oTimeBlock.BaseDate.Hour(), oTimeBlock.BaseDate.Minute(), oTimeBlock.BaseDate.Second());
                            dtCurrent = this.mp_oControl.MathLib.DateTimeAdd(AGJQW.E_INTERVAL.IL_DAY, 1, dtCurrent);
                            if (this.mp_oControl.MathLib.mp_DateBlockVisible(dtTimeLineStart, dtTimeLineEnd, dtBase, oTimeBlock.DurationInterval, oTimeBlock.DurationFactor))
                            {
                                oTempTimeBlock = this.mp_oControl.TempTimeBlocks().Add("");
                                oTempTimeBlock.BaseDate = dtBase;
                                oTempTimeBlock.DurationInterval = oTimeBlock.DurationInterval;
                                oTempTimeBlock.DurationFactor = oTimeBlock.DurationFactor;
                                this.CopyTimeBlock(oTempTimeBlock, oTimeBlock);
                            }
                        }
                        break;
                    case AGJQW.E_RECURRINGTYPE.RCT_WEEK:
                        dtTimeLineStart = this.mp_oControl.MathLib.DateTimeAdd(AGJQW.E_INTERVAL.IL_DAY, -7, dtTimeLineStart);
                        dtCurrent = new AGJQW.DateTime(dtTimeLineStart.Year(), dtTimeLineStart.Month(), dtTimeLineStart.Day(), 0, 0, 0);
                        while (dtCurrent < dtTimeLineEnd)
                        {
                            dtBase = new AGJQW.DateTime(dtCurrent.Year(), dtCurrent.Month(), dtCurrent.Day(), oTimeBlock.BaseDate.Hour(), oTimeBlock.BaseDate.Minute(), oTimeBlock.BaseDate.Second());
                            dtCurrent = this.mp_oControl.MathLib.DateTimeAdd(AGJQW.E_INTERVAL.IL_DAY, 1, dtCurrent);
                            if (oTimeBlock.BaseWeekDay == dtBase.DayOfWeek())
                            {
                                if (this.mp_oControl.MathLib.mp_DateBlockVisible(dtTimeLineStart, dtTimeLineEnd, dtBase, oTimeBlock.DurationInterval, oTimeBlock.DurationFactor))
                                {
                                    oTempTimeBlock = this.mp_oControl.TempTimeBlocks().Add("");
                                    oTempTimeBlock.BaseDate = dtBase;
                                    oTempTimeBlock.DurationInterval = oTimeBlock.DurationInterval;
                                    oTempTimeBlock.DurationFactor = oTimeBlock.DurationFactor;
                                    this.CopyTimeBlock(oTempTimeBlock, oTimeBlock);
                                }
                            }
                        }
                        break;
                    case AGJQW.E_RECURRINGTYPE.RCT_MONTH:
                        dtTimeLineStart = this.mp_oControl.MathLib.DateTimeAdd(AGJQW.E_INTERVAL.IL_MONTH, -1, dtTimeLineStart);
                        dtCurrent = new AGJQW.DateTime(dtTimeLineStart.Year(), dtTimeLineStart.Month(), dtTimeLineStart.Day(), 0, 0, 0);
                        while (dtCurrent < dtTimeLineEnd)
                        {
                            if (oTimeBlock.BaseDate.Day() == dtCurrent.Day())
                            {
                                dtBase = new AGJQW.DateTime(dtCurrent.Year(), dtCurrent.Month(), dtCurrent.Day(), oTimeBlock.BaseDate.Hour(), oTimeBlock.BaseDate.Minute(), oTimeBlock.BaseDate.Second());
                                dtCurrent = this.mp_oControl.MathLib.DateTimeAdd(AGJQW.E_INTERVAL.IL_DAY, 1, dtCurrent);
                                if (this.mp_oControl.MathLib.mp_DateBlockVisible(dtTimeLineStart, dtTimeLineEnd, dtBase, oTimeBlock.DurationInterval, oTimeBlock.DurationFactor))
                                {
                                    oTempTimeBlock = this.mp_oControl.TempTimeBlocks().Add("");
                                    oTempTimeBlock.BaseDate = dtBase;
                                    oTempTimeBlock.DurationInterval = oTimeBlock.DurationInterval;
                                    oTempTimeBlock.DurationFactor = oTimeBlock.DurationFactor;
                                    this.CopyTimeBlock(oTempTimeBlock, oTimeBlock);
                                }
                            }
                            else
                            {
                                dtCurrent = this.mp_oControl.MathLib.DateTimeAdd(AGJQW.E_INTERVAL.IL_DAY, 1, dtCurrent);
                            }
                        }
                        break;
                    case AGJQW.E_RECURRINGTYPE.RCT_YEAR:
                        dtTimeLineStart = this.mp_oControl.MathLib.DateTimeAdd(AGJQW.E_INTERVAL.IL_YEAR, -1, dtTimeLineStart);
                        dtCurrent = new AGJQW.DateTime(dtTimeLineStart.Year(), dtTimeLineStart.Month(), dtTimeLineStart.Day(), 0, 0, 0);
                        while (dtCurrent < dtTimeLineEnd)
                        {
                            if (oTimeBlock.BaseDate.Month() == dtCurrent.Month())
                            {
                                if (oTimeBlock.BaseDate.Day() == dtCurrent.Day())
                                {
                                    dtBase = new AGJQW.DateTime(dtCurrent.Year(), dtCurrent.Month(), dtCurrent.Day(), oTimeBlock.BaseDate.Hour(), oTimeBlock.BaseDate.Minute(), oTimeBlock.BaseDate.Second());
                                    dtCurrent = this.mp_oControl.MathLib.DateTimeAdd(AGJQW.E_INTERVAL.IL_DAY, 1, dtCurrent);
                                    if (this.mp_oControl.MathLib.mp_DateBlockVisible(dtTimeLineStart, dtTimeLineEnd, dtBase, oTimeBlock.DurationInterval, oTimeBlock.DurationFactor))
                                    {
                                        oTempTimeBlock = this.mp_oControl.TempTimeBlocks().Add("");
                                        oTempTimeBlock.BaseDate = dtBase;
                                        oTempTimeBlock.DurationInterval = oTimeBlock.DurationInterval;
                                        oTempTimeBlock.DurationFactor = oTimeBlock.DurationFactor;
                                        this.CopyTimeBlock(oTempTimeBlock, oTimeBlock);
                                    }
                                }
                                else
                                {
                                    dtCurrent = this.mp_oControl.MathLib.DateTimeAdd(AGJQW.E_INTERVAL.IL_DAY, 1, dtCurrent);
                                }
                            }
                            else
                            {
                                dtCurrent = this.mp_oControl.MathLib.DateTimeAdd(AGJQW.E_INTERVAL.IL_MONTH, 1, dtCurrent);
                            }
                        }
                        break;
                }
            }
        }
	}

