	AGJQW.clsTimeBlocks.prototype.DrawClass = function(oTimeBlocks) {
		var lIndex = 0;
		var oTimeBlock = null;
		if (oTimeBlocks.Count == 0) 
		{
			return;
		}
        this.mp_oControl.clsG.mp_ClipRegion(this.mp_oControl.Splitter.Right, this.mp_oControl.CurrentViewObject.ClientArea.Top, this.mp_oControl.mt_RightMargin, this.mp_oControl.CurrentViewObject.ClientArea.Bottom, true);
		for (lIndex = 1; lIndex <= oTimeBlocks.Count; lIndex++) 
		{
			oTimeBlock = oTimeBlocks.mp_oCollection.m_oReturnArrayElement(lIndex);
			if (oTimeBlock.Visible == true) 
			{
                this.mp_oControl.DrawEventArgs.Clear();
                this.mp_oControl.DrawEventArgs.CustomDraw = false;
                this.mp_oControl.DrawEventArgs.EventTarget = AGJQW.E_EVENTTARGET.EVT_TIMEBLOCK;
                this.mp_oControl.DrawEventArgs.ObjectIndex = lIndex;
                this.mp_oControl.DrawEventArgs.ParentObjectIndex = 0;
                this.mp_oControl.DrawEventArgs.Graphics = this.mp_oControl.clsG.oGraphics;
                this.mp_oControl.FireDraw();
				if (this.mp_oControl.DrawEventArgs.CustomDraw == false) 
				{
                    if ((oTimeBlock.Right - oTimeBlock.Left) >= 1)
                    {
                        this.mp_oControl.clsG.mp_DrawItem(oTimeBlock.Left, oTimeBlock.Top, oTimeBlock.Right, oTimeBlock.Bottom, "", "", false, null, oTimeBlock.LeftTrim, oTimeBlock.RightTrim, oTimeBlock.Style);
                    }
				}
			}
		}
	}

