    ///clsColumns

	AGJQW.clsColumns = function (oControl) {
        this.mp_oControl = oControl;
		this.mp_oCollection = new AGJQW.clsCollectionBase(this.mp_oControl, "Column");		
	}

	AGJQW.clsColumns.prototype = {
		get Count(){
			return this.mp_oCollection.m_lCount();
		},
		get oCollection(){
			return this.mp_oCollection;
		},
		get Width(){
			var lIndex;
			var lResult = 0;
			for (lIndex = 1;lIndex <= this.Count;lIndex++) 
			{
				var oColumn;
				oColumn = this.mp_oCollection.m_oReturnArrayElement(lIndex);
				lResult = lResult + oColumn.Width;
			}
			return lResult;
		}
	}

	AGJQW.clsColumns.prototype.Item = function(Index) {
        return this.mp_oCollection.m_oItem(Index, AGJQW.SYS_ERRORS.COLUMNS_ITEM_1, AGJQW.SYS_ERRORS.COLUMNS_ITEM_2, AGJQW.SYS_ERRORS.COLUMNS_ITEM_3, AGJQW.SYS_ERRORS.COLUMNS_ITEM_4);
	}

	AGJQW.clsColumns.prototype.Add = function(Text, Key, Width, StyleIndex) {
        if (AGJQW.g_IsNV(Key)) {Key = "";}
        if (AGJQW.g_IsNV(Width)) {Width = 125;}
        if (AGJQW.g_IsNV(StyleIndex)) {StyleIndex = "";}
		this.mp_oCollection.AddMode = true;
        var oColumn = new AGJQW.clsColumn(this.mp_oControl);
		Text = AGJQW.g_Trim(Text);
		oColumn.Text = Text;
		oColumn.Width = Width;
		oColumn.StyleIndex = StyleIndex;
		this.mp_oCollection.m_Add(oColumn, "", AGJQW.SYS_ERRORS.COLUMNS_ADD_1, AGJQW.SYS_ERRORS.COLUMNS_ADD_2, false, AGJQW.SYS_ERRORS.COLUMNS_ADD_3);
		var lIndex;
		var oRow;
		for (lIndex = 1;lIndex <= this.mp_oControl.Rows.Count;lIndex++) 
		{
			oRow = this.mp_oControl.Rows.oCollection.m_oReturnArrayElement(lIndex);
			oRow.Cells.Add();
		}
		this.mp_oControl.Splitter.f_AdjustPosition();
		return oColumn;
	}

	AGJQW.clsColumns.prototype.Clear = function() {
		this.mp_oControl.Rows.ClearCells();
		this.mp_oCollection.m_Clear();
		this.mp_oControl.SelectedColumnIndex = 0;
		this.mp_oControl.SelectedCellIndex = 0;
		this.mp_oControl.Splitter.f_AdjustPosition();
	}

	AGJQW.clsColumns.prototype.Remove = function(Index) {
		var lIndex;
		var oRow;
		for (lIndex = 1;lIndex <= this.mp_oControl.Rows.Count;lIndex++) 
		{
			oRow = this.mp_oControl.Rows.oCollection.m_oReturnArrayElement(lIndex);
			oRow.Cells.Remove(Index);
		}
		this.mp_oCollection.m_Remove(Index, AGJQW.SYS_ERRORS.COLUMNS_REMOVE_1, AGJQW.SYS_ERRORS.COLUMNS_REMOVE_2, AGJQW.SYS_ERRORS.COLUMNS_REMOVE_3, AGJQW.SYS_ERRORS.COLUMNS_REMOVE_4);
        this.mp_oControl.SelectedColumnIndex = 0;
        this.mp_oControl.SelectedCellIndex = 0;
        this.mp_oControl.Splitter.f_AdjustPosition();
	}

	AGJQW.clsColumns.prototype.MoveColumn = function(OriginColumnIndex, DestColumnIndex) {
        var oColumn;
        var oRow;
        var lIndex = 0;
        if (OriginColumnIndex < 1 || OriginColumnIndex > this.Count)
        {
            return;
        }
        if (DestColumnIndex < 1 || DestColumnIndex > this.Count)
        {
            return;
        }
        if (DestColumnIndex == OriginColumnIndex)
        {
            return;
        }
        if (this.mp_oControl.TreeviewColumnIndex > 0)
        {
            for (lIndex = 1; lIndex <= this.mp_oControl.Columns.Count; lIndex++)
            {
                oColumn = this.mp_oControl.Columns.oCollection.m_oReturnArrayElement(lIndex);
                if (lIndex == this.mp_oControl.TreeviewColumnIndex)
                {
                    oColumn.mp_bTreeViewColumnIndex = true;
                }
                else
                {
                    oColumn.mp_bTreeViewColumnIndex = false;
                }
            }
        }
        this.mp_oCollection.m_lCopyAndMoveItems(OriginColumnIndex, DestColumnIndex);
        for (lIndex = 1; lIndex <= this.mp_oControl.Rows.Count; lIndex++)
        {
            oRow = this.mp_oControl.Rows.oCollection.m_oReturnArrayElement(lIndex);
            oRow.Cells.oCollection.m_lCopyAndMoveItems(OriginColumnIndex, DestColumnIndex);
        }
        if (this.mp_oControl.TreeviewColumnIndex > 0)
        {
            for (lIndex = 1; lIndex <= this.mp_oControl.Columns.Count; lIndex++)
            {
                oColumn = this.mp_oControl.Columns.oCollection.m_oReturnArrayElement(lIndex);
                if (oColumn.mp_bTreeViewColumnIndex == true)
                {
                    mp_oControl.TreeviewColumnIndex = lIndex;
                }
            }
        }
	}

	AGJQW.clsColumns.prototype.Position = function() {
		var lIndex;
		var oColumn;
		var lLeft;
        lLeft = -this.mp_oControl.HorizontalScrollBar.Value + this.mp_oControl.mt_LeftMargin;
		for (lIndex = 1;lIndex <= this.Count;lIndex++) 
		{
			oColumn = this.mp_oCollection.m_oReturnArrayElement(lIndex);
			oColumn.f_lLeft = lLeft;
			oColumn.f_lRight = lLeft + oColumn.Width;
			if (oColumn.Right < this.mp_oControl.mt_LeftMargin)
			{
				oColumn.f_bVisible = false;
			}
			else if (oColumn.Left > this.mp_oControl.Splitter.Left)
			{
				oColumn.f_bVisible = false;
			}
			else
			{
				oColumn.f_bVisible = true;
			}
			if (oColumn.Right > oColumn.Left)
			{
				oColumn.f_bVisible = true;
			}
			else
			{
				oColumn.f_bVisible = false;
			}
			lLeft = lLeft + oColumn.Width;
		}
	}

	AGJQW.clsColumns.prototype.Draw = function() {
		var oColumn;
		var lIndex;
		if (this.Count == 0)
		{
			return;
		}
		if ((this.mp_oControl.CurrentViewObject.TimeLine.Height == 0))
		{
			return;
		}
		for (lIndex = 1;lIndex <= this.Count;lIndex++) 
		{
			oColumn = this.mp_oCollection.m_oReturnArrayElement(lIndex);
			if (oColumn.Visible == true)
			{
                this.mp_oControl.clsG.mp_ClipRegion(oColumn.LeftTrim, oColumn.Top, oColumn.RightTrim, oColumn.Bottom, true);
                this.mp_oControl.DrawEventArgs.Clear();
                this.mp_oControl.DrawEventArgs.CustomDraw = false;
                this.mp_oControl.DrawEventArgs.EventTarget = AGJQW.E_EVENTTARGET.EVT_COLUMN;
                this.mp_oControl.DrawEventArgs.ObjectIndex = lIndex;
                this.mp_oControl.DrawEventArgs.ParentObjectIndex = 0;
                this.mp_oControl.DrawEventArgs.Graphics = this.mp_oControl.clsG.oGraphics;
                this.mp_oControl.FireDraw();
                if (this.mp_oControl.DrawEventArgs.CustomDraw == false)
				{
                    this.mp_oControl.clsG.mp_DrawItem(oColumn.Left, oColumn.Top, oColumn.Right - 1, oColumn.Bottom, "", oColumn.Text, (lIndex == this.mp_oControl.SelectedColumnIndex), oColumn.Image, oColumn.LeftTrim, oColumn.RightTrim, oColumn.Style);
                    if (oColumn.Text.Length > 0)
                    {
                        oColumn.mp_lTextLeft = this.mp_oControl.clsG.mp_oTextFinalLayout.Left;
                        oColumn.mp_lTextTop = this.mp_oControl.clsG.mp_oTextFinalLayout.Top;
                        oColumn.mp_lTextRight = this.mp_oControl.clsG.mp_oTextFinalLayout.Left + this.mp_oControl.clsG.mp_oTextFinalLayout.Width - 1;
                        oColumn.mp_lTextBottom = this.mp_oControl.clsG.mp_oTextFinalLayout.Top + this.mp_oControl.clsG.mp_oTextFinalLayout.Height - 1;
                    }
                    else
                    {
                        oColumn.mp_lTextLeft = oColumn.Left;
                        oColumn.mp_lTextTop = oColumn.Top;
                        oColumn.mp_lTextRight = oColumn.Right;
                        oColumn.mp_lTextBottom = oColumn.Bottom;
                    }
				}
			}
		}
	}

	AGJQW.clsColumns.prototype.GetXML = function() {
		var lIndex;
		var oColumn;
		var oXML = new AGJQW.clsXML(this.mp_oControl,"Columns");
		oXML.InitializeWriter();
		for (lIndex = 1;lIndex <= this.Count;lIndex++) 
		{
			oColumn = this.mp_oCollection.m_oReturnArrayElement(lIndex);
			oXML.WriteObject(oColumn.GetXML());
		}
		return oXML.GetXML();
	}

	AGJQW.clsColumns.prototype.SetXML = function(sXML) {
		var lIndex;
		var oXML = new AGJQW.clsXML(this.mp_oControl,"Columns");
		oXML.SetXML(sXML);
		oXML.InitializeReader();
		this.mp_oCollection.m_Clear();
		for (lIndex = 1;lIndex <= oXML.ReadCollectionCount();lIndex++) 
		{
            var oColumn = new AGJQW.clsColumn(this.mp_oControl);
			oColumn.SetXML(oXML.ReadCollectionObject(lIndex));
			this.mp_oCollection.AddMode = true;
			this.mp_oCollection.m_Add(oColumn, oColumn.Key, AGJQW.SYS_ERRORS.COLUMNS_ADD_1, AGJQW.SYS_ERRORS.COLUMNS_ADD_2, false, AGJQW.SYS_ERRORS.COLUMNS_ADD_3);
			oColumn = null;
		}
	}

