    AGJQW.clsHScrollBarTemplate.prototype = {
        get Enabled(){
            return this.mp_bEnabled;
        },
        set Enabled(value){
            this.mp_bEnabled = value;
        },
        get Value(){
            return this.mp_lValue;
        },
        set Value(value){
			this.mp_lValue = value;
			if (this.mp_lValue < this.mp_lMin)
			{
				//throw new Exception("Value is less than mp_lMin.");
			}
        },
        get Min(){
            return this.mp_lMin;
        },
        set Min(value){
            this.mp_lMin = value;
        },
        get Max(){
            return this.mp_lMax;
        },
        set Max(value){
			this.mp_lMax = value;
			if (this.mp_lMax < this.mp_lMin)
			{
				//throw new Exception("mp_lMax is less than mp_lMin.");
			}
        },
        get SmallChange(){
            return this.mp_lSmallChange;
        },
        set SmallChange(value){
            this.mp_lSmallChange = value;
        },
        get LargeChange(){
            return this.mp_lLargeChange;
        },
        set LargeChange(value){
            this.mp_lLargeChange = value;
        },
        get TimerInterval(){
            return this.mp_iTimerInterval;
        },
        set TimerInterval(value){
            this.mp_iTimerInterval = value;
        },
        get State(){
            return this.mp_yState;
        },
        set State(value){
			this.mp_yState = value;
			switch (this.mp_yState)
			{
				case AGJQW.E_SCROLLSTATE.SS_CANTDISPLAY:
					this.mp_yState = AGJQW.E_SCROLLSTATE.SS_HIDDEN;
					this.Visible = false;
					break;
				case AGJQW.E_SCROLLSTATE.SS_NOTNEEDED:
					if (this.mp_oControl.ScrollBarBehaviour == AGJQW.E_SCROLLBEHAVIOUR.SB_DISABLE)
					{
						this.mp_yState = AGJQW.E_SCROLLSTATE.SS_SHOWN;
						this.Enabled = false;
						this.Visible = true;
					}
					else
					{
						this.mp_yState = AGJQW.E_SCROLLSTATE.SS_HIDDEN;
						this.Visible = false;
					}
					break;
				case AGJQW.E_SCROLLSTATE.SS_NEEDED:
					this.mp_yState = AGJQW.E_SCROLLSTATE.SS_SHOWN;
					this.Enabled = true;
					this.Visible = true;
					break;
			}
        },
        get StyleIndex(){
            if (this.mp_sStyleIndex == "DS_SCROLLBAR")
            {
                return "";
            }
            else
            {
                return this.mp_sStyleIndex;
            }
        },
        set StyleIndex(value){
            value = AGJQW.g_Trim(value);
            if (value.length == 0)
                value = "DS_SCROLLBAR";
            this.mp_sStyleIndex = value;
            this.mp_oStyle = this.mp_oControl.Styles.FItem(value);
        },
        get Style(){
            return this.mp_oStyle;
        }
    }

    AGJQW.clsHScrollBarTemplate.prototype.Draw = function () {
        if (this.Visible == false)
            return;
        var oArrowButtonLeftStyle = this.ArrowButtons.NormalStyle;
        var oArrowButtonRightStyle = this.ArrowButtons.NormalStyle;
        var oThumbButtonStyle = this.ThumbButton.NormalStyle;
        if ((this.mp_lMax - this.mp_lMin) == 0)
        {
            return;
        }
        this.mp_oControl.clsG.mp_DrawItem(this.Left, this.Top, this.Left + this.Width - 1, this.Top + this.Height - 1, "", "", false, null, 0, 0, this.mp_oStyle);
        this.CalculateH();
        if (this.Enabled == false)
        {
            oThumbButtonStyle = this.ThumbButton.DisabledStyle;
            oArrowButtonLeftStyle = this.ArrowButtons.DisabledStyle;
            oArrowButtonRightStyle = this.ArrowButtons.DisabledStyle;
        }
        else if (this.mp_bMouseDown == true)
        {
            if (this.mp_iButton == AGJQW.E_BUTTON.BTN_LEFT)
            {
                oThumbButtonStyle = this.ThumbButton.NormalStyle;
                oArrowButtonLeftStyle = this.ArrowButtons.PressedStyle;
                oArrowButtonRightStyle = this.ArrowButtons.NormalStyle;
            }
            else if (this.mp_iButton == AGJQW.E_BUTTON.BTN_RIGHT)
            {
                oThumbButtonStyle = this.ThumbButton.NormalStyle;
                oArrowButtonLeftStyle = this.ArrowButtons.NormalStyle;
                oArrowButtonRightStyle = this.ArrowButtons.PressedStyle;
            }
            else if (this.mp_iButton == AGJQW.E_BUTTON.BTN_BUTTON)
            {
                oThumbButtonStyle = this.ThumbButton.PressedStyle;
                oArrowButtonLeftStyle = this.ArrowButtons.NormalStyle;
                oArrowButtonRightStyle = this.ArrowButtons.NormalStyle;
            }
            else
            {
                oThumbButtonStyle = this.ThumbButton.NormalStyle;
                oArrowButtonLeftStyle = this.ArrowButtons.NormalStyle;
                oArrowButtonRightStyle = this.ArrowButtons.NormalStyle;
            }
        }
        else
        {
            oArrowButtonLeftStyle = this.ArrowButtons.NormalStyle;
            oArrowButtonRightStyle = this.ArrowButtons.NormalStyle;
            oThumbButtonStyle = this.ThumbButton.NormalStyle;
        }
        this.mp_oControl.clsG.mp_DrawItem(this.Left, this.Top, this.Left + 16, this.Top + this.Height - 1, "", "", false, null, 0, 0, oArrowButtonLeftStyle);
        this.mp_oControl.clsG.mp_DrawItem(this.Left + this.Width - 17, this.Top, this.Left + this.Width - 1, this.Top + this.Height - 1, "", "", false, null, 0, 0, oArrowButtonRightStyle);
        this.mp_oControl.clsG.mp_DrawItem(this.Left + this.ButtonX1, this.Top + this.ButtonY1 - 1, this.Left + this.ButtonX2 - 2, this.Top + this.ButtonY2 - 1, "", "", false, null, 0, 0, oThumbButtonStyle);

        if (oArrowButtonLeftStyle.ScrollBarStyle.DropShadow == true)
        {
            this.mp_oControl.clsG.mp_DrawArrow(this.Left + oArrowButtonLeftStyle.ScrollBarStyle.DropShadowLeftX, this.Top + this.oArrowButtonLeftStyle.ScrollBarStyle.DropShadowLeftY, AGJQW.GRE_ARROWDIRECTION.AWD_LEFT, oArrowButtonLeftStyle.ScrollBarStyle.ArrowSize, oArrowButtonLeftStyle.ScrollBarStyle.DropShadowArrowColor);
        }
        this.mp_oControl.clsG.mp_DrawArrow(this.Left + oArrowButtonLeftStyle.ScrollBarStyle.LeftX, this.Top + oArrowButtonLeftStyle.ScrollBarStyle.LeftY, AGJQW.GRE_ARROWDIRECTION.AWD_LEFT, oArrowButtonLeftStyle.ScrollBarStyle.ArrowSize, oArrowButtonLeftStyle.ScrollBarStyle.ArrowColor);
        if (oArrowButtonRightStyle.ScrollBarStyle.DropShadow == true)
        {
            this.mp_oControl.clsG.mp_DrawArrow(this.Left + this.Width - 17 + oArrowButtonRightStyle.ScrollBarStyle.DropShadowRightX, this.Top + oArrowButtonRightStyle.ScrollBarStyle.DropShadowRightY, AGJQW.GRE_ARROWDIRECTION.AWD_RIGHT, oArrowButtonRightStyle.ScrollBarStyle.ArrowSize, oArrowButtonRightStyle.ScrollBarStyle.DropShadowArrowColor);
        }
        this.mp_oControl.clsG.mp_DrawArrow(this.Left + this.Width - 17 + oArrowButtonRightStyle.ScrollBarStyle.RightX, this.Top + oArrowButtonRightStyle.ScrollBarStyle.RightY, AGJQW.GRE_ARROWDIRECTION.AWD_RIGHT, oArrowButtonRightStyle.ScrollBarStyle.ArrowSize, oArrowButtonRightStyle.ScrollBarStyle.ArrowColor);
    }

    AGJQW.clsHScrollBarTemplate.prototype.OnMouseHover = function (X, Y) {
        this.mp_oControl.MouseKeyboardEvents.mp_SetCursor(AGJQW.E_CURSORTYPE.CT_NORMAL);
    }

    AGJQW.clsHScrollBarTemplate.prototype.OnMouseDown = function (X, Y) {
		if (this.Enabled == false)
		{
			return;
		}
		if (this.Visible == false)
		{
			return;
		}
        this.mp_oControl.MouseKeyboardEvents.mp_SetCursor(AGJQW.E_CURSORTYPE.CT_NORMAL);
		this.mp_bMouseDown = true;
        this.ScrollBarClick(X, Y);
        this.mp_oTimer = setInterval(this.mp_oTimer_Tick, this.mp_iTimerInterval, this);
    }

    AGJQW.clsHScrollBarTemplate.prototype.OnMouseMove = function (X, Y) {
		if (this.Enabled == false)
		{
			return;
		}
		if (this.Visible == false)
		{
			return;
		}
        var lRet = this.ConvertToRelativeCoords(X, Y);
        X = lRet.rX;
        Y = lRet.rY;
		if (this.mp_iButton == AGJQW.E_BUTTON.BTN_BUTTON)
		{
			var iProjectedValue = this.mp_lValue + (this.InvCalculateH(X) - this.InvCalculateH(this.mp_iMouseXPosition));
			if (iProjectedValue >= this.mp_lMin && iProjectedValue <= this.mp_lMax)
			{
				this.mp_iMouseXPosition = X;
				this.mp_lValue = iProjectedValue;
				this.mp_ValueChanged();
			}
			else if (iProjectedValue < this.mp_lMin)
			{
				this.mp_iMouseXPosition = X;
				this.mp_lValue = this.mp_lMin;
				this.mp_ValueChanged();
			}
			else if (iProjectedValue > this.mp_lMax)
			{
				this.mp_iMouseXPosition = X;
				this.mp_lValue = this.mp_lMax;
				this.mp_ValueChanged();
			}
		}
    }

    AGJQW.clsHScrollBarTemplate.prototype.OnMouseUp = function () {
		if (this.Enabled == false)
		{
			return;
		}
		if (this.Visible == false)
		{
			return;
		}
        this.mp_oControl.MouseKeyboardEvents.mp_SetCursor(AGJQW.E_CURSORTYPE.CT_NORMAL);
		this.mp_bMouseDown = false;
        clearInterval(this.mp_oTimer);
		this.mp_iButton = AGJQW.E_BUTTON.BTN_NONE;
        this.mp_oControl.Redraw();
    }

    AGJQW.clsHScrollBarTemplate.prototype.OverControl = function (X, Y) {
		if (X >= this.Left && X <= this.Left + this.Width && Y >= this.Top && Y <= this.Top + this.Height)
		{
			return true;
		}
		else
		{
			return false;
		}
    }

    AGJQW.clsHScrollBarTemplate.prototype.ConvertToRelativeCoords = function (X, Y) { 
		X = X - this.Left;
		Y = Y - this.Top;
        return {rX: X, rY: Y};
    }

    AGJQW.clsHScrollBarTemplate.prototype.ScrollBarClick = function (X, Y) {
		if (this.OverControl(X,Y) == false)
		{
			return false;
		}
        var lRet = this.ConvertToRelativeCoords(X, Y);
        X = lRet.rX;
        Y = lRet.rY;
		this.CalculateH();
		if (X < 17)
		{
			this.mp_iButton = AGJQW.E_BUTTON.BTN_LEFT;
			this.SmallChangeLeft();
			return true;
		}
		else if (X > 17 && X < this.ButtonX1)
		{
			this.mp_iButton = AGJQW.E_BUTTON.BTN_LEFTLCHANGE;
			this.LargeChangeLeft();
			return true;
		}
		else if (X >= this.ButtonX1 && X <= this.ButtonX2)
		{
			this.mp_iButton = AGJQW.E_BUTTON.BTN_BUTTON;
			this.mp_iMouseXPosition = X;
			return true;
		}
		else if (X > this.ButtonY2 && X < this.Width - 17)
		{
			this.mp_iButton = AGJQW.E_BUTTON.BTN_RIGHTLCHANGE;
			this.LargeChangeRight();
			return true;
		}
		else if (X > this.Width - 17 && X < this.Width)
		{
			this.mp_iButton = AGJQW.E_BUTTON.BTN_RIGHT;
			this.SmallChangeRight();
			return true;
		}
		else
		{
			return false;
		}
    }

    AGJQW.clsHScrollBarTemplate.prototype.SmallChangeLeft = function () {
		if ((this.mp_lValue - this.mp_lSmallChange) >= this.mp_lMin)
		{
			this.mp_lValue = this.mp_lValue - this.mp_lSmallChange;
		}
		else
		{
			this.mp_lValue = this.mp_lMin;
		}
		this.mp_ValueChanged();
    }

    AGJQW.clsHScrollBarTemplate.prototype.SmallChangeRight = function () {
		if ((this.mp_lValue + this.mp_lSmallChange) <= this.mp_lMax)
		{
			this.mp_lValue = this.mp_lValue + this.mp_lSmallChange;
		}
		else
		{
			this.mp_lValue = this.mp_lMax;
		}
		this.mp_ValueChanged();
    }

    AGJQW.clsHScrollBarTemplate.prototype.LargeChangeLeft = function () {
		if ((this.mp_lValue - this.mp_lLargeChange) >= this.mp_lMin)
		{
			this.mp_lValue = this.mp_lValue - this.mp_lLargeChange;
		}
		else if ((this.mp_lValue - this.mp_lLargeChange) < this.mp_lMin)
		{
			this.mp_lValue = this.mp_lMin;
		}
		this.mp_ValueChanged();
    }

    AGJQW.clsHScrollBarTemplate.prototype.LargeChangeRight = function () {
		if ((this.mp_lValue + this.mp_lLargeChange) <= this.mp_lMax)
		{
			this.mp_lValue = this.mp_lValue + this.mp_lLargeChange;
		}
		else if ((this.mp_lValue + this.mp_lLargeChange) > this.mp_lMax)
		{
			this.mp_lValue = this.mp_lMax;
		}
		this.mp_ValueChanged();
    }

    AGJQW.clsHScrollBarTemplate.prototype.mp_ValueChanged = function () {
        if ((this.mp_lValue - this.mp_lValueBuff) != 0)
        {
            this.mp_oParent.oHScrollBar_ValueChanged(this.mp_lValue - this.mp_lValueBuff);
        }
		this.mp_lValueBuff = this.mp_lValue;
    }

    AGJQW.clsHScrollBarTemplate.prototype.mp_oTimer_Tick = function (oSCB) {
		switch (oSCB.mp_iButton)
		{
			case AGJQW.E_BUTTON.BTN_LEFT:
				oSCB.SmallChangeLeft();
				break;
			case AGJQW.E_BUTTON.BTN_LEFTLCHANGE:
				oSCB.LargeChangeLeft();
				break;
			case AGJQW.E_BUTTON.BTN_RIGHTLCHANGE:
				oSCB.LargeChangeRight();
				break;
			case AGJQW.E_BUTTON.BTN_RIGHT:
				oSCB.SmallChangeRight();
				break;
		}
    }

    AGJQW.clsHScrollBarTemplate.prototype.CalculateH = function () {
		var lWidth;
		var lItemLength = 0;
		lWidth = this.Width - (16 * 2) - 1;
		if (this.mp_lLargeChange > 0)
		{
			lItemLength = this.mp_oControl.MathLib.RoundDouble(lWidth / (((this.mp_lMax - this.mp_lMin) / this.mp_lLargeChange) + 1));
		}
		if (lItemLength < 8)
		{
			lItemLength = 8;
		}
		lItemLength = lItemLength + 1;
		lWidth = lWidth - lItemLength;
		this.ButtonX1 = this.mp_oControl.MathLib.RoundDouble((((this.mp_lValue - this.mp_lMin) / (this.mp_lMax - this.mp_lMin)) * lWidth) + 17);
		this.ButtonX2 = this.ButtonX1 + lItemLength;
		this.ButtonY1 = 1;
		this.ButtonY2 = this.ButtonY1 + this.Height - 1;
    }

    AGJQW.clsHScrollBarTemplate.prototype.InvCalculateH = function (X) {
		var lWidth;
		var lItemLength = 0;
		var iReturnValue;
		lWidth = this.Width - (16 * 2) - 1;
		if (this.mp_lLargeChange > 0)
		{
			lItemLength = this.mp_oControl.MathLib.RoundDouble(lWidth / (((this.mp_lMax - this.mp_lMin) / this.mp_lLargeChange) + 1));
		}
		if (lItemLength < 8)
		{
			lItemLength = 8;
		}
		lItemLength = lItemLength + 1;
		lWidth = lWidth - lItemLength;
		iReturnValue = this.mp_oControl.MathLib.RoundDouble((((X - 17) * (this.mp_lMax - this.mp_lMin)) / lWidth) + this.mp_lMin);
		return iReturnValue;
    }

    AGJQW.clsHScrollBarTemplate.prototype.GetXML = function () {
        var oXML = new AGJQW.clsXML(this.mp_oControl,"ScrollBar");
        oXML.InitializeWriter();
        oXML.WriteProperty("StyleIndex", this.mp_sStyleIndex);
        oXML.WriteObject(this.ArrowButtons.GetXML());
        oXML.WriteObject(this.ThumbButton.GetXML());
        return oXML.GetXML();
    }

    AGJQW.clsHScrollBarTemplate.prototype.SetXML = function (sXML) {
        var oXML = new AGJQW.clsXML(this.mp_oControl,"ScrollBar");
        oXML.SetXML(sXML);
        oXML.InitializeReader();
        oXML.ReadProperty("StyleIndex", this.mp_sStyleIndex);
        this.StyleIndex = this.mp_sStyleIndex;
        this.ArrowButtons.SetXML(oXML.ReadObject("ArrowButtonState"));
        this.ThumbButton.SetXML(oXML.ReadObject("ThumbButtonState"));
    }

    AGJQW.clsHScrollBarTemplate.prototype.Clone = function (oClone) {
        oClone.mp_lSmallChange = this.mp_lSmallChange;
        oClone.mp_lLargeChange = this.mp_lLargeChange;
        oClone.mp_lMin = this.mp_lMin;
        oClone.mp_lMax = this.mp_lMax;
        oClone.mp_lValue = this.mp_lValue;
        oClone.Height = this.Height;
        oClone.mp_bMouseDown = this.mp_bMouseDown;
        oClone.mp_iButton = this.mp_iButton;
        oClone.mp_iTimerInterval = this.mp_iTimerInterval;
        oClone.mp_lValueBuff = this.mp_lValueBuff;
        oClone.StyleIndex = this.mp_sStyleIndex;
        this.ArrowButtons.Clone(oClone.ArrowButtons);
        this.ThumbButton.Clone(oClone.ThumbButton);
    }

    ///clsVScrollBarTemplate

    AGJQW.clsVScrollBarTemplate = function (oControl, oParent) {

        this.mp_oControl = oControl;
        this.mp_oParent = oParent;
        this.mp_lSmallChange = 1;
        this.mp_lLargeChange = 0;
		this.mp_lValue = 0;
		this.mp_lMin = 0;
		this.mp_lMax = 0;
		this.ButtonX1 = 0;
		this.ButtonX2 = 0;
		this.ButtonY1 = 0;
		this.ButtonY2 = 0;
		this.Visible = false;
		this.mp_bEnabled = false;
		this.Height = 0;
		this.Width = 17;
		this.Top = 0;
		this.Left = 0;
		this.mp_bMouseDown = false;
		this.mp_iMouseYPosition = 0;
		this.mp_iButton = AGJQW.E_BUTTON.BTN_NONE;
		this.mp_iTimerInterval = 50;
		this.mp_yState = AGJQW.E_SCROLLSTATE.SS_CANTDISPLAY;
		this.mp_lValueBuff = 0;
        this.mp_oTimerVar = null;
        this.mp_oTimer = null;
        this.mp_sStyleIndex = "DS_SCROLLBAR";
        this.mp_oStyle = this.mp_oControl.Styles.FItem("DS_SCROLLBAR");
        this.ArrowButtons = new AGJQW.clsButtonState(this.mp_oControl, "Arrow");
        this.ThumbButton = new AGJQW.clsButtonState(this.mp_oControl, "Thumb");
    }

    AGJQW.clsVScrollBarTemplate.prototype = {
        get Enabled(){
            return this.mp_bEnabled;
        },
        set Enabled(value){
            this.mp_bEnabled = value;
        },
        get Value(){
            return this.mp_lValue;
        },
        set Value(value){
			this.mp_lValue = value;
			if (this.mp_lValue < this.mp_lMin)
			{
				//throw new Exception("Value is less than mp_lMin.");
			}
        },
        get Min(){
            return this.mp_lMin;
        },
        set Min(value){
            this.mp_lMin = value;
        },
        get Max(){
            return this.mp_lMax;
        },
        set Max(value){
			this.mp_lMax = value;
			if (this.mp_lMax < this.mp_lMin)
			{
				//throw new Exception("mp_lMax is less than mp_lMin.");
			}
        },
        get SmallChange(){
            return this.mp_lSmallChange;
        },
        set SmallChange(value){
            this.mp_lSmallChange = value;
        },
        get LargeChange(){
            return this.mp_lLargeChange;
        },
        set LargeChange(value){
            this.mp_lLargeChange = value;
        },
        get TimerInterval(){
            return this.mp_iTimerInterval;
        },
        set TimerInterval(value){
            this.mp_iTimerInterval = value;
        },
        get State(){
            return this.mp_yState;
        },
        set State(value){
			this.mp_yState = value;
			switch (this.mp_yState)
			{
				case AGJQW.E_SCROLLSTATE.SS_CANTDISPLAY:
					this.mp_yState = AGJQW.E_SCROLLSTATE.SS_HIDDEN;
					this.Visible = false;
					break;
				case AGJQW.E_SCROLLSTATE.SS_NOTNEEDED:
					if (this.mp_oControl.ScrollBarBehaviour == AGJQW.E_SCROLLBEHAVIOUR.SB_DISABLE)
					{
						this.mp_yState = AGJQW.E_SCROLLSTATE.SS_SHOWN;
						this.Enabled = false;
						this.Visible = true;
					}
					else
					{
						this.mp_yState = AGJQW.E_SCROLLSTATE.SS_HIDDEN;
						this.Visible = false;
					}
					break;
				case AGJQW.E_SCROLLSTATE.SS_NEEDED:
					this.mp_yState = AGJQW.E_SCROLLSTATE.SS_SHOWN;
					this.Enabled = true;
					this.Visible = true;
					break;
			}
        },
        get StyleIndex(){
            if (this.mp_sStyleIndex == "DS_SCROLLBAR")
            {
                return "";
            }
            else
            {
                return this.mp_sStyleIndex;
            }
        },
        set StyleIndex(value){
            value = AGJQW.g_Trim(value);
            if (value.length == 0)
                value = "DS_SCROLLBAR";
            this.mp_sStyleIndex = value;
            this.mp_oStyle = this.mp_oControl.Styles.FItem(value);
        },
        get Style(){
            return this.mp_oStyle;
        }
    }

