        this.mp_oControl.clsG.mp_DrawItem(this.Left + this.ButtonX1 - 1, this.Top + this.ButtonY1, this.Left + this.ButtonX2 - 1, this.Top + this.ButtonY2 - 2, "", "", false, null, 0, 0, oThumbButtonStyle);

