	AGJQW.clsPercentage.prototype = {
		get AllowSize(){
			return this.mp_bAllowSize;
		},
		set AllowSize(value){
			this.mp_bAllowSize = value;
		},
		get Key(){
			return this.mp_sKey;
		},
		set Key(value){
            var rKey = new AGJQW.ByRef(this.mp_sKey);
			this.mp_oControl.Percentages.oCollection.mp_SetKey(rKey, value, AGJQW.SYS_ERRORS.PERCENTAGES_SET_KEY);
            this.mp_sKey = rKey.value;
		},
		get Percent(){
			return this.mp_fPercent;
		},
		set Percent(value){
			this.mp_fPercent = value;
		},
		get TaskKey(){
			return this.mp_sTaskKey;
		},
		set TaskKey(value){
			this.mp_sTaskKey = value;
			this.mp_oTask = this.mp_oControl.Tasks.Item(value);
		},
		get Task(){
			return this.mp_oTask;
		},
		get Layer(){
			return this.mp_oTask.Layer;
		},
		get Tag(){
			return this.mp_sTag;
		},
		set Tag(value){
			this.mp_sTag = value;
		},
		get ObjectTag(){
			return this.mp_oObjectTag;
		},
		set ObjectTag(value){
			this.mp_oObjectTag = value;
		},
		get LeftTrim(){
			if (this.Left < this.mp_oControl.Splitter.Right) 
			{
				return this.mp_oControl.Splitter.Right;
			}
			else 
			{
				return this.Left;
			}
		},
		get RightTrim(){
			if (this.Right > this.mp_oControl.mt_RightMargin) 
			{
				return this.mp_oControl.mt_RightMargin;
			}
			else 
			{
				return this.Right;
			}
		},
		get f_bLeftVisible(){
			if (this.LeftTrim == this.Left) 
			{
				return true;
			}
			else 
			{
				return false;
			}
		},
		get f_bRightVisible(){
			if (this.RightTrim == this.Right) 
			{
				return true;
			}
			else 
			{
				return false;
			}
		},
		get Left(){
			return this.mp_oTask.Left;
		},
		get Top(){
			if ((this.mp_oTask.Row.Height <= -1)) 
			{
				return this.mp_oTask.Row.Top;
			}
			if (this.mp_oStyle.Placement == AGJQW.E_PLACEMENT.PLC_ROWEXTENTSPLACEMENT) 
			{
				return this.mp_oTask.Row.Top;
			}
			if (this.mp_oStyle.Placement == AGJQW.E_PLACEMENT.PLC_OFFSETPLACEMENT) 
			{
				return this.mp_oTask.Row.Top + this.mp_oStyle.OffsetTop;
			}
			return 0;
		},
		get Bottom(){
			if ((this.mp_oTask.Row.Height <= -1)) 
			{
				return this.mp_oTask.Row.Top;
			}
			if (this.mp_oStyle.Placement == AGJQW.E_PLACEMENT.PLC_ROWEXTENTSPLACEMENT) 
			{
				return this.mp_oTask.Row.Bottom - 1;
			}
			if (this.mp_oStyle.Placement == AGJQW.E_PLACEMENT.PLC_OFFSETPLACEMENT) 
			{
				return this.mp_oTask.Row.Top + this.mp_oStyle.OffsetTop + this.mp_oStyle.OffsetBottom;
			}
			return 0;
		},
		get Right(){
			return (this.Left + (this.mp_oTask.Right - this.mp_oTask.Left) * this.mp_fPercent);
		},
		get RightSel(){
			if (this.Right == this.Left) 
			{
				return this.Left + 15;
			}
			else 
			{
				return this.Right;
			}
		},
		get Visible(){
			if (this.mp_oTask.Row.Visible == false) 
			{
				return false;
			}
			if (this.mp_oTask.Visible == false || this.mp_oTask.Type == AGJQW.E_OBJECTTYPE.OT_MILESTONE) 
			{
				return false;
			}
			return this.mp_bVisible;
		},
		set Visible(value){
			this.mp_bVisible = value;
		},
		get StyleIndex(){
            if (this.mp_sStyleIndex == "DS_PERCENTAGE")
            {
                return "";
            }
            else
            {
                return this.mp_sStyleIndex;
            }
		},
		set StyleIndex(value){
            value = value.trim();
            if (value.length == 0) { value = "DS_PERCENTAGE"; }
            this.mp_sStyleIndex = value;
            this.mp_oStyle = this.mp_oControl.Styles.FItem(value);
		},
		get Style(){
			return this.mp_oStyle;
		},
		get Format(){
			return this.mp_sFormat;
		},
		set Format(value){
			this.mp_sFormat = value;
		},
		get Index(){
			return this.mp_lIndex;
		},
		set Index(value){
			this.mp_lIndex = value;
		}
	}

