	AGJQW.clsGrid.prototype.Draw = function() {
		var dtBuff;
		if (this.mp_bVerticalLines == false)
		{
			return;
		}
		if (this.mp_oControl.MathLib.GetXCoordinateFromDate(this.mp_oControl.MathLib.DateTimeAdd(this.mp_yInterval, this.mp_lFactor, this.mp_oTimeLine.StartDate)) - this.mp_oControl.MathLib.GetXCoordinateFromDate(this.mp_oTimeLine.StartDate) < 5)
		{
			return;
		}
        this.mp_oControl.clsG.mp_ClipRegion(this.mp_oTimeLine.f_lStart, this.mp_oControl.CurrentViewObject.ClientArea.Top, this.mp_oTimeLine.f_lEnd, this.mp_oControl.CurrentViewObject.ClientArea.Bottom, true);
		dtBuff = this.mp_oControl.MathLib.RoundDate(this.mp_yInterval, this.mp_lFactor, this.mp_oTimeLine.StartDate);
		if (this.mp_oControl.MathLib.GetXCoordinateFromDate(dtBuff) >= this.mp_oTimeLine.f_lStart)
		{
			this.mp_PaintVerticalGridLine(this.mp_oControl.MathLib.GetXCoordinateFromDate(dtBuff), AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID);
		}
		while (dtBuff < this.mp_oTimeLine.EndDate) 
		{
			dtBuff = this.mp_oControl.MathLib.DateTimeAdd(this.mp_yInterval, this.mp_lFactor, dtBuff);
			this.mp_PaintVerticalGridLine(this.mp_oControl.MathLib.GetXCoordinateFromDate(dtBuff), AGJQW.GRE_LINEDRAWSTYLE.LDS_SOLID);
		}
	}

	AGJQW.clsGrid.prototype.mp_PaintVerticalGridLine = function(fXCoordinate, v_lDrawStyle) {
        if (this.mp_bVerticalLines == true)
        {
            this.mp_oControl.clsG.mp_DrawLine(fXCoordinate, this.mp_oControl.CurrentViewObject.ClientArea.Top, fXCoordinate, this.mp_oControl.Rows.TopOffset, AGJQW.GRE_LINETYPE.LT_NORMAL, this.mp_clrColor, v_lDrawStyle, 1, true);
        }
	}

