		oXML.InitializeReader();
		oXML.ReadProperty("VerticalLines", this.mp_bVerticalLines);
		oXML.ReadProperty("SnapToGrid", this.mp_bSnapToGrid);
		oXML.ReadProperty("SnapToGridOnSelection", this.mp_bSnapToGridOnSelection);
