	AGJQW.clsTierColors.prototype.Item = function(Index) {
        return this.mp_oCollection.m_oItem(Index, AGJQW.SYS_ERRORS.TIERCOLORS_ITEM_1, AGJQW.SYS_ERRORS.TIERCOLORS_ITEM_2, AGJQW.SYS_ERRORS.TIERCOLORS_ITEM_3, AGJQW.SYS_ERRORS.TIERCOLORS_ITEM_4);
	}

	AGJQW.clsTierColors.prototype.Add = function(BackColor, ForeColor, StartGradientColor, EndGradientColor, HatchBackColor, HatchForeColor, Key) {
        if (AGJQW.g_IsNV(Key)) {Key = "";}
        this.mp_oCollection.AddMode = true;
        var oTierColor = new AGJQW.clsTierColor(this.mp_oControl, this);
        oTierColor.BackColor = BackColor;
        oTierColor.ForeColor = ForeColor;
        oTierColor.StartGradientColor = StartGradientColor;
        oTierColor.EndGradientColor = EndGradientColor;
        oTierColor.HatchBackColor = HatchBackColor;
        oTierColor.HatchForeColor = HatchForeColor;
        oTierColor.Key = Key;
        this.mp_oCollection.m_Add(oTierColor, Key, AGJQW.SYS_ERRORS.TIERCOLORS_ADD_1, AGJQW.SYS_ERRORS.TIERCOLORS_ADD_2, false, AGJQW.SYS_ERRORS.TIERCOLORS_ADD_3);
        return oTierColor;
	}

	AGJQW.clsTierColors.prototype.mp_CollectionName = function() {
        if (this.mp_yTierType == AGJQW.E_TIERTYPE.ST_MICROSECOND)
        {
            return "MicrosecondColors";
        }
        else if (this.mp_yTierType == AGJQW.E_TIERTYPE.ST_MILLISECOND)
        {
            return "MillisecondColors";
        }
        else if (this.mp_yTierType == AGJQW.E_TIERTYPE.ST_SECOND)
        {
            return "SecondColors";
        }
		else if (this.mp_yTierType == AGJQW.E_TIERTYPE.ST_MINUTE)
		{
			return "MinuteColors";
		}
		else if (this.mp_yTierType == AGJQW.E_TIERTYPE.ST_HOUR)
		{
			return "HourColors";
		}
		else if (this.mp_yTierType == AGJQW.E_TIERTYPE.ST_DAY)
		{
			return "DayColors";
		}
		else if (this.mp_yTierType == AGJQW.E_TIERTYPE.ST_DAYOFWEEK)
		{
			return "DayOfWeekColors";
		}
		else if (this.mp_yTierType == AGJQW.E_TIERTYPE.ST_DAYOFYEAR)
		{
			return "DayOfYearColors";
		}
		else if (this.mp_yTierType == AGJQW.E_TIERTYPE.ST_WEEK)
		{
			return "WeekColors";
		}
		else if (this.mp_yTierType == AGJQW.E_TIERTYPE.ST_MONTH)
		{
			return "MonthColors";
		}
		else if (this.mp_yTierType == AGJQW.E_TIERTYPE.ST_QUARTER)
		{
			return "QuarterColors";
		}
		else if (this.mp_yTierType == AGJQW.E_TIERTYPE.ST_YEAR)
		{
			return "YearColors";
		}
		return "";
	}

	AGJQW.clsTierColors.prototype.GetXML = function() {
		var lIndex;
		var oTierColor;
		var oXML = new AGJQW.clsXML(this.mp_oControl,mp_CollectionName());
		oXML.InitializeWriter();
		for (lIndex = 1;lIndex <= this.Count;lIndex++) 
		{
			oTierColor = this.mp_oCollection.m_oReturnArrayElement(lIndex);
			oXML.WriteObject(oTierColor.GetXML());
		}
		return oXML.GetXML();
	}

	AGJQW.clsTierColors.prototype.SetXML = function(sXML) {
		var lIndex;
		var oXML = new AGJQW.clsXML(this.mp_oControl,this.mp_CollectionName());
		oXML.SetXML(sXML);
		oXML.InitializeReader();
		this.mp_oCollection.m_Clear();
		for (lIndex = 1;lIndex <= oXML.ReadCollectionCount();lIndex++) 
		{
            var oTierColor = new AGJQW.clsTierColor(this.mp_oControl, this);
			oTierColor.SetXML(oXML.ReadCollectionObject(lIndex));
			this.mp_oCollection.AddMode = true;
			this.mp_oCollection.m_Add(oTierColor, oTierColor.Key, AGJQW.SYS_ERRORS.TIERCOLORS_ADD_1, AGJQW.SYS_ERRORS.TIERCOLORS_ADD_2, false, AGJQW.SYS_ERRORS.TIERCOLORS_ADD_3);
			oTierColor = null;
		}
	}

	AGJQW.clsTierColors.prototype.Clear = function() {
        this.mp_oCollection.m_Clear();
	}

	AGJQW.clsTierColors.prototype.Clone = function(oClone) {
        oClone.Clear();
        var i = 0;
        for (i = 1; i <= this.Count; i++)
        {
            var oTierColor = this.Item(i);
            var oTierColorClone = null;
            oTierColorClone = oClone.Add(oTierColor.BackColor, oTierColor.ForeColor, oTierColor.StartGradientColor, oTierColor.EndGradientColor, oTierColor.HatchBackColor, oTierColor.HatchForeColor, oTierColor.Key);
            oTierColor.Clone(oTierColorClone);
        }
	}

