		oXML.SetXML(sXML);
		oXML.InitializeReader();
		oXML.ReadProperty("BigTickMarkHeight", this.mp_lBigTickMarkHeight);
		oXML.ReadProperty("Height", this.mp_lHeight);
		oXML.ReadProperty("MediumTickMarkHeight", this.mp_lMediumTickMarkHeight);
		oXML.ReadProperty("SmallTickMarkHeight", this.mp_lSmallTickMarkHeight);
		oXML.ReadProperty("StyleIndex", this.mp_sStyleIndex);
		this.StyleIndex = this.mp_sStyleIndex;
		oXML.ReadProperty("TextOffset", this.mp_lTextOffset);
		oXML.ReadProperty("Visible", this.mp_bVisible);
