	AGJQW.clsViews.prototype.GetXML = function() {
		var lIndex;
		var oView;
		var oXML = new AGJQW.clsXML(this.mp_oControl,"Views");
		oXML.InitializeWriter();
		for (lIndex = 1;lIndex <= AGJQW.Count;lIndex++) 
		{
			oView = this.mp_oCollection.m_oReturnArrayElement(lIndex);
			oXML.WriteObject(oView.GetXML());
		}
		return oXML.GetXML();
	}

	AGJQW.clsViews.prototype.SetXML = function(sXML) {
		var lIndex;
		var oXML = new AGJQW.clsXML(this.mp_oControl,"Views");
		oXML.SetXML(sXML);
		oXML.InitializeReader();
		mp_oCollection.m_Clear();
		for (lIndex = 1;lIndex <= oXML.ReadCollectionCount();lIndex++) 
		{
            var oView = new AGJQW.clsView(this.mp_oControl);
			oView.SetXML(oXML.ReadCollectionObject(lIndex));
			this.mp_oCollection.AddMode = true;
			this.mp_oCollection.m_Add(oView, oView.Key, AGJQW.SYS_ERRORS.VIEWS_ADD_1, AGJQW.SYS_ERRORS.VIEWS_ADD_2, false, AGJQW.SYS_ERRORS.VIEWS_ADD_3);
			oView = null;
		}
	}

