        get TouchEnabled(){
            return this.mp_bTouchEnabled;
        },
        set TouchEnabled(value){
            this.mp_bTouchEnabled = value;
        },
		get f_UserMode(){
			return true;
		},
		get f_TimeLineScrollBar(){
            if (this.mp_yTimeLineScrollBarScope == AGJQW.E_OBJECTSCOPE.OS_CONTROL)
            {
                return this.TimeLineScrollBar;
            }
            else
            {
                return this.CurrentViewObject.TimeLine.TimeLineScrollBar;
            }
		},
		get f_ProgressLine(){
            if (this.mp_yProgressLineScope == AGJQW.E_OBJECTSCOPE.OS_CONTROL)
            {
                return this.ProgressLine;
            }
            else
            {
                return this.CurrentViewObject.TimeLine.ProgressLine;
            }
		},
		get mt_BorderThickness(){
            switch (this.mp_oStyle.Appearance)
            {
                case AGJQW.E_STYLEAPPEARANCE.SA_RAISED:
                    return 2;
                case AGJQW.E_STYLEAPPEARANCE.SA_SUNKEN:
                    return 2;
                case AGJQW.E_STYLEAPPEARANCE.SA_FLAT:
                    if (this.mp_oStyle.BorderStyle == AGJQW.GRE_BORDERSTYLE.SBR_NONE)
                    {
                        return 0;
                    }
                    else
                    {
                        return this.mp_oStyle.BorderWidth;
                    }
                case AGJQW.E_STYLEAPPEARANCE.SA_GRAPHICAL:
                    return 0;
            }
            return 0;
		},
		get mt_TableBottom(){
			if (this.HorizontalScrollBar.State == AGJQW.E_SCROLLSTATE.SS_SHOWN )
			{
                return this.clsG.Height() - this.mt_BorderThickness - 1 - this.HorizontalScrollBar.Height;
			}
			else
			{
                return this.clsG.Height() - this.mt_BorderThickness - 1;
			}
		},
