	AGJQW.ActiveGanttJQWCtl.prototype.CheckPredecessors = function() {
        var i = 0;
        var oTask;
        for (i = 1; i <= this.Tasks.Count; i++)
        {
            oTask = this.Tasks.oCollection.m_oReturnArrayElement(i);
            oTask.mp_bWarning = false;
        }
        if (Predecessors.Count == 0)
        {
            return;
        }
        var oPredecessor;
        for (i = 1; i <= this.Predecessors.Count; i++)
        {
            oPredecessor = this.Predecessors.oCollection.m_oReturnArrayElement(i);
            oPredecessor.Check(mp_yPredecessorMode);
        }
	}

