    AGJQW.ActiveGanttJQWCtl.prototype.mp_Draw = function () {
		this.FireControlDraw();
		this.clsG.mp_ResetFocusRectangle();
        this.clsG.mp_ClipRegion(0, 0, this.clsG.Width(), this.clsG.Height(), false);
        this.clsG.mp_DrawItem(0, 0, this.clsG.Width() - 2, this.clsG.Height() - 2, "", "", false, this.Image, 0, 0, this.Style);
		this.mp_oCurrentView.TimeLine.Calculate();
		this.mp_PositionScrollBars();
		this.Columns.Position();
		this.Rows.InitializePosition();
		this.Rows.PositionRows();
        this.mp_oCurrentView.TimeLine.Draw();
		this.Columns.Draw();
		this.Rows.Draw();
		this.Treeview.Draw();
		this.TimeBlocks.CreateTemporaryTimeBlocks();
		this.TimeBlocks.Draw();
		this.mp_oCurrentView.ClientArea.Grid.Draw();
		this.mp_oCurrentView.ClientArea.Draw();
        this.Predecessors.Draw();
		this.Tasks.Draw();
		this.Percentages.Draw();
		this.mp_oCurrentView.TimeLine.ProgressLine.Draw();
        this.f_ProgressLine.Draw();
		this.Splitter.Draw();
        this.clsG.mp_ClipRegion(0, 0, this.clsG.Width(), this.clsG.Height(), false);
        this.MPl78();
        if (this.VerticalScrollBar.State == AGJQW.E_SCROLLSTATE.SS_SHOWN)
        {
            this.clsG.mp_DrawItem(this.VerticalScrollBar.Left, this.VerticalScrollBar.Top + this.VerticalScrollBar.Height, this.VerticalScrollBar.Left + 16, this.VerticalScrollBar.Top + this.VerticalScrollBar.Height + 16, "", "", false, null, 0, 0, this.ScrollBarSeparator.Style);
            this.clsG.mp_ClipRegion(0, 0, this.clsG.Width(), this.clsG.Height(), false);
        }
        else if (this.f_TimeLineScrollBar.State == AGJQW.E_SCROLLSTATE.SS_SHOWN)
        {
            this.clsG.mp_DrawItem(this.f_TimeLineScrollBar.Left + this.f_TimeLineScrollBar.Width, this.f_TimeLineScrollBar.Top, this.f_TimeLineScrollBar.Left + this.f_TimeLineScrollBar.Width + 16, this.f_TimeLineScrollBar.Top + 16, "", "", false, null, 0, 0, this.ScrollBarSeparator.Style);
            this.clsG.mp_ClipRegion(0, 0, this.clsG.Width(), this.clsG.Height(), false);
        }
		this.mp_DrawDebugMetrics();
        
		if (this.VerticalScrollBar.State == AGJQW.E_SCROLLSTATE.SS_SHOWN) 
		{
			this.VerticalScrollBar.ScrollBar.Draw();
		}
		if (this.HorizontalScrollBar.State == AGJQW.E_SCROLLSTATE.SS_SHOWN) 
		{
			this.HorizontalScrollBar.ScrollBar.Draw();
		}
        if (this.f_TimeLineScrollBar.State == AGJQW.E_SCROLLSTATE.SS_SHOWN)
        {
            this.f_TimeLineScrollBar.ScrollBar.Draw();
        }
        this.FireControlRedrawn();
    };

