	AGJQW.ActiveGanttJQWCtl.prototype.mp_PositionScrollBars = function() {
		if ( this.DesignMode == true || this.mp_bTouchEnabled == true)
		{
			this.VerticalScrollBar.State = AGJQW.E_SCROLLSTATE.SS_CANTDISPLAY;
			this.HorizontalScrollBar.State = AGJQW.E_SCROLLSTATE.SS_CANTDISPLAY;
			this.f_TimeLineScrollBar.State = AGJQW.E_SCROLLSTATE.SS_CANTDISPLAY;
            return;
		}

        if ( this.clsG.Height() <= this.mp_oCurrentView.ClientArea.Top )
		{
			this.VerticalScrollBar.State = AGJQW.E_SCROLLSTATE.SS_CANTDISPLAY;
			this.HorizontalScrollBar.State = AGJQW.E_SCROLLSTATE.SS_CANTDISPLAY;
			this.f_TimeLineScrollBar.State = AGJQW.E_SCROLLSTATE.SS_CANTDISPLAY;
            return;
		}

        // Determine need for HorizontalScrollBar
        var lWidth = 0;
        lWidth = this.Columns.Width;
        if (lWidth > this.Splitter.Right)
        {
            if (this.HorizontalScrollBar.mf_Visible == true)
            {
                this.HorizontalScrollBar.State = AGJQW.E_SCROLLSTATE.SS_NEEDED;
            }
            else
            {
                this.HorizontalScrollBar.State = AGJQW.E_SCROLLSTATE.SS_NOTNEEDED;
            }
        }
        else
        {
            this.HorizontalScrollBar.State = AGJQW.E_SCROLLSTATE.SS_NOTNEEDED;
        }
        if (this.Splitter.Right < 5)
        {
            this.HorizontalScrollBar.State = AGJQW.E_SCROLLSTATE.SS_CANTDISPLAY;
        }

        // Determine need for mp_oCurrentView.TimeLine.ScrollBar
        if (this.Splitter.Right < this.clsG.Width() - (18 + this.mt_BorderThickness))
        {
            if (this.f_TimeLineScrollBar.Enabled == true)
            {
                if (this.f_TimeLineScrollBar.mf_Visible == true)
                {
                    this.f_TimeLineScrollBar.State = AGJQW.E_SCROLLSTATE.SS_NEEDED;
                }
                else
                {
                    this.f_TimeLineScrollBar.State = AGJQW.E_SCROLLSTATE.SS_NOTNEEDED;
                }
            }
            else
            {
                this.f_TimeLineScrollBar.State = AGJQW.E_SCROLLSTATE.SS_NOTNEEDED;
            }
        }
        else
        {
            this.f_TimeLineScrollBar.State = AGJQW.E_SCROLLSTATE.SS_CANTDISPLAY;
        }

        // Determine need for VerticalScrollBar
        if (((this.Rows.Height() + this.mp_oCurrentView.ClientArea.Top + this.HorizontalScrollBar.Height + this.mt_BorderThickness) > this.clsG.Height()) || (this.Rows.RealFirstVisibleRow > 1))
        {
            if (this.f_TimeLineScrollBar.State == AGJQW.E_SCROLLSTATE.SS_CANTDISPLAY)
            {
                this.VerticalScrollBar.State = AGJQW.E_SCROLLSTATE.SS_CANTDISPLAY;
            }
            else
            {
                this.VerticalScrollBar.State = AGJQW.E_SCROLLSTATE.SS_NEEDED;
            }
        }
        else
        {
            this.VerticalScrollBar.State = AGJQW.E_SCROLLSTATE.SS_NOTNEEDED;
        }

		if (this.VerticalScrollBar.mf_Visible == false)
		{
			this.VerticalScrollBar.State = AGJQW.E_SCROLLSTATE.SS_CANTDISPLAY;
		}
		if (this.HorizontalScrollBar.mf_Visible == false)
		{
			this.HorizontalScrollBar.State = AGJQW.E_SCROLLSTATE.SS_CANTDISPLAY;
		}
		if (this.f_TimeLineScrollBar.mf_Visible == false)
		{
			this.f_TimeLineScrollBar.State = AGJQW.E_SCROLLSTATE.SS_CANTDISPLAY;
		}
		if ( this.VerticalScrollBar.State == AGJQW.E_SCROLLSTATE.SS_SHOWN )
		{
			this.VerticalScrollBar.Position();
		}
		if ( this.HorizontalScrollBar.State == AGJQW.E_SCROLLSTATE.SS_SHOWN )
		{
			this.HorizontalScrollBar.Position();
		}
		if ( this.f_TimeLineScrollBar.State == AGJQW.E_SCROLLSTATE.SS_SHOWN )
		{
			this.f_TimeLineScrollBar.Position();
		}
	}

