	AGJQW.ActiveGanttJQWCtl.prototype.mp_ErrorReport = function(ErrNumber, ErrDescription, ErrSource) {
		if (this.mp_yErrorReports == AGJQW.E_REPORTERRORS.RE_MSGBOX)
		{
            //CAMBIAR ESTO POR UN MODAL 
			alert(ErrNumber + ": " + ErrDescription + " (" + ErrSource + ")", "AGJQW Error");
		}
		else if (this.mp_yErrorReports == AGJQW.E_REPORTERRORS.RE_HIDE)
		{
		}
		else if (this.mp_yErrorReports == AGJQW.E_REPORTERRORS.RE_RAISE)
		{
//            var ex = new AGError(ErrNumber.ToString() + ": " + ErrDescription + " - " + ErrSource);
//            ex.ErrNumber = ErrNumber;
//            ex.ErrDescription = ErrDescription;
//            ex.ErrSource = ErrSource;
//            throw ex;
		}
		else if (this.mp_yErrorReports == AGJQW.E_REPORTERRORS.RE_RAISEEVENT)
		{
            ErrorEventArgs.Clear();
            ErrorEventArgs.Number = ErrNumber;
            ErrorEventArgs.Description = ErrDescription;
            ErrorEventArgs.Source = ErrSource;
            FireActiveGanttError();
		}
	}



