        var i;
        var j;
        j = 0;
        for (i = 0; i <= 9; i++)
        {
            this.clsG.mp_HatchFill(0, j * 30, 100, (j * 30) + 20, AGJQW.Color_FromArgb(255, 0, 0, 0), AGJQW.Color_FromArgb(255, 255, 255, 255), i);
            j = j + 1;
        }
        j = 0;
